VALUES  
        (1376361, 'Rodrigo Santacruz', '1979-09-18', 'Rodrigo Santacruz was born on September 18, 1979 in Mexico City, Distrito Federal, Mexico. He is an actor, writer and voiceover artist, known for Fragmentos del destino (2007), Código postal (2006) and La madrastra (2005). Born in Mexico City and raised in Silicon Valley, Rodrigo began acting in Kindergarten when he played the Grinch in "The Grinch who Stole Christmas." Soon thereafter, his first professional credit was on "Plaza Sésamo", the Latin American version of "Sesame Street", which was seen throughout the Americas. After his family moved back to Mexico City in 1988, he studied at C.A.D.A.C. in Coyoacan, Mexico City and participated in numerous school plays as well as attending acting camp Stagedoor Manor in Loch Sheldrake, New York, during the 1995 and 1996 sessions. After high school, Rodrigo studied acting at Acting International in Paris, France before graduating from the American Academy of Dramatic Arts - West in Hollywood, California in 2001. Shortly after, he attended the British Americana Drama Academy in Oxford, England, UK. After returning to Mexico City in 2003, he completed his formal training at CEA (Centro de Educación Artística) and quickly got to work. Rodrigo has worked in many different fields, including television, film, and theater since as well as being a successful voiceover artist since 2010. He is completely bilingual in English and Spanish, and speaks French and Italian as well. He is busy with work, single, and living in Mexico City.', 'Mexico City, Distrito Federal, Mexico', 1, '/dxvBlPJGQXcD5HBbFmJgyUe6Sfj.jpg'),
