        (1377526, 'Andrea Di Maria', NULL, 'Originario di Sala Consilina ma da tempo trapiantato a Napoli, inizia la sua carriera teatrale nel 2002 con la compagnia di Mario Scarpetta.

In teatro lavora al fianco di diversi attori e registi tra cui: Nello Mascia, Gigi Savoia, Fortunato Cerlino, Francesco Saponaro, Vincenzo Cerami, Renato Carpentieri, Giancarlo Sepe, Mario Santella, Maurizio Casagrande, Francesco Paolantoni. Collabora inoltre con vari musicisti tra cui Daniele Sepe, Eugenio Bennato, James Senese.

Nel 2008, arriva il sodalizio con Vincenzo Salemme, che Di Maria affiancherà fino al 2016. Nel 2009 debutta poi al cinema ne Lo spazio bianco, un film di Francesca Comencini, a cui segue nel 2011, Impepata di nozze di Paolo Caiazzo e Angelo Antonucci. Nel 2011 lo troviamo sul piccolo schermo con la terza stagione di La nuova squadra - Spaccanapoli, spin-off de La squadra. Nel 2014 è al cinema sempre al fianco di Salemme, in ... E Fuori Nevica, basato sull''omonima sceneggiatura teatrale, ed poi è protagonista di Torneranno i prati, film di Ermanno Olmi dedicato alla Prima Guerra Mondiale con Claudio Santamaria, Alessandro Sperduti e Francesco Formichetti.

Nel 2015, prende parte a Il sindaco pescatore, la fiction sulla vita di Angelo Vassallo, sindaco di Pollica, freddato da 9 colpi di pistola il 5 settembre del 2010, in un attentato la cui sospetta matrice camorristica è tuttora oggetto di indagini. A vestire i panni di Vassallo, Sergio Castellitto, mentre Andrea interpreta il figlio Antonio. Sempre nel 2015, inizia le riprese della miniserie Lampedusa, accanto a Claudio Amendola, un social drama di grande attualità che mette in scena sentimenti forti e spettacolari.

Nel 2016 lavora ancora con Salemme nel film di Massimo Cappelli Prima di lunedì. Continua poi a dividersi tra cinema, teatro, fiction tv e da aprile 2015, porta avanti la una web serie Casa Surace, con altri ragazzi trentenni napoletani, appassionati di cinema, teatro e internet e dei quali Andrea, conosciuto sul web con lo pseudonimo Tony Cotina, è il più noto. Casa Surace trova il suo maggiore successo sul web realizzando tantissimi video virali che raggiungono milioni di visualizzazioni.', 'Sala Consilina', 1, '/qTrGMPUo1k29wu8izLOW3FinfVg.jpg'),
