        (1378664, 'Clint Ward', '1980-04-28', 'Clint Ward was born April 28, 1980 in Sweet Springs, Missouri. He moved frequently throughout his childhood and graduated High School in Alma, MO. Clint attended Central Missouri State University, where he studied acting for one year, then decided to move to California so he could pursue acting more seriously. He was in a number of plays on the Monterey Peninsula and enrolled in acting classes at the Jean Shelton Actors Lab in San Francisco. Clint has been adding to his film experience by acting in a series of short student films produced by the TAT Program at CSUMB.', 'Sweet Springs, Missouri, USA', 1, '/bEVAke4LjpBs6Zd9EYwYr6nM51p.jpg'),
