        (1379499, 'Andre Darnell Myers', NULL, 'Andre Darnell Myers nasceu em Washington, DC, onde ele aperfeiçoou suas habilidades de atuação, canto, dança e no prestigioso Duke Ellington School of the Arts. Este treinamento preparou-o para um futuro na indústria do entretenimento, e ele começou a trabalhar profissionalmente aos 15 anos de idade, realizando em Nova York e viajando pelo país em musicais da Broadway. Andre freqüentou a Universidade das Artes de Teatro Musical, onde promoveu a sua formação e amor por atuar, cantar e dançar. Agora vive e trabalha em Los Angeles, Andre pode ser visto diariamente em projetos que vão de Televisão e Cinema para imprimir e comerciais. Andre é também um cantor / compositor: (Príncipe ADM), onde ele escreve para si mesmo e outros artistas de gravação. Andre também é proprietária e projetos para Nine Menswear Clothing Company.', NULL, 1, '/5g7qGe4s1lxuLFGO3xiMSFEKvQ1.jpg'),
