        (1379945, 'Philippe Joly', '1976-01-02', 'Philippe Joly (Chinese: 狼森; pinyin: Lángsēn) is a french actor born in Moscow, Russia. He is best known for his role as Zoltan in the 2015 film Pound of Flesh with Jean-Claude Van Damme and his role as Decimus in Jackie Chan’s film Dragon Blade directed by Daniel Lee, in which he appears alongside American actors John Cusack and Adrien Brody, and French singer/actress Lorie Pester.

Joly regularly plays the villain in Action films in Asia, and appeared alongside major Hong Kong actors including Chow Yun Fat as a foreign gangster in From Vegas to Macau, and Andy Lau, whom he faced twice, first as a killer disguised as a maid in the film Mission Milano, and then as Chief Commissioner in Chasing The Dragon. He also worked with Francis Ng in the mob comedy titled "Change Of Gangster". More recent projects include Juno Mak''s latest film "Sons of The Neon Night" (Chinese: 風林火山).

As well as acting, Joly has also written many screenplays, and produced and directed a couple of Independent films in Hong Kong. Joly speaks several languages (French, Russian, Italian and English), is an avid practitioner of close-up magic and card manipulation, and has trained in various Martial Arts since the age of 5. While not a stuntman, Joly often has to perform stunts as required by the Action film genre and the type of characters he plays.  Description above from the Wikipedia article Philippe Joly, licensed under CC-BY-SA, full list of contributors on Wikipedia', 'Moscow', 1, '/wc84b2lOShQuossOLuP6Y7qvBVJ.jpg'),
