        (1381389, 'Alec Rayme', '1978-12-20', 'Born Ali Alherimi in Akron, Ohio, on December 20th, 1978, Alec Rayme was raised mostly in Florida. He was very athletic spending most of his younger days playing sports. After high school he went on to play college football at USM and then Pro Arena football in Florida. After a short lived football career he hit the road in search of something new. He got approached by an agent while working for his fathers store, with nothing to lose he gave it a shot. The first audition he was sent on he booked as Batman in the Batman Stunt Spectacular at Six Flags New Orleans. He had always been into anything that had to do with art, but this very much got his foot into the entertainment industry. From there he fell into stunts and would usually book stunt acting roles. After almost 10 years of stunts he decided that it was enough for him and started to focus mainly on acting. After booking a couple big roles he knew he had made the right decision. He now acts full time as well as owns a food truck called "The Holy Grill" He has never been married and has no children. He hopes to continue to act and also will be making his directing debut in 2014. Recent films "Left Behind" and "Lets Be Cops" both will be released in 2014.  - IMDb Mini Biography By: A.V.A Talent Agency', 'Akron - Ohio - USA', 1, '/iYVNYYIJTtdPWFfAcujmhoZ3bs.jpg'),
        (1381393, 'Randy Havens', NULL, 'Randall P. "Randy" Havens is an actor, known for STRANGER THINGS (2016), GODZILLA: KING OF THE MONSTERS (2019), and LET''S BE COPS (2014).', NULL, 3, '/7Lh5eGcXZUoPJcTWaUw369R706E.jpg'),
        (1381394, 'Chas Harvey', NULL, 'Born in Farmington, New Mexico with two older sisters and one younger brother. Chas Harvey was a baseball player since early childhood all the way to the college level where he suffered a shoulder injury. After baseball, he decided to put his full attention on his passion for acting and hasn''t looked back. In a very short time of acting professionally he has made appearances in both television and in movies showing proof of his drive and potential.  - IMDb Mini Biography By: Abigail Thompson', 'Farmington, New Mexico, USA', 1, '/2taIxqmnBHENQKZSlIz1WqpF6fE.jpg'),
