        (1381473, 'Kara Michele Wilder', '1984-12-28', 'Born and raised in Lyons, Kansas, growing up an athlete, an artist, and a serious tomboy. Her favorite childhood memories come from summering at Lake Wilson with her family. Her mother and father are both Kansas natives. Kara discovered performance art after watching the movie SLAM, starring poet Saul Williams and started writing and performing poetry at the age of 13. She gave up sports to spent her high school career as a Debate and Speech &amp; Drama (Forensics) competitor. Earning five State titles, and two National Semi-Finalist titles (National Forensic League), she attended Kansas State University and continued to compete with the Collegiate Speech Team. Her most important mentor as a youth, was her high school debate coach, Mr. Troyer. Kara moved to Atlanta, Georgia in 2006, and attended law school in 2010. Kara works as a film, television, and commercial actor, a model, and spokesperson.  - IMDb Mini Biography By: Kara', 'Lyons, Kansas, USA', 1, '/mlq6f3r4XXfkFGCpEKTrnEqpn81.jpg'),
