BFA in Acting from the California Institute of the Arts.', 'Wilmington, North Carolina, USA', 1, '/rt3p1sLRbDu06xh4CLF5eUp9TyN.jpg'),
        (1381475, 'Americus Abesamis', '1971-04-18', 'Americus Abesamis was born on April 18, 1971 in Jersey City, New Jersey, USA. He is known for his work on Let''s Be Cops (2014), iCarly: iGo to Japan (2008) and Monster Roll (2012).

Took third place in the heavyweight division during the 2008 and 2009 US Sumo Nationals. In 2011 at the California Sumo Open, he took 1st Place in the Heavyweight and Openweight Divisions. In the 2011 Nationals in Las Vegas, he took 2nd Place in the Masters Heavyweight and 3rd Place in the Masters Openweight Divisions. Member of the United States Sumo Federation and California Sumo Association.', 'Jersey City - New Jersey - USA', 1, '/sZefgkttso3M6Rg63y0I0iYwXC4.jpg'),
