        (1381673, 'Courtney Patterson', NULL, 'Courtney is thrilled to return to the Alliance stage. Other Alliance credits include By the Way, Meet Vera Stark, August: Osage County, Managing Maxine, Who’s Afraid of Virginia Woolf? (w/ Tracy Letts and Amy Morton), Frame 312. Favorite Atlanta credits: Much Ado about Nothing, The Importance of Being Earnest, A Streetcar Named Desire, Cat on a Hot Tin Roof, Twelfth Night,Hamlet (Georgia Shakespeare), Brownie Points, Lost Highway (Theatrical Outfit), The Drowsy Chaperone, Boeing! Boeing! (Aurora Theatre), My Name is Rachel Corrie (Synchronicity Performance Group) TV/Film: Stuff You Should Know, Drop Dead Diva, Past Life, Good Eats, Trouble With the Curve. She can also been seen popping up in various commercials. Much love to my boys, Nick and Javier. ', NULL, 1, '/xqd47Gqy4MpAwCkFaJACksol3Ch.jpg'),
