        (1381698, 'Jason Pendergraft', '1976-05-24', 'Jason was born and raised in the Pacific Northwest in the Seattle area. He earned a degree in theater from the University of Washington. After graduation, he moved to New York where he studied with William Esper at his studio for three years. He is an accomplished carpenter and cabinetmaker. He designs, builds, and installs custom cabinetry and furniture in the NYC area. He lives with his wife, son, and dog in the NYC area.  - IMDb Mini Biography By: jl', 'Washington - D.C. - USA', 1, '/w3YXbqY0n1Ljlo04aqfksi8ifUZ.jpg'),
