        (1381776, 'Luca Vecchi', NULL, 'La sua principale attività nel mondo del cinema è quella di regista ma come interprete tra i lavori più interessanti possiamo citare la partecipazione nel film The Pills (2011) di Luca Vecchi.  Nel 2016 ha inoltre lavorato con Luca Vecchi per la realizzazione del film 

The Pills - Sempre meglio che lavorare dove ha interpretato la parte di Luca. Il film è uscito proprio in questi giorni nelle sale cinematografiche italiane e distribuito da Medusa da giovedì 21 gennaio. Oltre al ruolo di interprete Luca Vecchi ha lavorato come sceneggiatore nel film commedia da lui diretto 

The Pills - Sempre meglio che lavorare (2016). E ancora sceneggiatore nel film di Claudio Di Biagio Vittima degli eventi (2014), sceneggiatore nel film di Claudio Di Biagio Andarevia (2013), sceneggiatore nel film da lui diretto The Pills (2011).', NULL, 1, '/2kzOKMsEhQeI7JXRhRp7rHZDtsW.jpg'),
