        (1381827, 'Guy Barker', '1957-12-26', 'Guy Barker is an English jazz trumpeter and composer. Barker was born in Chiswick, London, the son of an actress and a stuntman. He started playing the trumpet at the age of twelve, and within a year had joined the National Youth Jazz Orchestra. After lessons from Clark Terry in 1975, Barker went on in the 1980s to play with John Dankworth, Gil Evans, Lena Horne and Bobby Watson. Barker was a member of Clark Tracey''s quintet from 1984 to 1992, and continues to play with Tracey, as well as with Tracey''s father Stan. As a sideman he has played with many major musicians and groups, including Ornette Coleman, Carla Bley, Georgie Fame, James Carter, Mike Westbrook, Frank Sinatra, Colin Towns, Natalie Merchant, ABC, The The, Haircut One Hundred, Erasure, Chris Botti, Wham!, Kajagoogoo, The Housemartins, Matt Bianco, Alphaville, The Moody Blues, Sting, Bucks Fizz, Mike Oldfield, Cleo Laine, Acoustic Alchemy, and XTC. Previously, his own band has featured an international mix of musicians – Perico Sambeat, Bernardo Sassetti, Geoff Gascoyne, and Gene Calderazzo', 'Chiswick, Angleterre', 1, NULL),
