        (1382091, 'Perico Sambeat', '1962-07-23', 'Se inicia en la música a los seis años, y a partir de 1980 comienza a tocar el saxofón de forma autodidacta. Se traslada a Barcelona en 1982, donde concluye sus estudios clásicos de flauta al tiempo que comienza los de jazz en el Taller de Músics de Barcelona, donde estudia armonía y arreglos con Zé Eduardo. En 1991 se traslada a Nueva York e ingresa en la New School for Jazz &amp; Contemporary Music, donde toca con maestros como Lee Konitz, Jimmy Cobb o Joe Chambers.  Su prolífica carrera profesional le ha llevado a tocar en festivales y clubs de todo el mundo y a grabar una veintena de trabajos como líder, entre los que cabría destacar "Uptown Dance" con el Mike Mossman Quintet,"Cruce de Caminos" con Gerardo Núñez, "New York-Barcelona Crossing"y "Friendship" con Brad Mehldau, "Flamenco Big Band" o los dos álbumes grabados con el "CMS Trio" junto a Javier Colinay Marc Miralta. También ha participado en casi un centenar de grabaciones junto a artistas como Bernardo Sassetti, Júlio Resende, Bob Sands, Chris Kase, George Colligan, Chano Domínguez, Lluís Vidal, Llibert Fortuny, Toni Belenguer, Javier Colina, Albert Sanz o Jon Robles, entre otros. Además ha trabajado junto a músicos de fama internacional como Pat Metheny, Fred Hersch, Brad Mehldau, Mark Turner, Steve Lacy, Michael Brecker, Kurt Rosenwinkel, Maria Schneider,Daniel Humair o Kenny Wheeler.  Entre sus proyectos más recientes destaca su disco "Baladas", publicado en 2011 y grabado en cuarteto junto a Bernardo Sassetti, Javier Colina y Borja Barrueta. En otoño de 2012 se publicó "Elàstic", una nueva grabación que supone el estreno discográfico de un quinteto internacional formado por el batería norteamericano Jeff Ballard, el pianista belga Eric Legnini, el guitarrista portugués André Fernandes y el contrabajista francés Thomas Bramerie.', 'Godella, Spain', 1, '/yf1LgC5l82cWvWhWpJafzJcTex2.jpg'),
        (1382094, 'Gene Calderazzo', NULL, 'Gene Calderazzo is an American jazz drummer, born in New York, but currently residing in the United Kingdom, where he is a visiting tutor at the Birmingham Conservatoire, the Royal Academy of Music, Trinity and the Guildhall. He also drums for the jazz quartet, Partisans, with Julien Siegel, Phil Robson, and Thad Kelly. He has played with Steve Lacy, Steve Grossman, Eddie Henderson, The NDR, Mike Gibbs, Bheki Mseleku, UMO, Sting, Radiohead, James Moody, Phil Woods, Benny Golson, Ulf Wakenius, Gary Husband, Wayne Krantz, Bobby Watson, Eddie Gómez, Evan Parker, Randy Brecker and brother Joey Calderazzo among others.', 'New York - USA', 1, '/zzarOCT9ZVdyTmy8hrSV5VYAGvu.jpg'),
        (1382098, 'Joseph Lepore', NULL, 'Joseph Lepore e'' nato a New York ed e'' cresciuto a Salerno. Italia quando i suoi genitori sono tornati con la famiglia al proprio paese di origine. Effettuati gli studi classici Lepore si e'' diplomato al conservatorio di Salerno con il massimo dei voti e poco dopo si e'' trasferito a Roma, dove si e'' velocemente inserito in una vivace scena musicale jazzistica.', 'New York - USA', 1, '/ep0UccdchUsbYgrjhbnX5EsbUf4.jpg'),
