        (1382124, 'Byron Wallen', '1969-07-17', 'Byron Wallen is "one of the most innovative, exciting and original trumpet players alive" (Jazzwise Magazine). Widely recognised as a seminal figure in world jazz, he is constantly travelling the world recording, teaching and performing. “Byron''s always absorbing music genuinely draws in the disparate elements of African and Eastern cultures, while retaining true jazz spirit … ” Byron was raised in a musical environment and started learning his first instrument, the piano, at an early age. He then went on to study the trumpet with Jimmy Owens, Donald Byrd and Jon Faddis in New York. His early music career was forged while he was studying for a degree in Psychology, Philosophy and Maths at Sussex University (he graduated in 1992). During this period he recorded for Loose Ends and Cleveland Watkiss, and played trumpet with the likes of Mervyn Africa, The Style Council, Charles Earland, Courtney Pine and Jean Toussaint.', 'London - England - UK', 1, '/pXn1Ic47SyviAXZ56HGybDy53l.jpg'),
        (1382131, 'Pete King', NULL, '', NULL, 1, NULL),
        (1382139, 'Clark Tracey', '1961-05-02', 'Clark grew up in a jazz environment as the son of Stan Tracey CBE, the UK''s leading jazz pianist, and from an early age took to the piano and vibraphones. At 13 he started playing the drums and he turned professional at 17 in 1978 by joining his father''s various ensembles, from trio to orchestra up to the present day. Within that context he has toured worldwide and recorded extensively. In 2001 Clark began his own record company, Tentoten Records and in 2007 he formed Resteamed Records, a label dedicated to his father''s works.', 'London - England - UK', 1, '/hU5NdD0jb0ClX8SWdujxMHEweP7.jpg'),
