        (1382396, 'Derrick Gilliam', NULL, 'Derrick Gilliam was born to Joann Gilliam and Earl Black in Lansing, Michigan. He was a former High School and College basketball star at Lansing Sexton High School and Sam Houston State University. Although Derrick went to college on a basketball scholarship acting has always been his first love. Derrick got his start when he was asked to play Tyler Perry''s stand-in for the movie Alex Cross in 2011. Since then the acting bug bit Derrick and he has been going full steam ahead landing more and more roles. Derrick is married to Tameka Gilliam and they have 4 children, Rayshawn Blackmon, Dominic Gilliam, Danyae''Pugh, and Denver Gilliam, Derrick has 2 brothers, Brandon Gilliam and Jason Black and 1 sister Tammy Black.', NULL, 1, NULL),
