        (1389339, 'Blake Cooper', '2001-01-01', 'Blake Cooper (born in 2001) is an American actor, best known for playing the role of Chuck in The Maze Runner. Born in Atlanta, Georgia on a small animal farm, Blake grew up as a Boy Scout and was well acquainted with animal training. Blake was signed to J Pervis Talent Agency by Joy Pervis when he was 10, after being seen performing at a local event. Immediately after signing, Blake auditioned and landed his first co-star on BET''s The Game. Shortly thereafter, he got a callback for the character of Ethan on USA Network''sNecessary Roughness where he impressed the room and had them laughing out loud, which led to booking the role. In April 2013, when Blake was 12, he landed the lead role of Chuck in 20th Century Fox''s The Maze Runner. After reading James Dashner''s international bestselling adventure story, The Maze Runner, Blake related so well to the character of ''Chuck'' that upon discovering a big screen adaptation in the works, he contacted Wes Ball through Twitter for the role.', 'Atlanta, Georgia, USA', 1, '/dPy339yRfqvhzi6k9RFxLW94YlB.jpg'),
