        (1391793, 'Erik Wernquist', '1977-08-01', 'Erik Wernquist is a Swedish character animator, writer and director. He is best know for creating the character Crazy Frog. Erik first worked as a writer, director and producer of theatre plays before learning computer graphics in early 2000. He worked as freelance 3D artist/illustrator for a few years and started working as a character animator for Kaktus Film in  2004. In 2007, he took a break for animation to co-write the Swedish live action comedy television series Grotesco and direct three out of the eight episodes. He took another break in 2011 to co-write, co-direct and work on the visual effects of the Swedish live action skit show Pulver.', 'Lidingö, Stockholms län, Sweden', 1, '/dfKshddwqw4vXw9Sh76ub2n6k9l.jpg'),
