        (1391874, 'Kyle T. Cowan', NULL, 'Kyle T. Cowan is best known for his role on WGN America''s critically acclaimed show "Manhattan". He is also recognized for writing, directing, producing, editing, and starring in the indie feature film "Camouflage". Cowan''s first big screen appearance was in Stephen Sommers'' film "Odd Thomas". Cowan graduated with a Bachelor of Fine Arts in Writing and Directing from the University of Colorado Denver in December 2010. He has worked on over thirty film and commercial sets. Cowan resides in both Los Angeles, CA and Albuquerque, NM.  - IMDb Mini Biography', NULL, 1, '/9wL14PFDT0ODsqsGkRJBiSYPOSV.jpg'),
