        (1394788, 'Linda Gehringer', NULL, 'Linda Gehringer most recently appeared at the Goodman in The Crowd You''re in With during the the 2008/2009 Season. Her New York credits include The Atlantic Theater Company productions of 10x20 and Rolin Jones’ The Intelligent Design of Jenny Chow which she originated at South Coast Repertory. Other South Coast Repertory credits include the world premieres of Julia Cho’s The Piano Teacher, Horton Foote’s Getting Frankie Married—and Afterwards, Keith Reddin’s But Not For Me, Richard Greenberg’s The Naked Girl on the Appian Way, Annie Weisman’s Hold Please and the West Coast premieres of The Retreat from Moscow, Peter Hedges’ Good as New, as well asDoubt, Hamlet and All My Sons, among others. Regional credits include roles in productions at La Jolla Playhouse, Mark Taper Forum, The Old Globe Theater, Arena Stage, Centerstage, Huntington Theatre Company, New York Stage and Film, Berkshire Theatre Festival and seven seasons at Dallas Theatre Center. Ms. Gehringer’s television credits include Weeds, Without a Trace, Gilmore Girls, Cold Case, The West Wing, Frasier, Ally McBeal, The Practice, The Larry Sanders Show, Law & Order: Criminal Intent and four seasons on Evening Shade. Film credits include As Good as It Gets. She has received numerous critical awards and holds an MFA from The University of Minnesota.', NULL, 1, '/hWRDJvcBLHu2iRCXSIBpmgvmPbG.jpg'),
