        (1395050, 'Michael Ellison', NULL, 'Michael Ellison was born in Ethiopia and fully realized himself as an actor and recording artist in Detroit. The multi-faceted performer often employs entertainment as a vehicle to support social and charitable initiatives throughout the United States and his birth country. He''s headlined national concert and community outreach tours with the American Cancer Society, while aiding fund-raising efforts for orphan and maternal/child health care clinics respectively. Michael holds a communications degree from the University of Virginia.  - IMDb Mini Biography', 'Ethiopia', 1, '/194R89TUr1M5WavBSTyyOXty5Kf.jpg'),
