        (1396554, 'Jordan Jones', '1985-02-15', 'Jordan Jones was born in 1985 in Connecticut and raised in Jasper, Indiana. Jones''s dream through out his life was to be on the ''Silver-Screen''. Shortly after high school he moved to Los Angeles. Within 2 months Jones landed a job as a screen-writer/host for a closed circuit TV Show titled "EB TV" which aired in every ''EB Games'' and ''Electronic Boutique'' (Game Stop) store across the globe. His mother, Caroline, and father, Michael, both worked in the Entertainment Industry. Jones has spent his whole life immersed in every aspect of "The Arts" with his parents being his leading inspiration.

Jones is an avid Martial Artist and a Certified Instructor under Guro Dan Inosanto (Protege &amp; Dear Friend of the late Bruce Lee). Currently, Jones lives in Paris, France &amp; Los Angeles.

