        (1397782, 'Dzajna ''Jaja'' Vanková', '1992-03-21', 'Jana Vaňková, better known by her nickname Jaja, is a Czech dancer and choreographer. She started dancing at age 14 doing freestyle dancing and battling, then later began teaching choreography. Vaňková''s dance career began in 2006 with the dance crew Out Of Bounds, where she learned to dance hip hop, and as an individual, learned popping and locking techniques, among other styles. She later became one of the crew''s choreographers. Two of the Out Of Bounds choreographies won the national championship of Czech Republic in 2010- one of them being a choreography called "Why so Serious?" which was choreographed by Jaja. Both of these choreographies were among the three best choreographies of the year 2010 in the televised Dance crew of the year competition. The crew together with Jaja also became the semi-finalists of Czech Got Talent 2010. As an individual, she won the Dancer Of The Year award and became the national champion in 2008. She has also choreographed theater shows, performed in commercials, and was a backup dancer for Haddaway. In 2010, Vaňková auditioned to join a dance crew based in Houston, Texas.', 'Děčín - Czech Republic', 1, NULL),
