        (1398054, 'Allie Meixner', NULL, 'A Pittsburgh native, Allie became interested in show business at a very young age. She grew up taking master classes from teachers all across the country.  At the age of 17, Allie moved to New York City to pursue her dreams of performing.  Three months later she was cast as the lead in the Tony Award winning musical, Contact, as the “girl in the yellow dress.”  Allie has since accumulated an impressive list of credits in her young career which include touring with Toni Braxton, performing live on numerous episodes of Saturday Night Live, featured as the head cheerleader in the movie, Across the Universe, and has danced with Beyonce on VH1 Fashion Rocks, MTV Video Music Awards, a L’oreal Commercial, and was seen in Macy’s stores all across the country in the Dereon print campaign, Beyonce’s clothing company.  She also had the chance to create the role of “Lady Cross” in Tony award winning director, Jerry Mitchell’s, production of Peep Show, featuring Mel B, Kelly Monaco, and Holly Madison.  Allie also can be seen in Katy Perry’s California Gurls music video and was featured in the new 98 Degrees comeback video, Microphone.  She most recently was featured in a Sony and a national GM commercial and has appeared as a sketch performer on the Tonight Show w/ Jay Leno.  She just finished playing "young groupie" in the Las Vegas Production of ROCK of AGES and this summer will be featured in the new Step Up 5 movie.', NULL, 1, '/6o1Yz0srVnn7PvpIg3394LpmR4t.jpg'),
