        (1398179, 'Saxon Fraser', NULL, 'Saxon is an artist who is inspired by everything from contemporary to urban, Latin and classical dance forms. Holding a B.A.(honors) in Contemporary Dance Kinesiology from the University of Calgary, she has taken her training into almost every genre imaginable collaborating with singers, musicians, actors, photographers, film makers, designers and dancers of every kind. In 2005 she formed the female urban group Malfunktion performing throughout Alberta and B.C. before joining Decidedly Jazz Danceworks for their 2006/07 season and Cross Canada Tour. Upon receiving a grant from the Alberta Foundation for the Arts which landed her in Montreal Quebec, she joined the cast of "Retrospek" by choreographer Alex "Spicey" Lande, as well as her company Unkut Productions, performing in L.A. Carnival and Toronto Choreographers Ball. In 2008 Saxon formed the company Soul Projexions, presenting her 1st show Fluorescent:Lit From Within at the Slammenberry Jam Urban Arts Festival with Blue Collar Dance, leading to her writing, directing and starring in the festivals 2009 Montreal/Calgary collaboration Whodunnit? Her work has been featured in the film series Athletes in Motion for the 2010 Vancouver Olympics, Bazaar: Heroes Edition in Toronto and ReVERB for Dancer''s Studio West for which she received a grant from the Canada Council for the Arts. In spring 2010 she had the opportunity to work with SYTYCDC winner Nico Archambault along with Wynn Holmes in the musical Le Blues d''la Metropole and the film Sur le Rythme (June 2011). Saxon continues to travel internationally as head choreographer for Saco (London), and has just returned from NYC receiving yet another AFA Grant. She was chosen as one of Canada''s "Voices of Positive Women" in 2010, and challenges herself to bring that honor to all her projects and classes as she has been teaching for over 10 years. This year she was thrilled to have danced for incredible new Canadian recording artists such as Lukay, VOYCE, and Wiz Kilo. Other credits include Infusion, Artmistice, Y!DNA Collection, Love Story Soundtrack (Mtl), Electric Shades of Grey (House of Dangerkat), Just Propostu (W&amp;M Physical Theater), Stairway, Calgary Fashion Week, iDUB for the High Performance Rodeo, West Side Story, Encorps Dance Collective, Calgary Cares and Freak Show for the High Performance Rodeo.  - IMDb Mini Biography By: Saxon Fraser', NULL, 1, NULL),
