        (1398204, 'Daniel Morrison', '1986-10-29', 'Daniel Keith Morrison is a Canadian actor. Daniel was born in Glace Bay, Nova Scotia, Canada. He is 5''7" and has dark brown hair and brown eyes. His favorite TV shows are The Fresh Prince of Bel-Air and The Simpsons. His favorite movie is The Lion King and anything with Will Smith in it. Daniel is now working on a new show that will air on Teen Nick in 2009 called all about me. Daniels real name was Tony Sims. His biggest role was as Chris Sharpe on the television show Degrassi: The Next Generation during seasons 3 and 4. His character was dropped when Dalmar Abuzeid and Jamie Johnston came to the Degrassi show. He is currently single. While in high school, he also starred in a feature film made by his fellow students titled Retribution, which was directed by Stu Marks and played at the YoungCuts Film Festival.', 'Canada -', 1, NULL),
