        (1398593, 'Ashlee Nino', '1985-01-11', 'Nino, born in Fort Worth, Texas on January 11, 1985, is a dancer trained in hip hop, locking, breakdancing, clogging, tap, Irish step and popping (the latter her specialty). Ashlee currently appears in the Cirque Du Soleil show Believe,[2]starring Mindfreak''s Criss Angel in Las Vegas at the Luxor resort and casino. (2008–2010)  She was partnered with Ben Susak for the first two weeks of the series, followed by Dmitry Chaplin for week three. She reached the top 12 before being eliminated with Musa Cooper on July 13, 2006. Since the show she has danced with artists such as Miley Cyrus, the Jonas Brothers, Gwen Stefani, Jessica Jarrell, Sean Kingston, Mýa, The Roots, Kat DeLuna, Will Smith and Omarion, and has been a double for Hannah Montana (for the song We got the Partyduring Cyrus'' Best of Both Worlds concert). She currently resides in Los Angeles, CA and dancing for Miley Cyrus. She is also dating Joey Clement, the bassist for Selena Gomez &amp; the Scene.', 'Fort Worth - Texas - USA', 1, '/kPpuK5wJCA9yX3zTS3toGf3NGhQ.jpg'),
