        (1398621, 'Jalen Testerman', '2001-05-30', 'Jalen''s passion and ambition to become a breakdancer began after watching the 2004 movie, You Got Served. Although only 4-years-old at the time, he taught himself how to headspin. The headspin remains his signature dance move. In his early years of dancing, he has performed on the Maury Povich Show, The Oprah Winfrey Show, The Ellen DeGeneres Show, and various NBA basketball games. He has appeared in The Seattle Times and numerous Seattle Sonics promos; including ads in The Seattle Post Intelligencer andNBA Seattle Sonics season tickets. Jalen has also appeared on Nickelodeon’s Fresh Beat Band Season 1 and in 2009, he was an invited competitor for Korea’s “Star Kings” TV show and Germany’s World Vision charity event. In 2011, he was invited to perform at a Christmas event in Hong Kong. His first movie role as a dancer was in the 2010 movie, “Step Up 3-D.” That was soon followed by his role as “Jose Jr.” in the 2011 Adam Sandler movie “Jack and Jill.” He was also featured in Justin Bieber’s, “Santa Claus is Coming to Town” music video. The video is a lead in to the 2011 movie, “Arthur Christmas.” Jalen has also appeared in multiple dance tutorials on Disney’s “Shake It Up” and as “Little Six” in commercials for Six Flags theme parks. Jalen is currently the youngest member of MTV’s “America’s Best Dance Crew” Season 2 winners, Super Cr3w. He appeared on the Season 5 Champions for Charity show with the rest of the crewmembers. Although breakdancing is his first passion, he also enjoys soccer, basketball, football, gymnastics, and just being a kid.  He has black hair and brown eyes.', NULL, 1, '/rr8mFLdRKHJNAsegfyNf90KaKfF.jpg'),
        (1398623, 'Jose ''Boy Boi'' Tena', NULL, '', NULL, 1, NULL),
        (1398626, 'Simrin C. Player', '1998-01-01', 'Simrin C. Player was born in Salt Lake City Utah in 1998 to Richard and Dominique Player. At age three, Simrin began training as a dancer. She and her family moved to Phoenix, Arizona in 2002. She has trained in many different styles of dance including Contemporary, Break Dancing, Jazz, Ballet, Pointe and Tap. All of her performances require a great deal of skilled character performance. She not only acts and sings with supreme commitment and confidence, she also has a reputation for inspiring her peers.

Simrin''s professional career began when she was discovered battling at a B-boy/B-girl battle in 2007 at the age of nine. This led to an invitation to audition with Hi-Hat, one of the entertainment industry''s leading choreographers and visionaries. Simrin privately auditioned with Hi-Hat for Vh1''s Hip Hop Honors Award Show honoring hip hop sensation Missy Elliot. She impressed Hi-Hat during the audition and thus appeared on television for the first time. Since then, Simrin has gone on to work with other popular and well noted entertainers including Justin Bieber, Miley Cyrus, Selena Gomez, Shakira, Willow Smith, Timbaland, Katie Holmes, and Adam Sandler to name a few. Simrin was asked to perform with Willow Smith and Justin Bieber''s U.K. Tour. She performed every night in front of thousands of people in sold-out arenas throughout the United Kingdom. Simrin has built a substantial resume that includes performances in Disney''s "Step Up 3D", NBC''s "The Voice", The Oprah Winfrey Show, The Ellen Degeneres Show, Nickelodeon''s Season 2 of "The Fresh Beat Band" (as Jr. Kiki), and the feature film "Jack and Jill", starring Adam Sandler. She has performed for MTV, the Kid''s Choice Awards, the VH1 Hip Hop Honors Awards, the White House, and much, much more. Simrin has appeared in music videos for Justin Bieber''s "Somebody to Love", Willow Smith''s "Whip My Hair" and "Twenty-first Century Girl", Shakira''s "This Time for Africa", and more. She has appeared in print, movie and television commercials including an extensive Sears Back-to-School campaign with Selena Gomez. Simrin distinguishes herself from her peers through her commitment to achieve perfection in all aspects of her work.

She executes every aspect of her performances to its fullest extent. This is also evidenced in her rigorous and serious routine in practice and rehearsal. When watching Simrin perform, especially in a group situation, she clearly stands apart from the rest. Her smile and personality shine through as much as her exceptional abilities. Through her talent, technique, and performance ability, Simrin has won many awards and competitions. Simrin is a highly motivated student and is committed to making sure her academic career is also a success. Her priorities in life are God, her family, and helping others. She loves animals and participates in a generous amount of charity work. Future aspirations for Simrin include continuing to grow artistically and attending college. She is always looking for ways to challenge herself by accepting new roles in dance, film and television.

- IMDb Mini Biography', 'Salt Lake City - Utah - USA', 1, '/7TR8xMsgJM6FY8TFIohho6bpaLQ.jpg'),
