        (1398833, 'Bailey Hanks', '1988-02-06', 'Bailey Noel Hanks is an American singer, actress, and dancer best known for winning MTV''s Legally Blonde - The Musical: The Search for Elle Woods. She performed on Broadway as Elle Woods in Legally Blonde: The Musical in 2008.', 'Anderson - South Carolina - USA', 1, '/dAK9zEZmzd2HVTM3BaB28cpOBlH.jpg'),
