        (1400168, 'Mark Radcliffe', '1958-06-29', 'Mark Radcliffe is an English broadcaster, musician, author and writer. Born in Bolton, Lancashire, he is best known for his broadcasting work for the BBC for whom he has worked in various roles since the 1980s. In the 1990s and early ''00s he had a long running radio partnership with Marc ''Lard'' Riley on Radio 1. Since 2007, Radcliffe has been partnered with Stuart Maconie, firstly on Radio 2 and then 6 Music. The pair also appeared (vocals only) as the DJ''s in the film God Help The Girl from Belle and Sebastian''s Stuart Murdoch.', 'Bolton, Lancashire, United Kingdom', 1, '/svnS70pVx6NaKulcRpchb3tGGT9.jpg'),
