        (1400270, 'Christina Alex', NULL, 'If you would have told 8 year old California grown Tina Redmond that she would grow up and become everything she loved to do as a child, she would have just laughed and said, she just wants to own her own business. At an early age she started designing doll clothes, mixing makeup colors, styling hair, lip syncing to her favorite songs on camera and creating story lines with her dolls and imaginary friends. Growing up as an only child gave her an enormous amount of room for creativity. After graduating high school she studied at several trade schools which led her to open her own business which was a fashion, beauty and entertainment company. She used her skills to design, cut hair, apply makeup, host events, work as a television production crew member and now an actress that has become Christina Alex. She is aware of what she wants in life in terms of her career direction. Christina is a trained improv actress, that is enjoys networking and learning. This actress has the determination, the discipline and the ability to succeed in whatever her heart desires. Essentially, any director looking to make the audience laugh, cry or frown Christina is the actress to give you a range of many characters.', NULL, 1, NULL),
