        (1400744, 'Joan Smalls', '1988-07-11', 'Joan Smalls Rodríguez (born July 11, 1988) is a Puerto Rican fashion Supermodel. In 2013, she ranked at #8 on Forbes magazine''s "World''s Highest-Paid Models" list. In 2011, she became the first Latina model to represent Estée Lauder cosmetics. In January 2014, Smalls appeared on the "Return of the Supermodel" cover of American Elle. Wikipedia', 'Hatillo, Puerto Rico', 1, '/vVROKlWJYQsAhUTLWVTtTNGuzGN.jpg'),
        (1400745, 'Sara Sampaio', '1991-07-21', 'Sara Sampaio (born 21 July 1991) is a Portuguese model best known for being a Victoria''s Secret Angel and working for Calzedonia, as well as her appearance in the 2014 Sports Illustrated Swimsuit Issue, a first for a Portuguese supermodel, for which she won Rookie of the Year. She has appeared in magazines such as GQ, Elle, Vogue, Glamour and Sports Illustrated. She won Portuguese Golden Globes in 2011, 2012, 2014, 2015 and 2016 for Best Female Model. Wikipedia', 'Porto, Portugal', 1, '/8kUXrySDC9ElfJHxfGLVaNrbO3C.jpg'),
