        (1400907, 'Sal Mistretta', '1945-01-09', 'Sal completed work on an Independent film tentatively titled "Building Girl" and another entitled "Immaculate Misconception" He recreated his role of Pirelli in the top notch production of Sweeney Todd at Seattle''s 5TH Avenue Theatre. David Armstrong, the Artisitic Director, staged this critically lauded and audience pleasing gem. It was part of the Halloween season and as it had never been seen in Seattle the reaction was effusively enthusiastic. He played John Tedesco, the Law firm partner to John Rubinstein''s George Simon, in Off-Broadway''s Counsellor At Law by Elmer Rice at the St. Clement Theatre. This classic 1930''s play received great audience and critical support along with two Lucille Lortel Awards. It garnered the Best Revival for the play and Best Actor award for John Rubinstein''s insightful and moving portrayal. Dan Wackerman, the director, received the coveted Obie Award for his work. Sal shot a Law &amp; Order episode entitled "Fluency" appearing with Dennis Farina and Jesse Martin and did a Third Watch episode "In The Family Way" as Lawyer Alexander Sapp. In the Law &amp; Order, "Acts of Contrition" episode he was seen as yet another lawyer named Wright. He was Coordinating/Aritistic Director last season for the Sutton Place Synagogue''s (the UN''s Synagogue) first Spring Sing Cabaret/Concert: Sutton ''Ly Spring. Gathered for this event were Broadway veteran''s Karen Mason (Mamma Mia/Sunset Blvd),Nat Chandler (Scarlet Pimpernel), Wayne Scherzer (Les Miserables), Patricia Parker (Doll''s Life) and Beth Glover (Counsellor At Law) as well as the talented Cabaret singer Julie Reyburn. Sal sang his "signature" song "On This Night Of A Thousand Stars" from his role as Magaldi in the Broadway and First National companies of Evita. He has also enjoys volunteer singing for the Vocal Ease Organization.  - IMDb Mini Biography By: Sal Mistretta', 'Brooklyn - New York - USA', 1, '/yFkb1ZjzzeKGQ9YqKgtUg3afhye.jpg'),
