        (1400927, 'Raymond Del Barrio', '1964-05-09', 'Ramon Del Barrio is an American performer, choreographer, dancer and singer. He is sometimes credited as Raymond Del Barrio. He is part of a family of artists including his father, orchestrator/ composer, Jorge Del Barrio. Composer and Uncle Eddie Del Barrio, his grandfather, Ramón Gutiérrez del Barrio and his great uncle, Alejandro Gutiérrez del Barrio. At age 20, he was a regular member of the dance troupe seen daily on Solid Gold Hits, a half-hour weekday version of the also-syndicated Solid Gold. High profile credits include On-camera Director and Choreographer for boy-band O-Town on ABC’s primetime hit Making the Band, Principal Choreographer and Co-Director for critically acclaimed musical Sisterella, winner of NAACP Award including Best Musical, Best Director and Best Musical Staging and Choreography. He also created the Musical Staging and Choreography for the Academy Award Winning Best Live Action Film Short, West Bank Story2006. He is stage director and Choreographer for Frankie Valli and The Four Seasons which is on tour globally and played Broadway at the Broadway Theater to sold out audiences and critical acclaim.', 'New York, New York City, USA', 1, '/bzJG3FyGuaNXMAzgj1ODNmCHakb.jpg'),
