On stage, she has performed in "Here" at Toronto Fringe Festival, "Spelling Bee" for Collective Productions, "Chess" at Theater Aquarius, and both "Annie" and "Peter Pan" at Oakville Centre for Performing Arts. Her first staring role was on Syfy''s Ascension as Nora Bryce.', 'Toronto, Canada', 2, '/vgj4zlU5sqJ1EzRgUP3ikRwK4lW.jpg'),
