        (1401537, 'Reese Mishler', '1991-04-20', 'As a youngster, growing up in Owasso, OK, Reese Mishler planned to someday play for his favorite football team, the Dallas Cowboys. Those dreams were sidelined, however, when he suffered a broken pelvis in a game and it failed to heal correctly. It was then that his mother suggested he try acting.', 'Owasso, Oklahoma, USA', 1, '/h1MNdX2n3zlhPGc1fnZ5rnTTKQ0.jpg'),
