        (1401544, 'Mikel Murfi', NULL, 'Mikel Murfi is from Sligo and trained in Ecole Jacques Lecoq, Paris.  He has played in The Playboy of the Western World, The Morning After Optimism, The Tempest and The Comedy of Errors at the Abbey Theatre, Dublin.  Other acting credits include The New Electric Ballroom, Lyndie’s Got a Gun, The Increased Difficulty of Concentration (Druid, Galway), The Chairs (Blue Raincoat, Sligo), The Cure (Half Moon Theatre, Cork), Stokehauling, Half Eight Mass of a Tuesday, Macbeth, God’s Gift and The White Headed Boy(Barabbas), Studs, Melting Penguins (Passion Machine), Lady Windermere’s Fan (Rough Magic) and The Tender Trap (Pigsback). He played in The Lyric Hammersmith, London in Desire Under The Elms, on which he also was the Movement Director.  As a director he most recently worked on The Second Coming (a Yeats based aerial- dance work) with Fidget Feet for The Hawk’s Well Theatre, Sligo. He worked with Fishamble/Galway Arts Festival on The Great Goat Bubble. He co-directed Ruth 66 for Fourth Leaf Theatre. He devised and directed The Poor Little Boy With No Arms at The Lir Academy with the cast. For Red Kettle he directed The Country Girls by Edna O Brien. He devised and directed It Only Ever Happens in the Movies with John Taite and the cast of the National Youth Theatre. He directed Manchan Magan’s Focal Point for TEAM. For the Abbey he directed Arrah Na Pogue and B for Baby. For Druid he has directed Penelope and The Walworth Farce.  Other directing credits include Diamonds in the Soil, The Lost Days of Ollie Deasy for Macnas, Falling out of Love, Yew Tree Productions, Trad, Galway Arts Festival and The Lonesome West, Lyric Theatre, Belfast.  He was Movement Director on the Landmark Productions/Galway Arts Festival production of Misterman. He also tours these days with his one-man show The Man In The Woman’s Shoes.', NULL, 1, '/5wWtra8ZlznwLHRRpMTQCdDR46b.jpg'),
        (1401545, 'Shane O''Brien', NULL, '', NULL, 1, '/qx6rglGj85yENzPoQGISZnuqf9I.jpg'),
        (1401546, 'Chelsea O''Connor', '1990-04-26', 'Born in Germany, Irish actress Chelsea O''Connor grew up in Co. Sligo in Ireland before moving to Dublin to college and to pursue her career. Chelsea was spotted and was scouted in Dublin by a modeling agent which kicked off her career initially in modeling but Chelsea''s career and love for acting developed then went on to book a music video with Cashmere Media for the band Buffalo Sunn (formally known as Sweet Jane). To develop her acting skills further, Chelsea enrolled herself for the Acting for Camera course in ''The Gaiety School Of Acting in Dublin Since then, Chelsea has further developed her acting skills at the Actors Studio at The Factory, Dublin and has worked alongside and in association with some of Irelands leading actors, directors and casting directors. Chelsea''s feature film credits include Love, Rosie and Chelsea was recently cast in the lead role in the Paco Torres directed feature film Saol, which is expected to have its cinema release in 2014.  - IMDb Mini Biography', 'Bremen-Germany', 1, NULL),
        (1401547, 'John O''Dowd', '1967-05-10', 'John Fitzgerald O''Dowd is an Irish Sinn Féin politician. He was the Minister for Education in the Stormont Executive from 2011 to 2016 and the Member of the Northern Ireland Assembly for Upper Bann since 2003.', NULL, 1, '/sNMRvWRa4O0TcjOGrMuhUZeUrhk.jpg'),
        (1401548, 'Rebecca O''Mara', NULL, 'Dublin born, Rebecca grew up by the sea in Sandycove. Daughter of Stephen and Veronica Jane O''Mara, sister of Jason and Stephen James.

She attended Holy Child School, Killiney and later did a degree in Drama and Theatre at Trinity College Dublin. On graduating, she moved to London and worked in film production for some years.

In 2004, she began her acting training at LAMDA. Since graduation, she has worked mainly in theatre, including: the Royal National Theatre, the West End, Theatre Royal Bath, English Touring Theatre, Bush Theatre and the Gate Theatre, Dublin.

She is making her debut on the Irish National Abbey Theatre stage in June 2014, playing Alice in Brian Friel''s Aristocrats.

- IMDb Mini Biography', 'Dublin - Ireland', 1, '/h9J5jOL5sIg8kVxDzRaLYHja2vZ.jpg'),
