        (1404646, 'Casey Messer', '1983-10-08', 'Casey Jean Messer is a beauty queen from Alamogordo, New Mexico who competed at the Miss USA pageant in 2007. Messer won the Miss New Mexico USA 2007 title in a state pageant held in Las Cruces on 24 September 2006. She competed as "Miss Land of Enchantment". This was her second year of competition, as she placed second runner-up to Onawa Lacy of Gallup the previous year. Messer represented New Mexico in the nationally televised Miss USA 2007 pageant which was broadcast live from the Kodak Theatre in Hollywood, California on March 23, 2007. She did not place at Miss USA 2007, which was won by Rachel Smith of Tennessee. Messer is a graduate of New Mexico State University.', 'Soldotna - Alaska - USA', 1, '/mwADMVHBbhs1daCUTZxP6rPAVPd.jpg'),
