        (1405317, 'Robert Firth', '1960-01-01', 'Robert Firth was born in Philadelphia in 1960 into a typical English household, he was the youngest of three. He trained with Jose Quintero, co-founder of the Circle in the Square Theater, in Greenwich Village. In addition to his writing and directing, Firth is also a pop art and voice over artist, and lives in London and Los Angeles. Recent projects include Marvel''s Guardians of the Galaxy, directed by James Gunn and director Billy Lumby''s adaptation of About A Goy.  - IMDb Mini Biography', 'Philadelphia - Pennsylvania - USA', 1, '/1mq1G9iiu5u2QBgfQpcay6i7pIi.jpg'),
