        (1405444, 'Alison Lintott', NULL, 'Alison recently filmed the feature GUARDIANS OF THE GALAXY and ESIOT TROTT for Endor. She appeared in the role of Rita in LINE OF DUTY for World Productions/BBC and other TV includes DOCTORS and HOLBY CITY for the BBC; Grace (regular) in CAMPUS for Monicker/Channel 4; SHERLOCK - THE GREAT GAME for Hartswood/BBC; THE SILENCE for the BBC; THE TUDORS for BBC; PSYCHOVILLE (regular) for BBC; LAW & ORDER for Kudos; LITTLE DORRIT for the BBC and WIRE IN THE BLOOD for Coastal/ITV.', NULL, 1, '/O79yNdlyZaSJFcVBV0uhtRU23J.jpg'),
        (1405453, 'Frank Gilhooley', '1971-03-29', 'Frank Gilhooley grew up in the mining town of Loanhead in central Scotland. Having never dreamed of becoming an actor, he trained as a Landscape contractor starting his own business in the early nineties. Married since 1993 to childhood sweetheart Angela, who even went to the same primary school &amp; high school as Frank, and grew up just around the corner... they now have three young boys. Frank stumbled into acting in 2001 by Getting involved in the Edinburgh Theatre Workshops community play, and was swiftly selected to play Frank Rowley in John Godber''s ''Up''n Under'' in the Edinburgh festival in the same year. Having immediately signed with agent (PLA Associates) after the festival, it took over a year for Frank to get his 1st part... ''John'' in ''One Last Chance'', as one of James Cosmo''s mobsters in the Scottish Higlands. Enjoying varying roles across the UK''s film &amp; television spectrum since then, Frank has worked steadily increasing trade in an enjoyable and varying acting career. In 2007 he experienced working for the first time with director Ken Loach in his award-winning movie ''It''s A Free World'', where he threw the cat amongst the pigeons for award winning lead actress Keirston Wareing. In 2008 Frank attended the first ever Scottish Masterclass given by L.A.''s world famous acting teacher Bernard Hiller, where he was lucky enough to be invited to attend Mr Hillers Los Angeles masterclass later in the year, and had worked closely with Bernie his mentor ever since. Most recently, Frank worked on Case Histories with Jason Isaacs and Victoria Wood, and appeared in the summer of 2014 for James Gunn in Marvel''s ''Guardians Of The Galaxy'' as a violent inmate of the most infamous Galactic Penetentiary The Kyln. In the early part of 2015, Frank will appear as Torin in the global television serialization of the top selling Diana Gabaldon books... Outlander.  - IMDb Mini Biography', 'Edinburgh - Scotland - UK', 1, '/bHWz6d2DsgGGLakJUakELR5Pels.jpg'),
        (1405537, 'Rosie Jones', NULL, '', NULL, 1, '/oPyn6rFqTWj33O1gSg0Oib8rZ5Z.jpg'),
        (1405538, 'Abidemi Sobande', '1993-01-28', 'Abidemi Sobande was born on January 28, 1993 in England, and raised in North London. Whilst living in London, At a young age Abidemi discovered a keen interest in dance and began her training at the Pineapple Dance Studios in Covent Garden, where she learned street dance as well as other dance forms. Not only did her training provide an excellent outlet for the enthusiastic and energetic youngster, it also was the start of her professional acting career.

In 2013 Abidemi had the opportunity to play the body double for Zoe Saldana in Marvel film Guardians of the Galaxy.  - IMDb Mini Biography', 'England - UK', 1, '/hY1j6Dy4f5P4E5Zac98e0ugommY.jpg'),
