        (1405691, 'Ralph Saenz', '1965-05-17', 'Ralph Saenz or Ralph Michael Saenz, better known by the stage name Michael Starr, is  the lead singer for the comedic glam metal band Steel Panther.', 'Chicago, Illinois, U.S.', 1, '/zVI71sroZ1Gl7XJAhXzIIZJoob8.jpg'),
        (1405751, 'Bruno Davézé', '1967-06-05', 'Après avoir suivi une formation au Conservatoire d''art dramatique d''Orléans en 1991 avec Nicole Mérouze et Jean-Claude Cotillard, une formation sur paris à l''école technique expérimentale du spectacle avec Hélene Hily, Bruno Davézé suit des études supérieures en faculté de théâtre à Paris III et mène en parallèle une carrière solo de mime. en 2000, il commence sa carrière théâtrale en interprétant en solo un personnage dans un spectacle Musical en hommage a Bourvil.

Au théâtre, Bruno Davézé joue notamment dans "Les naufragés" de Michel Declercq, "Osceola" de Michel Denneliou, "La nuit des exclus "de Joel Chalude, "La tour de babeth" de Karim Houfaid, "Suivez le guide" de Michel Beatrix et part pour une tournée internationale en Roumanie, au Portugal... avec "Le songe d''une nuit d''été" de Richard Demarcy où il joue le rôle de Bottom.

Au cinéma et à la télévision, Bruno Davézé joue sous la direction de Christian de Challonge dans le "Malade Imaginaire", dans "Un flic" de Fréderic Tellier, dans la série "palizzi" de Jean Dujardin avec Arsène Mosca, "Mes amis, mes amours" de Lorraine Levy. 

De 2013 à 2014, Bruno Davézé joue le Proviseur Stanislavski dans La chronique du jeu vidéo d’Edward Ez et joue le rôle de Iegor dans le dernier film de René Féret Anton Tchekhov 1890.', 'Orléans - Loiret - France', 1, '/5Hn5I2TFBBF2NpT3U0b8WnlHQhT.jpg'),
