        (1406035, 'Giles Panton', '1982-09-13', 'From Wikipedia, the free encyclopedia.  Giles Panton (born September 13, 1982) is an actor from Vancouver, British Columbia, Canada. He has worked in television, film, stage, and web media, and is also known for his voice work.  Giles Panton trained as an actor at the William Davis Centre of Vancouver''s VanArts (Vancouver Institute of Media Arts), graduating in 2005. He has also studied at acting studios in New York.  Panton is the voice of Keith, a lead character in Voltron Force, the 2011 animated series from Nicktoons, based on the 1980s Voltron animated saga.  He has appeared in many television shows and is known for playing the role of Joe Wylee, the police detective in the Flash Gordon television series. He also stars in the 2011 web series, Soldiers of the Apocalypse, playing the character of Twosev.  His first film was the 2005 short production, Bedridden. A later short film, On the Bus (2008) was presented at Oklahoma''s Bare Bones International Film Festival in 2009.  Panton has also been active in Vancouver''s alternate theatre scene. He was a headliner for Spectral Theatre Studio''s 2009-10 season trio of paranormal plays, Deadends 666. And in 2006, he received the award for Best Performance by an Actor in a Supporting Role for his work in the I''m a Little Pickled Theatre Company production of The Book of Liz, by David Sedaris and Amy Sedaris.', 'Vancouver - British Columbia - Canada', 1, '/ixZb1aUaL7yScZYLgUU9LS2Grwk.jpg'),
        (1406037, 'Dave Collette', '1978-05-27', 'Dave Collette is an actor and a cinematographer. ', 'Vancouver - British Columbia - Canada', 2, '/qxmhKnfrYsWFZILCapgWTezuLCU.jpg'),
        (1406094, 'Jameson Trenholm', NULL, 'Jameson Trenholm is a professional actor and ACTRA member residing in Vancouver, British Columbia. Represented by Sara Parker at Principals Talent, Jameson was recently featured on the CW network''s series "Supernatural" and "Cult".  Jameson got his first taste of acting while attending the Alberta High School of Fine Arts. During this time, he signed on with his first agent and gained the lead role in "Superhero Wannabe" followed by a principal role in MTV''s "Man in the Mirror". Jameson attended both the Theatre Studies Program and Motion Picture Arts Program at Red Deer College. There, he had the opportunity to play Tiger in "The Bundle" and the Scarecrow in the college''s largest production ever; "The Wizard of Oz". Highlights of Jameson''s career include a principlal role alongside Samuel L. Jackson and Josh Hartnett in "Resurrecting the Champ", and playing the Hippy with Tom Green and Crispin Glover in "Freezer Burn" which premiered at the Calgary International Film Festival. ', NULL, 1, '/viIwG4WHWuVg6bQDw7PeeIvguyH.jpg'),
