        (1406676, 'Bob Schreck', '1955-02-02', 'From Wikipedia, the free encyclopedia.

Bob Schreck (born February 2, 1955) is an American comic book writer and editor, known for his work for publishers including Marvel Comics,Dark Horse Comics, Oni Press, DC Comics, and Legendary Comics.

 One of Shreck''s earliest jobs in comics was working with Creation Entertainment on their Creation conventions. He later served as administrative director at Comico Comics. For much of the 1990s Schreck was an editor at Dark Horse Comics, and went on to found Oni Press in 1997. Then he went over to work as an editor at DC Comics, where he worked on the Batman comics and the All Star titles, but was laid off in January 2009. Schreck writes the comic book series Jurassic Park: Redemption, as well as being an editor, for IDW Publishing.  In 2011, he served as the editor-in-chief to the new Legendary Comics, a graphic novel venture from Legendary Pictures.', NULL, 1, '/4aYbES7IJueeE4DQz0wv7hG9KDK.jpg'),
