        (1407182, 'Clément Moreau', '1990-10-25', 'Clément Moreau. Né le 25 octobre 1990 à la Roche sur Yon en Vendée, j’ai toujours été passionné de football et mon seul rêve était d’en faire mon métier. Au fur et à mesure des années, il devenait de plus en plus difficile de suivre le rythme imposé et je me rendais compte que j’avais atteint mes limites.  En 2008 il fallut faire un choix concernant mon orientation. « Que faire après mon bac ES? ».  Au moment ou mes parents m’ont posé cette question, je ne sais toujours pas à l’heure actuelle pourquoi ma réponse fût: du cinéma.  Tout s’enchaîna, l’installation à Paris, l’entrée aux cours Florent, la collaboration avec Brigitte Descormiers, mes premiers rôles dans « Profilage »; « Trop la classe verte! »; « Alice Nevers, le juge est une femme »; « Foudre » et aujourd’hui « La nouvelle Maud ».  Depuis, un nouveau rêve grandit en moi, celui de devenir un véritable Acteur et de faire du 7ème art mon propre terrain de foot…', 'Roche sur Yon - France', 1, '/dNSXPMDorJ0cEdPIIgW6L1z5Jgu.jpg'),
