        (1407190, 'Mylène Wagram', NULL, 'Formation à l''art dramatique au studio de Luc Charpentier et à la Faculté de Paris VIII. Monte sur les planches avec les  compagnies Théâtre Noir, Théâtre de l''AIR nouveau, Cie Art Drama Teater de Munich. Stages professionnels en Master Class avec D. Mesguich, Studio Pygmalion et auprès de P. Adrien.

Interprète des pièces du répertoire caribéen et africain : A. Césaire ; T. U''Tamsi ; J. Pliya, Nous étions assis sur le rivage du monde sous la direction de Denis Marleau mais aussi E. O''Neil, Le môme rêveur ; J. Genet, Les Nègres m.e.s. Gilles Chavassieux; Tchekhov La Cerisaie m.e.s. J.-René Lemoine ; St Exupéry Le Petit Prince. Joue actuellement dans Vive la France de Mohamed Rouabhi. Cinéma avec Pascal Légitimus Antilles sur Seine ; Sylvestre Amoussou Africa Paradis. Télévision La Kiné Aline Isserman ; Les cinq dernières minutes J.-M. Seban.', NULL, 1, '/zVn8F5IjIlFr775pXznOYaBiHFA.jpg'),
        (1407199, 'David Migeot', NULL, 'Après une formation au Cours Florent, puis au Conservatoire National Supérieur d’Art Dramatique de Paris avec Klaus Michael Grüber, Catherine Hiegel, Philippe Adrien, Muriel Mayette, il joue dans de nombreuses pièces, notamment Les Placebos de l’histoire d’Eugène Durif, mis en scène par Lucie Berelowitsch, La Ronde d’Arthur Schnitzler, mis en scène par Frédéric Bélier-Garcia, L’Ombre de Mart de Stig Dagerman et Le Songe de Strindberg, dans des mises en scène de Jacques Osinski, L’Histoire du soldat, mis en scène par Lucie Berelowitsch, Verlaine Paul de Georges Boeuf, Biographie : un jeu de Max Frisch et La Cruche cassée d’Heinrich Von Kleist, mis en scène par Frédéric Bélier-Garcia, Nefs et Naufrages d’Eugène Durif, mis en scène par Maurice Bénichou, Mojo de Jez Butterworth, mis en scène par Fred Cacheux, La Bataille de Vienne de Peter Turigni, dans une mise en scène de Catherine Hiegel, Les Géants de la montagne de Luigi Pirandello, dans une mise en scène de Klaus Michaël Grüber… Au cinéma et à la télévision, on a pu le voir dans Garde à vue, court-métrage de F-X. Lescotte, Très bien, merci d’Emmanuelle Cuau, Violence des échanges en milieu tempéré, de Jean-Marc Moutout…', NULL, 1, '/oQkkmywEDrOE4GVz8aVOSSmvmm6.jpg'),
