        (1407460, 'Grégoire Margotton', '1969-11-09', 'Grégoire Margotton est un journaliste sportif français né le 9 novembre 1969 à Lyon, officiant sur Canal+.

 Ancien présentateur de Jour de foot avec Vincent Radureau, il devient le commentateur de l''affiche de Ligue 1 du dimanche soir avec Christophe Dugarry ou Franck Sauzée, Laurent Paganelli et Philippe Doucet. Il présente égalementLa grande soirée de Ligue des champions avec la journaliste Nathalie Iannetta.  Outre le football, Margotton est le spécialiste de l''athlétisme sur la chaîne cryptée. Il y commente les meetings de laGolden League en compagnie de Jean Galfione, Renaud Longuèvre et Marc Maury. Il a également commenté ce sport lors des Jeux olympiques de Pékin 2008. Il a enfin commenté les compétitions de tir à l''arc avec Sébastien Flute.  Il commente Pro Evolution Soccer 2010, Pro Evolution Soccer 2011 et Pro Evolution Soccer 2012 avec son coéquipier de Canal+ Christophe Dugarry et Pro Evolution Soccer 2013 avec Darren Tulett, et ce, jusqu''à Pro Evolution Soccer 2015. Il fut commentateur de FIFA 2003, FIFA 2004 et FIFA 2005 avec Olivier Rouyer et Rémi Garde.  Par ailleurs il écrit en 2002 le texte du film Comme dans un rêve, biographie de Zinédine Zidane.  Le 10 mai 2013, il reçoit la Lucarne d''or, récompensant le meilleur commentateur de football.  À partir de septembre 2013, il commente la Ligue des champions avec Éric Carrière.  Il participe également quelques fois à l''émission Les Spécialistes.  Depuis 2014, il commente en alternance avec Stéphane Guy l''affiche du samedi à 17 h et du dimanche soir sur Canal+.

  ', 'Lyon,France', 1, '/6223VFwxT0QZ4kYpXvjKTpNmnAO.jpg'),
        (1407473, 'Jean Galfione', '1971-06-09', 'Jean Galfione, né le 9 juin 1971 à Paris, est un athlète français, spécialiste du saut à la perche.  En 1996, à Atlanta, il devient champion olympique du saut à la perche en effaçant une barre à 5,92 m, nouveau record olympique. Premier français à franchir la barre des six mètres, le 6 mars 1999 à l''occasion de sa victoire aux Championnats du monde en salle de Maebashi, il détient le record de France en plein air de 1993 à 2009.  Depuis 2005, Jean Galfione se consacre à la voile, sa deuxième passion. Il est désormais le skipper du Team Serenis Consulting1 et prépare la Route du Rhum 2014.', 'Paris,France', 1, '/oIrzbLwncktsz7H0R3GAV3FSSPf.jpg'),
        (1407477, 'Jean-Baptiste Boursier', '1982-01-01', 'Jean-Baptiste Boursier est un journaliste de radio et de télévisionfrançais, né en 1982.

 Après une année de droit, Jean-Baptiste Boursier étudie l''anglais, avant d''entrer au Studio Ecole de France, à Boulogne Billancourt.  Il exerce d''abord en radio à Chérie FM, puis sur le réseau France Bleu.  En 2006, il est recruté par TV Tours pour présenter l''émission Tout sur un plateau à 18 h.  En janvier 2009, il rejoint la chaîne d''information en continu i&gt;Télé. Pendant une saison et demie, il anime les tranches du samedi et dimanche soir. En septembre 2010, il reprend la présentation des matinales week-end, succédant à Julian Bugier. En mars 2011, à la suite du départ de Thierry Dugeon, il reprend la présentation de la tranche 22 h - 0 h du lundi au vendredi.  En septembre 2011, il rejoint BFM TV, la chaîne concurrente d''i&gt;Télé, où il présente les journaux télévisés du soir.  En 2012, il participe régulièrement à l''émission Les Affranchis sur France Inter.  À la rentrée 2012, il s''installe aux commandes d''une nouvelle émission de débats et de décryptage de 23 h à minuit, Le Soir BFM. Depuis le 4 mars Le Soir BFM dure 1 heure 30 de 22h30 à 0h00 au lieu de 1 heure d''émission qui était de 23h00 à 0h00.  En Juin 2014, il anime en direct depuis Rio de Janeiro le "20h do Brasil" sur BFM TV pendant la période de la Coupe du monde de football.  À la rentrée 2014, il ne présenté plus le Soir BFM mais qui devient Grand Angle du lundi au jeudi de 22h à minuit, soit trente minutes de plus que la saison précédente. Chaque soir dans cette émission un reportage long format de cinq à dix minutes pour approfondir l''un des grands titres de l''actualité du jour.  Il apparaît également dans son propre rôle dans le film Fastlife de Thomas N''Gijol.

 ', NULL, 1, '/9KhF3fEiPDrpPxfMTM4OqUPmK06.jpg'),
