        (1407485, 'Ben Bassaw', '1989-07-09', 'Benjamin Bassaw dit Ben Bassaw (né le 9 juillet 1989 à Angoulême) est un athlète français, spécialiste du sprint.

 En 2010, Ben Bassaw devient champion de France espoirs du 100 mètres, à Niort, et porte son record personnel sur la distance à 10 s 58. Il participe dès l''année suivante aux Championnats d''Europe espoirs d''Ostrava où il s''incline dès les demi-finales du 100 et du 200 m.  Auteur de 10 s 31 sur 100 m, début juin 2012 à Poitiers, il termine deuxième du 200 m des championnats de France d''Angers, derrièreChristophe Lemaitre, dans le temps de 20 s 58 (+0,5 m/s), nouveau record personnel. Sélectionné en équipe de France lors desChampionnats d''Europe d''Helsinki, Ben Bassaw est éliminé en demi-finales du 200 m et ne participe pas au relais 4 × 100 m. Lors dumeeting Herculis, en absence de Lemaitre et de Vicaut, il contribue comme premier relayeur à la 4e place de l''équipe de France en 38 s 78, composée également de Ronald Pognon, Pierre-Alexis Pessonneaux et Emmanuel Biron.  En mai 2014, Ben Bassaw remporte la médaille de bronze du relais 4 × 200 mètres lors des premiers relais mondiaux de l''IAAF, à Nassauaux Bahamas, en compagnie de Christophe Lemaitre, Yannick Fonsatet Ken Romain. L''équipe de France, qui est devancé par la Jamaïqueet Saint-Christophe-et-Niévès, établit un nouveau record d''Europe en 1 min 20 s 66.  Il améliore son record sur 200 m, le 23 juillet, lors du meeting de la Roche-Sur-Yon. Il réalise 20 s 43, performance qui lui permet de réaliser les minima pour les championnats d’Europe de Zurich.

 ', 'Angoulême - France', 1, '/uMsA7e3i8vKiBgrQtXArM1iiQrq.jpg'),
        (1407487, 'Mateo Sossah', '1988-04-28', 'Mateo Sossah (né le 28 avril 1988 à Lille) est un athlète français spécialiste du décathlon. Il s''entraîne à l''université de Caroline du Nord où il suit en parallèle des études commerciales.

 Il se classe 4e des Championnats d''Europe d''athlétisme juniors à Hengelo en 2007, avec 7 516 points.  Le 11 juin 2009, il se classe deuxième du décathlon des Championnats NCAA de Fayetteville, réalisant un total de 8 044 points. Considéré comme l''un des favoris des Championnats d''Europe espoirs d''athlétisme 2009, l''athlète français remporte la médaille d''argent avec 7 885 points, derrière le Néerlandais Eelco Sintnicolaas. Peu après, il termine 29e des Championnats du monde à Berlin 2009, avec 7 682 points.', 'Lille - France', 1, '/3Coo0ygwiJFZ80dW3xallUdzwy8.jpg'),
