        (1408591, 'Marcello Caridade', '1963-05-03', 'Marcello Caridade, atuou por oito anos ao lado de Chico Anysio em programas como Escolinha do Professor Raimundo e Chico Total e ainda em programas como Zorra Total, Sob Nova Direção e Malhação. Atualmente integra o elenco de Os Caras de Pau (Rede Globo), onde dá vida ao português SEU MANUEL, dono da padaria. Em teatro, seu último trabalho como ator foi no musical Orlando Silva, o Cantor das Multidões, de Fátima Valença e Antonio De Bonis (direção Antonio DeBonis). Para esse ano, prepara seu monólogo, sob a direção de Leandro Hassum, a comédia Testosterona, ao lado do ator Marcio Lima (o Zé Marilson de Os Caras de Pau). Em direção, seus mais recentes trabalhos são: a comédia Balaio de Gatos, texto de Bia Montez e Fátima Valença, estrelado pela comediante Fabiana Karla; e Uma Professora Muito Maluquinha, de Ziraldo; além dos espetáculos da Cia. de Repertório de Teatro Musical, que traz um trabalho destinado ao público infanto-juvenil. Em 2008, Marcello Caridade foi homenageado pelo Centro Brasileiro de Teatro para Infância e Juventude, por seus trabalhos direcionados ao Teatro Infanto-Juvenil. Atualmente está nos longa metragens "O PEREGRINO" (a biografia de Paulo Coelho) e "OS CARAS DE PAU", ambos a serem lançados em 2014.', NULL, 1, '/60fYsWzqgwwCwHTI5iLVCJOkW8d.jpg'),
