        (1408713, 'Taylor Blackwell', '1998-09-01', 'Taylor Blackwell has been acting since she was 5 years old and has appeared in more than 40 commercials, 10 films, numerous theater productions and several network TV programs. She is best known for her role as Lauren Evans on the Starz original series "Magic City." She has also done hundreds of national print campaigns, catalogs, and voice over work. She was nominated for a Young Artist Award for her work on Magic City and Army Wives. Born in West Palm Beach, Florida, she is a theater major at a performing arts high school, and loves anything to do with acting, singing, dancing and performing. In her spare time, she also loves to play the piano, sew, knit, swim, do arts and crafts, and play with her dog, Maggie.  - IMDb Mini Biography By: M. Blackwell', 'West Palm Beach - Florida - USA', 1, '/WCD13PNs8IAL30OyCu6TGWjQkO.jpg'),
