        (1408750, 'Kim Ostrenko', NULL, 'From Wikipedia, the free encyclopedia.  Kim Ostrenko is an American actress with roles in 16 movies and TV shows, most recently playing Alice Connellan in Dolphin Tale (2011). She has also played a number of theater roles.  Kim Ostrenko was born and raised in Miami, Florida, where she lived with her family on a small sailboat on the Miami River until the age of five. Ostrenko graduated from Florida International University with a Bachelor of Fine Arts in Theater and has worked in theater, commercials, film and TV ever since.  She has been honored with two Carbonell Awards for Best Supporting Actress and three for Best Ensemble for her theater work. Among her more famous credits in TV and film are: Burn Notice, HBO''s From the Earth to the Moon,Boynton Beach Club, Sex Drive and Bachelor Party 2.  Ostrenko has worked with Ashley Judd and Kris Kristofferson (Dolphin Tale), Seth Green (Sex Drive).', 'Miami, Florida, USA', 1, '/11XyELcsZyzHUpFntf7aS3yFtVW.jpg'),
