        (1408786, 'Lauren O''Quinn', NULL, 'Lauren O''Quinn is an award-winning actor, teacher, director, and producer. Born and raised in a small town in middle GA, she discovered her passion for acting early on through church plays and the high school drama club. She attended The University of Georgia before moving to Orlando, FL. Since that time, she has appeared in over 200 national and regional commercials, and numerous films and television shows. Her love for the craft of acting is solidly split between her own pursuits in front of the camera - and mentoring other actors. She''s been a sought-after teacher and private acting coach since 1999. She owns a successful acting studio in Orlando called ClassAct Studios where she encourages her students to "ride the roller coaster" and is so happy to be able to follow her bliss on a daily basis. She''s married to fellow actor/entertainer, Chris Burns, and is the proud mother to 2 beautiful girls.  - IMDb Mini Biography By: Lauren O''Quinn', 'Georgia, USA', 1, '/drBat2OCdjX1LzPz1IrlFrJl85j.jpg'),
