        (1408801, 'Raheem Babalola', NULL, 'Raheem Babalola is an Atlanta based actor originally from Clearwater, FL. He began acting at an early age and gravitated toward a career in theatre, TV shows, and commercials. He has built a solid resume over the years working alongside some of the industries top professionals nationwide. Raheem''s work ethic, determination, and passion continue to shape him into a diverse actor with terrific range!

His most memorable work includes a role on the WGN TV series Underground, where he performed his own stunts, HBO’s Ballers, as the general manager of the New Orleans Saints, and a recurring role on the USA TV series Graceland.

When he''s not acting, Raheem enjoys spending time with his family, doing national commercials, and frequently appears as a guest host on HSN (Home Shopping Network).', NULL, 1, '/ra1VEF8oaiYuXGf6YtNrpV7VyaC.jpg'),
