        (1408809, 'Hannah John-Kamen', '1989-09-06', 'Hannah John-Kamen is a British actress, best known for her roles as Dutch in Killjoys and as Viva in the West End musical Viva Forever. She is also known for her role as a Dothraki widow in the sixth season of the HBO series Game of Thrones and for voicing Sweet Shalquoir in the video game Dark Souls II.', 'Anlaby, East Yorkshire, England', 2, '/2dWMAk6l0KavjxZpR1P4ln7bxYg.jpg'),
