        (1408880, 'Royal Robbins', '1935-02-03', 'Royal Robbins is one of the pioneers of American rock climbing. After learning to climb at Tahquitz he went on to make first ascents of many big wall routes in Yosemite. As an early proponent of boltless, pitonlessclean climbing, he, along with Yvon Chouinard, was instrumental in changing the climbing culture of the late 1960s and early 1970s by encouraging the use and preservation of the natural features of the rock. He went on to become a well-knownkayaker.', 'West Virginia, USA', 1, '/nkcAASVYcAZxcmbwlyh2NLdmGpW.jpg'),
        (1408881, 'Miako Tadano', NULL, '', NULL, 1, NULL),
        (1408884, 'Kasity Koehn', NULL, 'Actress Kasity Koehn was born on September 21, 1997, in Hendersonville, Tennessee.  Kasity moved from Tennessee to Florida to pursue a more serious acting and modeling role.  She has appeared in many independent and short films like The Awakening.  As a junior in high school, she enjoys cheerleading and gymnastics when she''s not on a set or on a location shoot.  Kasity was recently crowned Miss Teen Florida US Nations in Hollywood, Florida. ', NULL, 1, NULL),
        (1408887, 'Cassie Livingston', NULL, 'Cassie Livingston has been acting since she was 3 years old and has appeared in over 40 commercials and 5 films. She has trained in Ballet and Jazz since she was 10. She wrote a screenplay for a comedic short film which has been produced and entered into film festivals. Cassie was born in Orlando, Florida. She loves anything having to do with acting, dance, or performing. She is an active member of the Reel Talent Performing Arts School. In her spare time, she loves volunteering in the community and spending time with family and friends.  - IMDb Mini Biography By: I Livingston', NULL, 1, '/2IkxyFR9aFO5WTjllQTxVAZ59sw.jpg'),
        (1408889, 'Thia Marie', NULL, 'Thia Marie is an actress known for Dolphin Tale 2 (2014). She began her acting career at the age of eight when she was introduced to musical theatre. She has played Katrina in Sleepy Hollow, Fanny in Christmas Carol, and Alice in Alice in Wonderland, to name a few. Although she loves performing in front of a live audience, she is now directing her attention toward film and television.  - IMDb Mini Biography', NULL, 1, '/wf3wAYEbrNyfaD8Ql9WFye5e2A4.jpg'),
        (1408892, 'Steven King', NULL, '', NULL, 1, NULL),
        (1408893, 'Andrew McKeough', '1996-07-26', 'Andrew McKeough has a vast knowledge in the music, film, and theater departments. He is a three-time Cappie nominee and is a performer with the American Music Abroad Bronze Tour (2012 &amp; 2014). He is close with classical-crossover singer Jackie Evancho. Andrew has performed at different venues across the United States and throughout Europe. He has also performed for many world leaders and politicians. Andrew has also been in many films and television shows. Andrew currently stars in The New York Psycho film series. He has worked alongside some of the greatest performers on Broadway, like Sutton Foster in the show Anything Goes. He has also worked with the casts and been a guest performer in different shows, like Mary Poppins, The Little Mermaid, The Lion King, and more! His vocal and theatre coach is Mrs. Jennie Eisenhower. He will be touring this year so look for him when he comes to a location near you!', 'Philadelphia - Pennsylvania - USA', 1, '/v1H6ASJx7zKBirr7whseMva2Hpy.jpg'),
