        (1409187, 'Thomas Canestraro', '1986-06-14', 'Thomas Canestraro was born in Vitry Sur Seine, France. He is of French and Italian ancestry. His Father is of Italian descent and was an Amateur French Footballer who ascended through his clubs ranks nearly making Nationals. Recognizing Thomas'' talent, Canestraro''s father supported Thomas'' athleticism by attending every fight and daily practice.  In 2011, Canestraro received his Masters Degree from The National Institution of Physical Education (INSEP), a school that combines rigorous secondary education with elite-level athletic training. While pursuing his studies at INSEP, Canestraro was on the competitive Boxing, Swimming and Rugby team.', 'Vitry-sur-Seine - Val-de-Marne - France', 1, '/gz67lEoYDSpaXF7cCUH5vvV8GeI.jpg'),
