        (1410389, 'Fritzi Brunette', '1890-05-27', 'Fritzi Brunette è stata una popolare attrice del cinema muto. Cresciuta nella città di New York, si trasferì in seguito a Los Angeles, insieme al marito, agente immobiliare. Da lì ebbe inizio la carriera come attrice. È ricordata come una delle performer dal guardaroba più ampio: in un film - Unto Those Who Sin - arrivò a cambiare per ben 18 volte la gonna. Si spense a Hollywood in seguito a una prolungata malattia.', 'Savannah, GA', 1, NULL),
