        (1410540, 'Meredith Majors', '1981-11-21', 'Meredith Majors is an American Actress, Producer, and Writer. Her father, Ronnie Cottrell, is a football coach and has coached for such teams as Florida State University and University of Alabama. Meredith''s mom is a nurse and nursing professor at a college in Florida. She has two brothers, Kevin and Daniel. She studied acting (Meisner) at Florida State University and received an English degree: concentration in Professional Writing from the University of West Florida. However, she has studied multiple acting techniques and is always working on her craft as an actor. Meredith enjoys the outdoors and loves being active. She owns a production company: Savage Beast Films with her husband, Chris Majors. Together, they strive/aim to bring integrity and honor back into the entertainment and film industry with one quality film at a time.', 'Troy, Alabama, USA', 1, NULL),
