        (1411089, 'Barry Clifton', NULL, 'Barry recently had the privilege of performing with Academy Award winning actress Tatum O''Neal, John Corbett, and Ted McGinley in God''s Not Dead: A Light in Darkness and has appeared in a multitude of independent short films, spec films, including Chop with Natalie Canerday, and several student films with local university graduate students over the last 3 years. On stage, Barry became an Equity Membership Candidate while performing in Arkansas Shakespeare Theatre''s production of A Midsummer Night''s Dream and West Side Story in 2016. He has also appeared in two World Premier plays, Karski''s Message based on the life of Jan Karski and Mrs. Miniver based on the Academy Award winning film of 1942. Barry began acting at age 9, performing in several musicals at The University of Arkansas of Fort Smith. When aged 15, he set acting aside and began following a "Long and Winding Road". Finally, in 1991, after many years of life and loss, he began the journey back home, signing with a local talent agency in Little Rock, AR. He was fortunate enough to get some work, even earning SAG eligibility in 2000 after working on Chasing the Dragon, starring Lisa Marie. In 2014, nearly 40 years after his last play, he returned to the stage as Duncan in The Savage Muse production of Macbeth. After that, the fire was rekindled. His [mis]adventures during the first 30 years of his life, coupled with the personal growth and healing over the last 25 years, have provided him an incomparable platform on which to build unique and rich characters. He has reclaimed his passion and is looking forward to bringing new characters to life to an ever widening audience.', 'Fort Smith, Arkansas', 1, '/aF6gfAC3sRfjaJcn75jLH1TB3QM.jpg'),
