        (1411402, 'Lindsay Sawyer', NULL, 'Lindsay Sawyer is currently a senior at The University of Oklahoma getting her Bachelors of Fine Arts in acting. Recently, she played Rodeo Queen, Jeanie Simms, in Cowgirls n’ Angels, starring James Cromwell and Bailee Madison, set to release May 25. At the University of Oklahoma Theatre, Lindsay played Jerrie Cobb in the World Premiere They Promised Her the Moon, Child- Dracula, Mildrid- Ah, Wilderness!, Agnes- Shadowbox, Scout- To Kill a Mockingbird. She has also performed at Lyric Stage Theatre in Dallas as: Deborah Sue- Bye, Bye Birdie, Johanna in World Premiere Children’s Letters to God. The 10 year old inside of Lindsay is ecstatic to get to play a superhero.', NULL, 1, '/4lTa65hQWQFgLolJ30ysF2lrEiE.jpg'),
        (1411406, 'Alexandra Harris', '1981-01-01', 'Alex Harris is a native Oklahoman, having grown up in Edmond. She is currently a Junior Art major at the University of Arkansas in Little Rock. Alex did her first play in the fifth grade and has been acting ever since. In addition to regular school drama involvement, she has acted in a long list of productions with local theatre training academies, ‘On Broadway’ and ‘Lyric Academy’. She has been cast in a handful of commercials and has played a leading role in the feature film “ The Prophets Son” and the short film “Close Your Eyes”. Alex views acting as a lifetime endeavor. She is ex-tremely honored and grateful to have been cast in this exciting new movie.', 'West Sussex, England', 1, '/hrDAZPTelJ9qPHbL2XEH2f7aFlE.jpg'),
