        (1411525, 'Michael Tong', NULL, '', NULL, 1, NULL),
        (1411561, 'Sasha Luss', '1992-06-06', 'Sasha Luss was born in Magadan and moved to Moscow at a young age. At the age of fourteen, Sasha signed with IQ Models in Moscow. Shortly  after she turned sixteen years old, Sasha walked in her very first  fashion show for Alena Akhmadullina during Moscow Fashion Week  Spring/Summer 2008.

Sasha quickly shot to fame in the Russian fashion industry and was featured in multiple issues of Vogue Russia and L''Officiel Russia in 2008. She signed with DNA Model Management who flew her to Europe and New York, where she walked in fashion shows for designers such as DKNY and Antonio Marras. Despite these successful bookings, her career failed to take off and she returned to Russia to complete her education. Sasha decided to sign with Elite Model Management in Paris and Women Management in Milan as a development model and in 2011 left her mother agency, IQ Models, to join Avant Models.

She walked in 58 fashion shows during the Fall/Winter 2013 season for some of the world''s most prestigious brands such as Prada, Valentino, Calvin Klein, Louis Vuitton and Givenchy. Following her impressive runway presence, she was chosen to star in ad campaigns for Carolina Herrera, Max Mara, Valentino and Tommy Hilfiger. Sasha''s career continued to blossom and she walked in another 53 fashion shows during Spring/Summer 2014, cementing her position as one of the most in-demand models of the moment. She was awarded the honor of "Model of the Year" by Glamour Russia in 2013.[7] She was captured for Lanvin and for Chanel by her long-time supporter, Karl Lagerfeld, for the fashion house''s Spring/Summer 2014 ad campaigns. Shortly after this, Sasha landed the biggest job of her career -as the new face of Dior Beauty.[8] She is currently ranked as one of the Top 50 Models in the world by models.com. Luss starred in the 2014 Fall/Winter Versace Jeans AD Campaign.

Sasha has been featured in some of the world''s most influential fashion magazines. She has been featured four times on the cover of Numéro, twice on the cover of Vogue Russia, including their 13th anniversary edition, and also on the cover of Vogue Italia. Sasha has been captured by some of the world''s most influential fashion photographers, Steven Meisel, Peter Lindbergh, Inez and Vinoodh, Willy Vanderperre, Karl Lagerfeld, Patrick Demarchelier and appearing in magazines such as W Magazine, Vogue China, AnOther Magazine, Interview and CR Fashion Book.', 'Magadan, Russia', 3, '/nl5wcSJC2rpVO447hYcW5BiK3Rw.jpg'),
