        (1411603, 'Emily Fonda', NULL, 'Emily Fonda was born in Sydney, Australia. She earned a Bachelor of Communications from Griffith University in Australia, and intended to pursue a career in Journalism. After a brief stint in London, England, where she performed with the Thieving Dingo Theatre Company, a move to Vancouver, Canada reignited her dreams of a dedicated career as an actress. Since arriving in Hollywood North, she has appeared in television series'' "Citizen", "Witches of East End", "Girlfriends Guide to Divorce" and "The Tomorrow People". Emily play''s Ann Marie in "Supernatural" Season 10, alongside Jensen Ackles. In 2014, Emily will make her feature film debut in Tim Burton''s "Big Eyes", followed by the highly anticipated "Fifty Shades of Grey", as ''Martina''. Catch her in the trailer delivering the infamous line "Mr. Grey will see you now". Emily now resides in Los Angeles.', 'Sydney, Australia.', 1, '/k5jsF0ig4N4G16fIzMeq42VgRh7.jpg'),
        (1411620, 'Les Miles', '1953-11-10', 'Leslie Edwin "Les" Miles is a actor and an American college football coach and the current head coach of the LSU Tigers football team. He is nicknamed "The Hat" for his signature white cap, as well as "The Mad Hatter". Prior to coaching LSU, he was the head coach at Oklahoma State. He was formerly an assistant at Oklahoma State as well as at Michigan, Colorado, and the Dallas Cowboys. Miles has held the head coaching position at LSU since January 2005 and coached the Tigers to a win in the 2008 BCS National Championship Game against Ohio State, 38–24. His contract runs through 2017.', 'Elyria - Ohio - USA', 1, '/arqpqkRD2TncqYtOX3FupAE4uBi.jpg'),
        (1411622, 'Jesse Moore', NULL, 'Born and raised in New York, award-winning actor, singer, composer and musician Jesse Moore has performed on concert and theatrical stages throughout the world. He began his career at the tender age of 12, winning the talent contest at the Apollo Theater. Viewers will recognize his face from numerous portrayals of characters from doctors to lawyers to a homeless vet to a South African teacher in a myriad of TV, theater and film productions. He studied acting at the prestigious American Conservatory Theater (ACT) in San Francisco, the Los Angeles Civic Lite Opera Musical Theater Workshop, and with Stella Adler.  - IMDb Mini Biography', NULL, 1, '/Oh1DfNh9XIS2hKRUFLOus6b6Ra.jpg'),
        (1411625, 'Terence Rosemore', '1964-07-29', 'Terence Rosemore was born in Great Falls, Montana and raised in New Orleans where he got his start as an Actor in Ted Gilliam''s Dashiki Theatre Company.

He is an award winning Filmmaker and Actor who has worked with some of the biggest names in the industry including Robert Duvall, Halle Berry, Matthew McConaughy, Kevin Hart, Nicolas Cage, Don Cheadle, and Will Ferrell.

Rosemore is the founder of digital media company Out of Nowhere Films. Content created by Rosemore has been featured on NBC/Universal''s DotComedy.com, ChannelME.TV and Columbia/Sony''s Crackle.com.

He lives in Los Angeles writing, directing, producing and developing Film, Television and Web based projects. IMDb Mini Biography', 'Great Falls - Montana - USA', 1, '/7UR6TjMxxflajE0ormhoReccoNR.jpg'),
        (1411632, 'David DeSantos', NULL, 'David DeSantos was born and raised in the San Fernando Valley to an industry family. He grew up in the post production world, having a Grandmother who was a film editor on tv''s first western, Gunsmoke. He attended the American Academy of Dramatic Arts, and has been working in the nations top regional theatres for almost a decade, as well as working on Television''s highest regarded shows. In 2011, he was honored to be a part of a dramatized version of Shakespeare''s Hamlet that was nominated for a Grammy for Best Spoken Word / Audiobook.  - IMDb Mini Biography', 'San Fernando Valley - USA', 1, '/9kItlGAGOPDtKEha5KrmUJ9fNDO.jpg'),
        (1411633, 'Mike Bleed', NULL, 'Some people are natural born stars. From the womb to the tomb, only a certain few entertainers such as Stevie Wonder, Michael Jackson and Prince truly possess the instinctive abilities to appeal to audiences from all walks of life. New Orleans born showstopper Michael Carlione A.K.A. Mike Bleed Da BlockStarr is such an entertainer. From music, to modeling, and now film, this young talent is nothing short of what can become a house hold name.  - IMDb Mini Biography', NULL, 1, NULL),
