        (1411663, 'Maurice Jones Drew', '1985-03-23', 'Maurice Christopher Jones-Drew is an American football running back for the Oakland Raiders of the National Football League. Jones-Drew played college football at UCLA and received consensus All-American recognition. Jones-Drew was selected by the Jacksonville Jaguars in the second round of the 2006 NFL Draft, 60th overall, and has been named to the Pro Bowl three times and led the NFL in rushing yards in 2011. He played his first eight seasons with the Jaguars, through 2013.', 'Oakland - California - USA', 1, '/8HO7jLNGXfxh3Oaiyl6PmzT3lZa.jpg'),
