        (1411665, 'Tom Bubrig', NULL, 'Tom Bubrig is an American film, television, and stage actor from Louisiana. Tom recently filmed a co-staring role on the new CW series, "Star-Crossed". Tom''s most recent movie role was in "When The Game Stands Tall" (now in post-production) performing with Michael Chiklis and Jim Caviezel. He also recently performed in the upcoming independent feature films "Chosen" (André Leblanc, Supporting) and "In The Hell of Dixie" (Sheriff Pete, Lead). In September 2012, Tom played the lead role of Willum Cubbert in Larry Shue''s hilarious play, "The Nerd".

Tom grew up in a rural and hurricane prone area of Louisiana. Weekends were filled with outdoor activities as there wasn''t much else to do. It was heaven. Tom''s family home was flooded up to the roof with Hurricane Betsy in 1965 and then they completely lost their next house in Hurricane Camille in 1969. The family cried "uncle" and moved to higher ground after Camille. Tom met his wife Celeste at Louisiana State University and had a long career in business and investing before embarking on an acting, writing, and producing career in 2011. Tom and Celeste have three children and one grandchild.

- IMDb Mini Biography', NULL, 1, '/3C6VopHD00eWyTm9ArhqoMlYSab.jpg'),
