        (1411679, 'Anthony Michael Frederick', '1973-03-25', 'Anthony is a native New Orleanian with Creole roots and a former high school All Metro two sport athlete in Football at wide receiver and Track &amp; Field holding the school record in Javelin since 1990. After graduating high school he started modeling then turned to acting landing the role of Jack in an Actors Equity production of The Tennessee Williams play The Rose Tattoo in 1995. Anthony also writes and performs Stand Up Comedy earning the title Gulf South''s Funniest Comedian in 2010.  - IMDb Mini Biography', 'Covington, Louisiana, USA', 1, '/21bOtLIVVbZAbP9slU14F3NEfs3.jpg'),
