        (1411745, 'Deric Augustine', NULL, 'Deric Augustine is two minutes older than his identical twin brother Deven, born to the parents of Donna and Deric Augustine in New Orleans, LA. The twins began their acting career in (1991) and also did print and catalog work under the guidance of their mother. When Donna Augustine suffered a hemorrhage stroke, while Deric was a freshman at Northwest High School in Opelousas, LA, he took a break from acting to focus on caring for his mother. With mounting family medical bills, Deric decided to focus on his academics and athletics in order to put himself through college. A star football player at the University of New Orleans, Deric excelled in a number of subjects including Theatre/Film and Marketing. After earning his Bachelor''s degree, Deric decided to pursue acting full time and was recently cast in the feature film When The Game Stands Tall due for release in 2014.  - IMDb Mini Biography', NULL, 1, '/sA33TLh6KHrTWzMZOL7dkgYUHWS.jpg'),
