        (1412661, 'Robert Morgan', '1964-01-01', 'Robert Craig-Morgan (born 1964 in Bromley, Kent) is an English actor who first appeared on television in the 1976 BBC production of I Claudius playing the Young Caligula, although he was best known for his character Justin Bennett in the children''s drama series Grange Hill which he played for five years from the beginning of the series.

