        (1412782, 'Mikal Vega', NULL, 'Mikal A. Vega is a veteran that served in the military for over 22 years conducting special operations. Returning to his pre-military roots, he has re-embraced his passion for acting. He uses his career successes to promote VitalWarrior.org, a 501c3 he founded that utilizes his proven system of stress mitigation that facilitates hormonal modulation through non-pharmaceutical methodologies helping veterans and their families recover from wartime trauma.  Mikal is a Screen Actors Guild (SAG/AFTRA) actor and philanthropist.

