        (1412928, 'James Jillings', '2012-01-01', 'James David Jillings was born in Cape Town, South Africa in December 2012. He shares the role of Gabriel with his identical twin brother Alexander Julian Jillings. He was 10 months old when he started on ''The Giver'' and 13 months old on his last day on set. The scenes that he features in were so diverse that many locations were used in Cape Town and the Northern Cape.  - IMDb Mini Biography By: Daniel David Jillings', 'Cape Town - South Africa', 1, NULL),
