        (1414736, 'Blake Mawson', '1984-04-24', 'Raised in British Columbia, Canada, Blake is an award-winning filmmaker who has been working in film & television for over 15 years. He began studying acting and film at the age of 16 and has appeared in film and television projects like Freddy VS Jason, X-Men 2, Blade: The Series, Poison Ivy, and The Strain. After living in Germany for 4 years and working within the music and art world, Blake returned to Canada and to once again work within the film industry, where he continues to write and develop a number of his own screenplays today. He was recently awarded the ''Best Emerging Canadian Artist Award'', at Toronto''s Inside Out LGBT Film Festival 2016 as well as ''Best Horror Short'' at Flickers'' Rhode Island Vortex for PYOTR495. The film was also nominated for the 2016 Iris Prize (the world''s largest short film prize), Sitges 2017''s Paul Naschy Award, and can be found on Pecadello Pictures'' 2017 Boys On Film: Possession compilation.', 'Vancouver, British Columbia, Canada', 1, '/15gI9YEfdlHoqJKiZvSwzNOh7UZ.jpg'),
