        (1415263, 'Mickey O''Keefe', NULL, 'Mickey O''Keefe is a retired police Sergeant from the City of Lowell, Massachusetts a struggling mill city. During his police career, he was also the mentor of "Irish" Mickey Ward of Lowell during his prolific boxing career and his eventual downfall. O''Keefe portrays himself in the 2010 film, "The Fighter" starring Mark Walhberg and Christian Bale.', NULL, 1, '/JV8c81AACrcjZDEv7PJPrEugxj.jpg'),
