        (1415410, 'Mark Gibson', NULL, 'Born and raised in Winnipeg, Manitoba, Mark Gibson is a Canadian actor living and working in Toronto. A graduate of the Acting Conservatory at York University in Toronto, Gibson began his career and is most recognized for his work in the indie film Exit Humanity (2011). Along with pursuing his passion for indie film, Gibson continues to work in both Canadian and American television.', NULL, 1, NULL),
        (1415412, 'Cory Gooding', NULL, '', NULL, 1, NULL),
        (1415413, 'Cazi Greene', NULL, 'Born in Salem, Massachusetts, Greene spent his childhood performing in anything from talent shows to tap dancing competitions while sports were well in the mix. It was from these experiences that Greene learned that any opportunity is a good one and should be taken. Through these trials he discovered his love for competition and achieving. This drive to achieve brought him to audition for a role in the independent film "Piper''s World" for the role of Tyler where he found his true passion acting. At the age of 12 Greene and his mother moved to Las Vegas, NV where he began playing athletics once his name began to spread he was recruited to join the track team where his gift was formally realized, he then went on to run cross country and track where he set multiple records, wins and championships for him and his team. He graduated from Foothill High School in 2011. Greene then moved to AZ where he became a men''s cross country National Champion. He was named All American and NV legend he also participated in Junior Olympics. People are also surprised by the fact that he is musically gifted. Greene sings and writes his own songs. He is also working on his first album, while pursuing his acting and singing dreams.  - IMDb Mini Biography', 'Salem - Massachusetts - USA', 1, '/jz7olKDnTdzPahtEKYPqY0S5Ah2.jpg'),
