        (1415423, 'Nick Killebrew', '1992-10-07', 'Nicholas Michael Killebrew was born on October 7, 1992, in Metairie, Louisiana. When he was only a year old, his family moved to the Northshore where he grew up, and later picked up his love for film and music. At 10 years old, Killebrew began writing and acting in his own short films, pursuing his passions and hoping to one day live his dream of being in the movies. He attended Ponchatoula High School in Ponchatoula, LA, where he took his first few theatre and drama classes. He then graduated from Ponchatoula High, and began his bachelor''s degree at Southeastern Louisiana University, studying Marketing. In 2012, Killebrew finally made his first professional, on-screen appearance as "Camera Man" in Ragin Cajun Redneck Gators (2013). He then went on to playing a "Demon Figure" in Demonic (2014), and as a "Glader" in The Maze Runner (2014).  - IMDb Mini Biography', 'Metairie - Louisiana - USA', 1, '/wfd6LvpfNkBKNQPrCZaHd3Ikse7.jpg'),
