        (1415757, 'Maddison Brown', NULL, 'One look at 17-year-old Maddison Brown and it’s clear why she’s already walked the runways for some of the hottest designers in the industry (e.g., Calvin Klein, Jason Wu, etc.). With cartoonishly full lips and no visible pores on her face, she’s beautiful to an almost avatar-like degree. So when Brown booked her latest campaign, this one for Miu Miu’s fall collection, lensed by Steven Miesel, it was her first fashion shoot with which she was there in an entirely different capacity: as an actress.

She’s starring in “Strangerland,” releasing in the U.S. today. In it, Brown plays Lily, one of Matthew Parker’s (Joseph Fiennes) and his wife Catherine’s (Nicole Kidman) two teenage kids who go missing.', NULL, 1, '/y5LQOqpoJuaQZRd63YXp9d1rlfv.jpg'),
