        (1421423, 'Griffin Freeman', NULL, 'Growing up in the suburbs of Atlanta, Griffin began performing in local theater at the age of seven, and by age 13 was working consistently in commercial projects. Throughout middle and high school, Griffin continued to perform on stage in musicals, dramas and improv, and developed a love for filmmaking, filming and editing music videos for local bands and rappers, and writing, directing, editing and starring in short films. His drama,Sitting on the Fence (2011), was an official selection at the Macon Film Festival in 2011, and in 2013, his short film, Self Portrait, was the first short film ever awarded "Superior" at the Georgia Thespian Conference and was invited to compete at the national level.', 'Atlanta, Georgia, USA', 1, '/20jqCZcqHYPnPCdo0tQJIDMnlEw.jpg'),
        (1421424, 'Meg Crosbie', '2003-07-11', 'Meg Crosbie was born on July 11, 2003 in Charlotte, NC. She recently landed the role of Ruthie in John Green''s Paper Towns starring Cara Delevigne and Nat Wolff set to come out June 2015. Meg also has a lead role in the upcoming animated feature film RoboDog (2015) featuring Ellen Page, Steve Zahn, Chris Colfer and Ron Perlman. Meg just wrapped up a film with Director Paul Weitz featuring Lily Tomlin and Julia Garner set to come out in 2015. Meg had her movie debut in Jackass Presents: Bad Grandpa (2013) where she played the role of a pageant contestant.', 'Charlotte, North Carolina, USA', 1, '/J8xxKXTJe6w8Xe9SmDKLGMbLGV.jpg'),
