        (1422460, 'Cheryl Stern', '1966-07-01', 'Cheryl Stern is an American Broadway actress. She starred opposite Cynthia Nixon in The Women and in the 2010 Tony Award winning revival of La Cage aux Folles. In 2009, she starred in the Transport Group''s "Being Audrey" More recently, she appeared as The Old Lady in Mary Zimmerman''s acclaimed production of Candide at the Huntington Theatre in Boston. She is a past winner of a Jonathan Larson Award. Stern previously worked as a backup performer for comedian Jackie Mason. Stern is a graduate of Northwestern University.', 'Buffalo - New York - USA', 1, NULL),
        (1422474, 'Carly Brooke', NULL, 'Carly Brooke grew up in Long Island, New York and began acting and singing as soon as she could walk. She received a BFA in Musical Theatre from the University of the Arts in Philadelphia where she was trained in the Meisner acting technique. Since graduating, she has worked on numerous films, TV shows, and commercials. She can also be seen singing at numerous New York City venues.  - IMDb Mini Biography By: Carly Pearlstein', NULL, 1, '/fnd76G5PKJGeru13TdPEJiHCEDr.jpg'),
