        (1422991, 'Vanessa Ross', NULL, 'Vanessa Ross is a seasoned and well-trained SAG and AFTRA actress, with  over ten years experience. She has captured the film and television  industry with leads and supporting roles. She has worked both dramatic  and comedic projects, in all mediums. Having worked with with Jeremy  Piven, Lindsay Lohan, Ving Rhames, Mindy Robinson, Isaac C. Singleton,  Patrick Durham, Derek Zemrak, Demetrius Navarro, Robert Miano, Romane  Simon, Steve Crest and many more. She trains at A.C.T. (Actors Certified  Training), Hollywood; advanced courses at Santa Monica College;  workshops at Network Studio; and private coaches in San Francisco, her  native area.

A second career is modeling, which did jump start  her acting career. At age five, she began modeling for major department  stores. This evolved to print, runway, video/film and promotional work.

What  other artistic skills does Vanessa maintain? A jazz dancer with a  ballet foundation since age eight, then picking up a little hip hop,  compliments her acting and modeling careers. Music training includes  voice, violin, guitar and piano. She draws, preferring illustrative  (pencil, chalk) and acrylics/oil projects. She has advanced art courses  from Diablo Valley College and Santa Monica College; even computer-art  courses.', NULL, 1, '/pfEABf4uwcd4gRIJz9b4aOaPEtl.jpg'),
