        (1423458, 'Ermes Blarasin', '1965-04-17', 'Ermes Blarasin was born on April 17 1965 in Toronto, Ontario, Canada. He is of an Italian background, his family moving from Fruili Venezia Giulia 8 years prior to him being born. He grew up in Toronto where filming movies had become popular and first got into the business as a stuntman in the movie Tommy Boy, doubling the hilarious Chris Farley. Since then, Ermes Blarasin has created a name for himself in the stunt business and has been complimented about his skill many times by directors. One of his most famous roles is the role of the "bloated Woman" zombie is the 2004 remake of Dawn of the Dead. He currently lives in a small town north of Toronto close by to his family and friends awaiting more roles.  - IMDb Mini Biography', 'Toronto - Ontario - Canada', 1, NULL),
        (1423459, 'Steve ''Shack'' Shackleton', NULL, '', NULL, 1, NULL),
        (1423460, 'Shamus Fynes', NULL, 'Shamus Fynes is an actor.', NULL, 1, '/4csc1l4VYczTCW7qaLth809tsJz.jpg'),
        (1423473, 'George Nickolas K.', NULL, 'George Nickolas K. began performing at the very young age of 5. Made his first TV appearance as a lead actor at the age of 9 and was the youngest ever actor, 11 years old, to be accepted into a local, highly respected professional theater company. Between 2003 and 2006, George was seen in many commercials, including McDonalds, Chevy, etc., various guest spots including "Made To Order" in the role of "Kevin", "Off The Record" and many other TV appearances. George has also acted in and starred in many films which were featured at the Milan Film Festival (2002),the Venice Film Festival (2007)and the Cannes Film Festival(2014) and the Toronto International Film Festival (2014). A dramatic and comedic actor, George is also a very skilled drummer and voice artist. Al Pacino, Tom Cruise, Jack Nicholson, Jim Carrey, Martin Short and the entire cast of "SCTV", are just a few of the actors with whom George credits as his biggest influences. Between 2009-2013, George was cast in many films, including: "Pay In Full", "BoonDock Saints II: All Saints Day" and a role in the David Cronenberg film "Maps to the Stars", filmed on location in Hollywood. George is a member of the Screen Actor''s Guild, (SAG/AFTRA) and a member of ACTRA.  - IMDb Mini Biography', NULL, 1, '/3aOl9rU1q9bfsU0XTRMhugd7hKK.jpg'),
