        (1423884, 'Ron Voz', '1940-03-18', 'After retiring from the NYPD, Howard pursued a second career in acting, using the screen name Ron Voz. He played the corpse in three different productions of "Lucky Stiff." He filmed with Richard Gere in "The Hoax," playing the role of Norman Mailer, and with Robin Williams and John Travolta in the film "Old Dogs." He played the role of the chauffeur in the Julia Roberts &amp; Clive Owens film, "Duplicity." Following a principle role in the Disney film "Enchanted," he joined the Screen Actors Guild. He recently filmed the Mighty Morphin Power Rangers teaser trailer, produced by his grandson Louis Maldarelli. He plays the butler in "Can a Song Save Your Life" (forthcoming, with Keira Knightley). He especially enjoyed volunteering in student-directed films at New York University, the School of Visual Arts, and the New York Film Academy.  - IMDb Mini Biography', 'Astoria - New York - USA', 1, NULL),
