        (1427843, 'Mark Coulier', NULL, 'Mark Coulier is a make-up artist and prosthetic makeup expert, who has worked in Harry Potter film series, X-Men and The Mummy Returns. He and J. Roy Helland won the Academy Award for Best Makeup and BAFTA Award for Best Makeup and Hair for The Iron Lady.', NULL, 1, '/hdH3eFYfY58CuaB0Yn7Rm6FHbrg.jpg'),
        (1427852, 'James Taylor', NULL, 'James K. Taylor is a film actor.', NULL, 1, NULL),
        (1427858, 'Chris Sanders', NULL, 'Sander''s career begins in the 1970s with main characters in series The Siege of Golden Hill (1975) and A Bunch of Fives (1977). During the first half of the 1980s, he only could work as a recurring character in another TV series, Angels (1982), and then work in a minor role in TV movie Monsignor Quixote, starring Alec Guinness. Sanders acted then in guest appearances for the rest of the 1980s, and in minor roles in movies like Dead Lucky and Bellman and True. Sanders worked on non-blockbuster movies, including TV Witchcraft, and making guest appearances in different TV series, of which is of notice Merry Christmas, Mr. Bean.  In 1999, Sanders voiced Neimoidian lieutenant Daultay Dofine for The Phantom Menace; however, Dofine''s character would be played by a different actor on-screen,Alan Ruscoe who also played Bib Fortuna and Plo Koon. On the same year, Sanders played another voice for Disney''s TV movie Tarzan (also featuring Brian Blessed). For Tarzan, Sanders voiced a baby baboon. Since then, Sanders seems to have returned to his usual guest appearances for TV, as he did in Two Thousand Acres of Sky.', NULL, 1, NULL),
        (1427863, 'Amanda Lucas', '1981-01-01', 'Amanda Lucas is the eldest adopted daughter of George Lucas. She has played a minor role in all three prequel films. In the animated television series Star Wars: The Clone Wars, the character Che Amanwe Papanoida is based on her.  She has since gone on to participate in mixed martial arts, debuting on 31 May 2008 in a fight against New Zealandkickboxing champion Nicole Kavanah. She is married to Jason Hallikainen who played an extra alongside her character during the opera house scene in Revenge of the Sith.', NULL, 1, '/orl2zrSpf4WQUd268DsP7EspUCo.jpg'),
