Worked as a Stunt Double on movies such as X-Men: Days of Future Past (2014) , X-Men: Apocalypse (2016) , Warcraft: The Beginning (2016) and Suicide Squad (2016).', NULL, 2, '/gfBCWnyntNxsW1IhGf5YtWRecXF.jpg'),
