        (1428070, 'Isabela Moner', '2001-07-10', 'Isabela Moner (born Isabela Yolanda Moner on July 10, 2001) is an American actress, voice actress, singer, songwriter, dancer and ukulele player. Moner was born in Cleveland, Ohio. She was born to Katherine Moner, of Peruvian descent, who was born in Lima, Peru and to Patrick Moner, of American descent, who was born in Louisiana. She is the middle child of her family and has two other brothers, Gyovanni, which is her younger brother and Jared, which is her older brother. She had her Broadway debut at the age of 10 in a production of Evita.', 'Cleveland, Ohio, USA', 8, '/cQlaWpBzyPx4p6PDz0cr1Y0DrWY.jpg'),
        (1428071, 'Seth Isaac Johnson', '2000-07-10', 'Seth Isaac Johnson is a Film, Television and Voice actor. He is best known for his dramatic series regular role as Denny Larsen in "The Killing" and most recently as possessed teen Shawn Raider in "Supernatural". He also demonstrates his penchant for great comedy as Danny in Nickelodeon''s "Splitting Adam - and Langley in Disney''s "Mech x-4". Seth is fluent in English and French, and is an avid sailor, swimmer and snowboarder.', 'Canada', 1, '/A2P2tqPzHJQMqLpd182s6xbE3bB.jpg'),
