        (1428998, 'Julia Hamer-Bevis', '1971-10-19', 'better known by her ring names Sweet Saraya and Saraya Knight, is an English professional wrestler and promoter. Hamer was born in Penzance, Cornwall. As a child, she was abused by her stepfather,and ran away from home at the age of 15. She lived on the streets and used public swimming pools to bathe herself. She was also raped and became a drug addict, later stating that she now has "no relationship" with her mother due to her mother''s refusal to help her during this time. At the age of 18, she overdosed on pills and had her stomach pumped, which prompted her to get clean  Hamer married professional wrestler Patrick Bevis, better known by his ring name Ricky Knight, in May 1990, adopting the hyphenated surname Hamer-Bevis as a result.Together they have two children, both of whom are professional wrestlers: Saraya-Jade, who performs in WWE under the ring name Paige, and Zak, who performs as Zak Zodiac. She is also the step-mother of Roy Bevis, who performs as Zebra Kid and Roy Knight. Hamer-Bevis once wrestled while she was unknowingly seven months pregnant with Saraya-Jade.For a time, WWE Hall of Famer Jake "The Snake" Roberts lived with the family.The family runs the World Association of Wrestling (WAW) promotion in Norwich. She owns and operates Bellatrix Female Warriors, a women''s wrestling promotion also based in Norwich.

In July 2012, Channel 4 produced a documentary about the Knights entitled The Wrestlers: Fighting with My Family. The documentary was turned into a 2019 feature film by Stephen Merchant with Dwayne Johnson producing, titled Fighting with My Family, where she was portrayed by Lena Headey', 'Penzance, Cornwall, UK', 1, '/5guXTYiw3HxqYdRPk4SKfs3mdaH.jpg'),
        (1428999, 'David Crowley', NULL, '', NULL, 1, '/kRAv5CFCWW4ek69SU98AtOMJG3b.jpg'),
        (1429000, 'Roy Bevis', NULL, 'Roy Bevis, better known by his ring name Zebra Kid, is an English professional wrestler. He is the son of well-known wrestler and promoter Ricky Knight, and often wrestled alongside his father in his promotions as Roy Knight. He has recently formed a tag team with younger brother, Zak Zodiac, as The UK Hooligans.', NULL, 1, NULL),
        (1429003, 'Zak Knight', NULL, '', NULL, 1, NULL),
        (1429010, 'Sarah Hay', '1987-01-01', 'Sarah Hay, born in 1987, was brought up in Princeton, New Jersey, with her older brother, who is an opera singer, and sister. Her grandmother was an art dealer in New York, and her grandfather is a member of the New York Philharmonic. Hay''s parents are both amateur dancers and psychologists. She began attending dancing classes at the age of three, and joined the School of American Ballet in New York City when she was eight, and later attended the Jacqueline Kennedy Onassis School of Ballet at the American Ballet Theatre. She later explained that while she was popular at normal school, at the ballet school she was considered to be a "loser" because she wasn''t from a wealthy background. She described herself a "troublemaker" during her childhood, and only decided to pursue ballet professionally when she was a teenager.', 'New York - USA', 1, '/xGpMGrfdQj9C8leNNPghuA3okTg.jpg'),
