        (1430952, 'Katie Purvis', '1967-01-01', 'Katie Purvis is an actress who played the "Maternal Ewok" in Star Wars: Episode VI Return of the Jedi. She is also the daughter of Star Wars actor Jack Purvis, and is good friends with Maureen Charlton.  Katie Purvis was born in England in 1967. Her father was Jack Purvis, born with a condition called Achondroplasia a form of dwarfism who never reached more than 4''1" of height. Katie shared this feature with her father, being only 3''1" as an adult.', NULL, 1, '/2xCF8e5v7RwDaBYCpDAKVTFWFuf.jpg'),
