        (1431019, 'Briana Roy', '2005-08-14', 'Briana Roy was born in Hollywood Florida on August 14, 2005.Besides English she also speaks French &amp; Creole . She started as a child model at the age of 5, while attending school as a gifted student. She appeared on many big companies such as Wal-Mart, Blue cross Blue Shield, FPL, Avis Budget, Children''s Place, Old Navy, Kenya &amp; Bonita Dolls, Walt Disney, P&amp;C Clothing Of Germany , Infiniti Automotive, KFC , Toys R Us , Miami Art Cultural , Etc .Briana Roy appeared on Rapper Jake Miller Music Video (Collide)..Briana Roy had her breakthrough in the 2014 Thriller Reclaim as the role of NINA where Rachelle Lefevre and Ryan Phillippe played her adopted parents Alongside Other Actors Such As: John Cusack, Luis Guzman, Jacki Weaver. For Hobbies she likes to Write Poems ,Take Pictures , Play the WII Game with her sisters ,and Design clothes where she finds inspiration to come out with her clothing line in a Later time that she will name the " JB Roy Collection " Briana Roy lives with her parents and two sisters .She is a loving and caring girl. She love God And her Family Deeply .She enjoys doing both modeling and acting . She is a 3rd grader and also is in the gifted program .Her goals are to become very successful in modeling and acting , and also to become an ambassador for kids internationally .  - IMDb Mini Biography', 'Hollywood - Florida - USA', 1, '/knUngIuD4Mcs9Xs0r2lFmvaNcJh.jpg'),
