        (1431038, 'Veronica Faye Foo', NULL, 'Veronica Foo, Singaporean-China based actress, is one of the most successful actresses who has an established presence in Singapore, China and South Korea. At the tender age of 18, she decided to take a bold move to China upon an invitation from Yan Hai (TV producer) to act in a Chinese drama series. She rose to fame after playing a role in "Jade Goddess of Mercy", and has since taken up various challenging roles notably antagonist "Zhaodi Cai" in China''s hit drama, Niang Xin. Fluent in English,Mandarin,Cantonese and Korean, she has acted in TV and movies from Singapore, China and South Korea.  - IMDb Mini Biography', NULL, 1, '/kiYDh64Iln6G584zaKcogCHXMW4.jpg'),
