        (1431110, 'Blas Diaz', NULL, 'Blas Diaz Figueroa, better known as Sien to the music industry, is a Puerto Rican singer and actor, born in San Juan, Puerto Rico on November 10, 1977. He currently resides between Puerto Rico and Miami. He began his artistic career participating with Fat Joe in Sangre Nueva Special Edition with the song "Vamos a Sacarla". He moved to Miami where it start to unfold, collaborate and share events with artists like Rick Ross , Fat Joe , Majic , Pitbull, Hector El Father , Yomo , Rakeen y Ken- Y, Alexis y Fido, Jock Young , DJ Khaled , Lil Wayne, Arcange , Jowell y Randy among others and proceeds to be part of "Terror Squad" (Fat Joe &amp; Big Pun Crew ).

In addition to music, he has been actively involved as an actor in films and television series.

