        (1431170, 'Femi Oguns', NULL, 'Olufemi Ogunsanwo MBE, known professionally as Femi Oguns, is a British playwright, theatre producer and founder of Identity Theatre School and Identity Drama School. As a playwright, his first play Torn has previewed at the Arcola Theatre in Dalston, London. A Romeo and Juliet-style story centred on the Nigerian and Jamaican communities in London, Torn received mixed reviews: The Stage described it as a "lively and relevant new play" but "clunky"; The Times as "street smart" but "a sprawling, chaotic piece of writing desperately in need of the attentions of a disciplined script editor". As an actor, Oguns has had roles in British TV shows Prime Suspect 6: The Last Witness, The Bill and EastEnders and at the Arcola theatre. He was appointed Member of the Order of the British Empire in the 2014 Birthday Honours for services to acting.', 'London - England - UK', 1, '/qcZpLOf35NrLwvC8T6XGqpRdY82.jpg'),
