        (1432732, 'Mitchell Kummen', '1999-07-18', 'Mitchell Kummen is a Canadian actor. Mitch nailed his first audition at eight years of age and has never looked back. A bit of a chameleon, Mitch has played younger versions of Daniel Radcliffe, Callum Keith Rennie, Luke Mitchell, Don Cherry and most recently Adam “Edge” Copeland and Mike “The Miz” Mizanin.

