        (1434094, 'Baktash Zaher', '1976-02-07', 'Baktash is a graduate of Embry-Riddle Aeronautical University, with a Bachelors of Science in Aerospace Studies. He was born in Kabul, Afghanistan, and grew up in New York City.

Baktash is the founder and CEO of Paramount Business Jets, an internationally-renowned leader in the luxury private aircraft industry, with the largest selection of jets in the world and raves from Clive Owen, Angelina Jolie, and Michael Imperioli.

Baktash starred in FireDancer, Afghanistan''s first entry in the Oscars for best foreign film, The Return, and Spike Lee''s Inside Man. He has traveled extensively, is fluent in five languages, and has been featured in most of the major media outlets, including ABC, NBC, CBS, BBC, the New York Times, Washington Post, Los Angeles Times, San Francisco Chronicle, and the Daily News.

- IMDb Mini Biography', 'Kabul, Afghanistan', 1, '/uIHJBdqPNAwjQ6jFCzNZjf1vHlq.jpg'),
        (1434096, 'Julian Niccolini', NULL, 'Julian Niccolini is an actor and a New York City restaurateur who co-owns The Four Seasons Restaurant. A Native of Italy''s Tuscany region, Niccolini has lived in New York since 1973 and became a US citizen in 2002. Described as the "madcap maitre d'' of America''s most powerful lunchroom" by GQ magazine, Niccolini is known for charming his patrons with a surprising mix of innate hospitality and irreverence for the captains of industry who patronize The Four Seasons daily. A media darling who is often quoted on the New York Post''s Page Six column and who appeared in the Spike Lee film Inside Man, and with Richard Gere in Arbitrage, Niccolini is recognized for his discerning wine palate. His wine list features some of the rarest and most sought after bottles in the world.', 'Tuscany - Italy', 1, '/FCMQZytjCwtOjDQTg3FJ7Pkz58.jpg'),
