        (1435854, 'Chris Patrick-Simpson', '1979-01-18', 'Chris was born in Canada but grew up Belfast. He began acting under the guidance of an inspirational drama teacher at secondary school who put him on the path to becoming a professional actor.  On leaving school he successfully auditioned for the Gaiety School of Acting in Dublin, graduating in 2000. Since then he has continued to fulfill his ambition of collaborating with the best directors in film, television and theatre in projects such as the award-winning The Magdalene Sisters, (Momentum) The Boxer, (Universal) Fifty Dead Men Walking, (Brightlight Pictures) Good Vibrations, (Revolver Films) 71 (Warp Films), Shooting for Socrates (New Black Films), Mrs Brown''s Boys D''Movie (Universal Pictures) and most recently High Rise Directed by Ben Wheatley', 'Edmonton - Alberta - Canada', 1, '/ij8Tdv2Js2gSy9VwosyFKD6X84i.jpg'),
