        (1438812, 'Zaydah-lee', NULL, 'Zaydah-lee was born in Port Hedland and has the true ''Sandgroper'' fighter spirit. From a child she was one who loved animals and performing. These loves have proving steadfast as she progressed through out her childhood and into adult life. It was evident a music appreciation was there from the start when she took up Clarinet in a senior concert band Winchelsea/Vic.

Continuing into her teenage years many awards were won for Theatre &amp; Dance. Locally making a name as an upcoming entertainer.

Her family then moved from the Eastern States to Perth Western Australia where a step to make a professional start in the Modelling and Film Industry began. Signing with Spiers and Gemma International. Completing a calendar and winning photography competitions she realized her direction was steering more into the art of Filmmaking and the expression into Acting became too Strong a medium for her to refuse. It was not long before a college Diploma was awarded for Screenplaywriting

After successfully completing short and feature film productions local and Interstate a goal of gaining knowledge and skill to becoming a known Film Director is now in the immediate future.

Thank-you for taking the time to view this Profile

Should you have a production you feel Zaydah-lee can be cast for, please contact her agent.

- IMDb Mini Biography', 'Port Hedland - Australia', 1, '/7gybY250MQzBmNSq5waxFXe8U4R.jpg'),
        (1438815, 'Nelson Aspen', '1963-07-01', 'Nelson Aspen is an author and actor.', 'West Chester - Pennsylvania - USA', 1, '/onId82cTjQkYxOO5CTbXsOZF6d2.jpg'),
        (1438816, 'Brodie Masini', NULL, 'Brodie Masini is an Actor and Musician based in Western Australia, Australia.

Making his start in the Perth acting community in 2012 after deciding to postpone his studies in Engineering, Brodie has hit the ground running and already built up quite an impressive resume. He has appeared in several film projects including “The Silent City”, “The War That Changed Us” and “Revive”, which received the People’s Choice Award at the 22nd Tropfest Australia short film festival in 2013 and was seen by thousands of viewers worldwide. He has also starred in local theatre productions to the likes of “Closer” as Dan, “The Wizard of Oz” as Tin Man, “Little Shop of Horrors” as Orin Scrivello D.D.S, and David Williamson’s “A Conversation” as Mick Williams, for which he received a nomination for ‘Best Other Than Lead Male in a Play’ at the 2013 Independent Theatre Association Robert Finley Awards.', NULL, 1, '/i2H9lNBdStaYUccyuY0ws22B51o.jpg'),
        (1438817, 'Korum Ellis', NULL, 'Korum Ellis - Actor, Model, Mars One Candidate and Entrepreneur - works in the Australian film and television industry having recently begun a serious transition from modeling to professional acting. Korum is quickly on the rise and establishing himself as a star performer with a very strong screen presence, a vivid and capturing image and an adaptable wide range of character versatility. Born in Shepparton, Victoria in Australia in 1983 Korum later moved to the Mid North Coast of NSW with his parents for the bulk of his childhood. After a few years of professional pursuits in business Korum took a focus to advertising modeling and brand representation. Later when the opportunities arose, he took the leap into film with his first role as a clean cut assassin in the film Deadtime: The Truth (2013) by Director Rody Claude Many short films and music videos followed, and as his on screen techniques took shape he moved into bigger productions such as These Final Hours (2013) by Director Zak Hilditch and Fallout: Lanius (2013) by Director Wade K. Savage and Zombie Ninjas vs Black Opssecuring stronger roles and more pivotal lead character roles.  - IMDb Mini Biography By: Korum Ellis', NULL, 1, '/ootaI2lytpc5ZE7wtp97WYo8Kgz.jpg'),
        (1438833, 'Lara Bezuidenhout', NULL, 'Lara Bezuidenhout is an actress.', NULL, 1, '/iAa6sW1XBOnlpo2tcKP4AlpXSfe.jpg'),
        (1438834, 'Justin Burford', NULL, 'Justin has had an impressive career in the music industry including two ARIA Awards, APRA Song of the Year nominations, and the lead role in the Australian production of Rock of Ages; the latter earning him high praise, five-star reviews, a Broadway Australia Award and a Helpmann Award nomination.  Justin wrote and starred in KURT - a live stage show that celebrated the life and music of Kurt Cobain. It debuted at the 2012 Adelaide Cabaret Festival to sell out crowds and glowing reviews. A lifelong fan and student of cinema, Justin has also written and starred in a number of short films.  ''Foreshadow'' is Justin''s first feature film leading role playing the playboy, Jesse Milton

- IMDb Mini Biography By: Justin Burford', NULL, 1, '/8cBcKcCJnRhAC75TxpV5Wts7Xnh.jpg'),
