        (1438837, 'David Partridge', NULL, 'David Partridge is an Australian film and stage actor. Born in country New South Wales, as a young child his family moved to Newcastle, New South Wales, where he spent his youth growing up in coastal suburbia.

After studying with the Film and Television Institute (Fremantle) he has acted in many short and feature films. His debut feature film was The Great Mint Swindle

 (2012), but his scenes were cut for time.

He is known for his work on These Final Hours

 (2013), Son of a Gun (2014), Kill Me Three Times (2014), and for his role as Detective Martin Cole in The Silent City (2015).  - IMDb Mini Biography', 'New South Wales, Australia', 1, '/llqny7U4G2WQ2Nx6oFceEBoB0Zd.jpg'),
