        (1438862, 'Brendan Johansen', NULL, 'Brendan was born in Pinjarra in September 1992. Brendan has lived in Mandurah all his life, due to his large family he is a very charismatic person and can adapt into all social aspects. Brendan has always been interested in acting throughout his school years participating in drama classes at school and eventually outside of school. Brendan is employed in the steel fabrication industry however still takes time to go to auditions, write scripts and when not in front of the camera or writing scripts Brendan helps out with the crew work.  - IMDb Mini Biography By: Brendan Johansen', 'Pinjarra - Western Australia - Australia', 1, '/cOiQOA8qZW9Ewn0k1OBkK23ZZxz.jpg'),
