        (1438872, 'Troy Coward', '1981-01-01', 'Troy Coward was born in Sydney, New South Wales in May 1981.  At age 8, Troy began training as a boxer and his fighting skills would eventuate into him fighting alongside the likes of Danny Green at The Australian Titles, being ranked 1st for his weight from Western Australia and 2nd in Australia.  However acting has also been a huge passion of Troy’s and it’s his raw natural talent for performing that has seen him take on various roles in film and television, all of them memorable.', 'Sydney - Australia', 1, '/1hldoiJQzTu46setvx6a28zikXp.jpg'),
