        (1438877, 'Kingsley Judd', NULL, 'Twice Nominated for Best leading actor at the PTT Equity Guild Awards and once nominated for Best supporting actor at the PTT Equity Guild Awards, Kingsley is an experienced actor. He trained at Curtin University and graduated with a Bachelor of Arts in English majoring in Theatre Arts. He has performed with various Theatre companies in Perth, WA and also with companies in Malaysia and Singapore. His feature film work includes: THESE FINAL HOURS, SON OF A GUN and THUNDERSTRUCK. His television appearances include; CLOUDSTREET, STORMWORLD, THE GREAT MINT SWINDLE and DESERT RATS. He also works as a Clown Doctor at Princess Margaret Children’s Hospital. He has been a member of Equity since 2005.', NULL, 1, '/cPj8cvNP4FN0XV23BVl8ACysVYT.jpg'),
