        (1439089, 'Kate Campbell', NULL, 'Kate Campbell''s immense love for storytelling, music, and art began, at early age growing up in Northern Ontario, Canada. This love and fascination kept her busy singing in choirs, performing in plays and studying voice. She also had a great love for athletics and excelled at a National level in hurdles and was a gold medal Provincial champion in Track &amp; Field while attending High School. She turned down several athletic scholarships to study Musical Theatre Performance at Sheridan College. While in Toronto she shot several TV and film projects, co-hosted the Latin American Awards at Roy Thompson Hall, co-produced and starred in a hit production of Neil LaBute''s The Shape of Things, and co-directed a benefit concert for St. Michael''s Boy''s Choir ''A Gift of Music'' at Roy Thompson Hall featuring The Barenaked Ladies, John McDermott, and Michael Burgess.

Kate then ventured to Los Angeles where she has enjoyed singing with some of the industry''s most incredible talents throughout LA and up and down the California Coast, Palm Springs, Las Vegas, and also the Sundance Film Festival. She is the female vocalist for the LA based band the Martini Kings. She also collaborates in performance and as a lyricist with NY/LA based jazz musician Nick Mancini. She has performed with Robbie Krieger of The Doors and with actor/musician Jeff Goldblum &amp; his Mildred Snitzer Orchestra.

- IMDb Mini Biography', NULL, 1, '/pDQwNRcXhquim1MmPf9INU3zjqR.jpg'),
        (1439098, 'Brett Leigh', '1980-01-01', 'Brett Leigh is an American born actor and film producer. Leigh is best known for his role in the Academy Award winning film The Social Network. Additionally, he has appeared on stage in the critically acclaimed Broadwaymusical West Side Story. Leigh has played both lead and supporting roles in numerous independent films that have enjoyed wide range festival participation.', 'Bethany - Oklahoma - USA', 1, '/nl4eus0kRy4L1i6uma88zDpS9uZ.jpg'),
        (1439105, 'Antonio St. James', NULL, 'Antonio St. James caught the acting bug early on in life, with his first role in the high school production, "Othello". Over the past decade, he has starred in a number of stage plays, commercials, television dramas and short films. His 2010 short film, "OSI", caught the attention of St. Louis'' very own News Channel: CBS 4, for their "Stop the Violence" segment and has also won several accolades. To add to the credits of his other films, he has also starred in "The Makings of You", with legendary screen actress, Sheryl Lee and Jay R. Ferguson, of "Mad Men" fame, along with a small role in David Fincher''s suspenseful-drama, "Gone Girl", and recently on NBC''s "Chicago PD".

Mr. St. James can also add singer to his repertoire; formally being a member of the Gospel group, Psalms 100.  - IMDb Mini Biography', NULL, 1, '/nzzozryKaKgEe2FYm3iFOUJr5nF.jpg'),
        (1439112, 'Julia Prud''homme', NULL, 'Julia Prud''homme is an actress.', NULL, 1, '/4t39UeNsXOVq5hlcuYAFXin9eCX.jpg'),
        (1439125, 'Casey Ruggieri', NULL, 'Casey Ruggieri is an actress.', NULL, 1, '/cbiC792SXkzeW6fWt4j0FCdUY7h.jpg'),
        (1439141, 'Ashley Didion', NULL, 'Ashley Rae Didion was raised Ashley Rae Cope in the small town of Crane in Southwest Missouri. She is the daughter of George Cope, a former construction business owner; and Sandy Cope, a former country music singer. She has two younger sisters, Morgan and Cory Cope. Ashley grew up on a large farm near Branson, Missouri; a city where she performed on stage alongside her family for most of her childhood while also acting in several local commercials. During her time in high school, she participated in Crane High''s drama program and during the summer before her senior year, took part in a summer drama course at the University of Southern California.

After graduating high school, Ashley went on to attend Missouri State University to receive her degree in Business Entrepreneurship with an emphasis in the Spanish language. After one semester she left Missouri for Los Angeles where she lived and worked for six months before moving back to Missouri to complete her college education. While attending Missouri State she signed with an agency in Kansas City and continued to act and model in various commercials, short films, and print shoots.

In Ashley''s junior year of college she studied abroad in London for a semester which began her life-long passion for travel. Once graduating from college, she moved to New Zealand where she resided for six months. While living in New Zealand, Ashley partook in many outdoor adventures. To fund herself she worked in a local surf shop and signed with an agency which allowed her to model in several print ads as well as perform as an industrial spokesperson for various New Zealand businesses.

Once back in the United States, Ashley moved to St. Louis, Missouri where she married her husband, Matthew Didion; a business manager for the growing enterprise of Karen Didion Originals. Ashley is now signed with Now Talent Management and continues to act and model in many local and semi national commercials as well as short films. In 2013, Ashley earned a speaking role in David Fincher''s film "Gone Girl," due to release in 2014.

- IMDb Mini Biography By: AD', 'Crane - Southwest Missouri - USA', 1, '/uklcsbamATGDeRInYmmun7Zcuuq.jpg'),
        (1439150, 'Lexis Nutt', NULL, 'Lexis Nutt is an actress.', NULL, 1, '/wcY6qyOzHyHWNOtR7dQFvdHcrbZ.jpg'),
        (1439155, 'L.A. Williams', NULL, 'L.A. Williams is an actor.', NULL, 1, '/3GfO8WCTcKtczysg4w1N3tPAjRL.jpg'),
        (1439167, 'Blake Sheldon', NULL, 'Blake was born and raised in Columbus, Ohio and lived there until he graduated from High School. He was voted Homecoming King and Most Likely to become a star by his classmates. Blake''s love of acting began when he was age 15. He credits his drama teacher for helping him embrace his love of theater and acting. Blake''s work ethic and dedication to each role he encompasses makes him wise beyond his years. Blake has an older sister named Brittany. He resides in Los Angeles.  - IMDb Mini Biography', NULL, 1, '/vsO5FeqEilC9AgNwIOkpgOd4XEd.jpg'),
        (1439180, 'Sean Guse', NULL, 'Sean Guse is an actor and producer.', NULL, 1, '/qAnjjbWMexiRUsQFFGF9I5spAU0.jpg'),
        (1439192, 'Ricky Wood', NULL, 'Ricky Wood is an actor.', NULL, 1, '/xNo1lBz1tguwv9NV451MGf1UWb3.jpg'),
        (1439204, 'Scott Takeda', '1967-03-21', 'Born in Colorado, Scott Takeda got his start in television in 1990 as a TV news reporter in Pocatello, Idaho (KIDK). As his career grew, he then moved on to newsrooms in Ohio (WTOL), Denver (KCNC), and finally Philadelphia (WPHL) where he worked behind the camera as a producer-photojournalist. During his time as a TV journalist, he won regional Emmy awards and two "Photographer of the Year" titles.

In 1995, he joined the staff of "News-for-Kids" and spent three seasons producing segments for the Emmy-award winning syndicated children''s show. During that time, he also formed his own production company, producing the documentary film "The Holocaust: Colorado Remembers." With his company, Scott has also won more than thirty national Telly Awards as well as the international Gold WorldMedal from the New York Festivals.

In 2001, he made his national acting debut as Sgt. Tai Lee in the Animal Planet series "Busted."

He now enjoys living multiple creative roles (as an actor in front of the camera and a producer-writer behind the camera) while living in Colorado.

- IMDb Mini Biography', 'Colorado - USA', 1, '/boNzT15JQ92aKHkHJkLc4Cwx5p0.jpg'),
        (1439207, 'Donna Rusch', NULL, 'Donna Rusch was born and raised in Houston, Texas. Her first memory of wanting to be an actress was watching Mary Ann after school in reruns of L''île aux naufragés (1964). She took her first acting class in middle school and while attending South Houston High School, split her time between cheerleading and starring in plays such as "Wait Until Dark", "A Company of Wayward Saints", "MacBeth and "Little Women". Donna graduated from the University of Houston with her Bachelor of Arts degree in Radio/TV/Film. She landed a job as a part-time Desk Assistant at the country''s #1 All-News Radio Station, KTRH-740 AM, Houston. She quickly rose to become a Reporter, earning numerous local and statewide awards including "Best News Series in Texas" from UPI. After 3 years, Donna went to the smaller city of Beaumont, Texas to prime her television reporting skills. Soon she became the city''s first female solo 10''clock weeknight News Anchor. But after nearly 4 years, her love of acting won out. Donna moved back to Houston and signed with top Texas Talent Agent, Jenny Bosby of the Pastorini-Bosby Talent Agency. On her first national commercial audition, Donna booked the job for Texaco Express Lube. For 17 years she worked without stopping, primarily in commercials, voiceover and as a spokeswoman for Industrial Films and Web Content for clients such as ExxonMobil, Shell, Compaq Computers, Continental Airlines and Chevron. A fun fact, before he became a star, Donna starred with Matthew McConaughey in a training film for Exxon Aviation. In 1995,Donna became Host of "Texas Today", a live daily morning show featuring Hollywood stars visiting the city,top chefs, book authors and a live band. In 2000, her first TV movie role was as a Reporter in Mortelle invasion (2000), directed by Tim Matheson, made famous by his Otter role in American College (1978). Donna also became known as "Renee Rusch", a traffic reporter on several radio stations and served time as a TV Traffic Anchor on both the NBC and CBS television affiliates. In 2011, Donna made the move to Los Angeles with her husband Craig Beisel and their two daughters. She quickly hooked into the Independent Film world with a lead role in the award-winning film Home from War(2012), accepted to Cannes 2013. She can be seen in co-star roles in TV episodes of Criminal Minds(2013) and Revenge(2013). She stars in the thriller The Channel (2015), set to be released in 2013. She has also booked National and Regional commercials for Curves, Sara Lee and Reliant Energy. Donna enjoys volunteering as an acting coach for stage productions by the "Spotlight Academy for Students", a ministry of Calvary Community Church in Westlake, California.  - IMDb Mini Biography', 'Houston - Texas - USA', 1, '/wpr3PoPDPuiTfFktzK42lOKJByZ.jpg'),
