        (1440574, 'Charlie Plummer', '1999-05-24', 'Charlie Faulkner Plummer (born May 24, 1999) is an American actor. Plummer began his career as a child actor in short films before appearing on the television dramas Boardwalk Empire and Granite Flats. He made his feature film debut in David Chase''s drama Not Fade Away (2012) before landing the lead role in Felix Thompson''s directorial debut King Jack (2015).

