        (1447271, 'Erin Lee Carr', NULL, 'Erin Lee Carr (born April 15, 1988) is an American documentary film director, writer, and producer best known for her HBO documentaries At the Heart of Gold: Inside the USA Gymnastics Scandal, I Love You, Now Die: The Commonwealth vs. Michelle Carter, Thought Crimes: The Case of the Cannibal Cop and Mommy Dead and Dearest. Carr was listed in Variety''s Documakers To Watch in 2015 and was recently named in Forbes 30 under 30 list of most influential people in media. She is the daughter of the late New York Times media columnist David Michael Carr and currently lives in New York City.

Carr likes to find stories that pertain to the internet and the people that use it. She finds issues and subjects that illuminate a larger issue.[6] Her style is to show connections to a larger issue without having to encompass every part of the story into a short video or documentary. "''That''s what being a journalist is – it''s going out into the world and finding people and things that are more interesting than you are and telling that story," Carr said in 2013. "It''s not a story until you have somebody to tell that story."', NULL, 1, '/ofY1ctK5ny681D43hjIEKBWCJtU.jpg'),
