        (1452956, 'Thom Williams', '1973-11-16', 'Thom Williams was born on November 16th 1973 and grew up as a single child in the Midwestern town of Denton Texas. He played football for most of his young life until suffering a knee injury his senior year of high school, thus ending his time in the game he loved. He used his natural athletic ability to transition into NCAA collegiate cheerleading and gymnastics, where he won a national championship while going to the University of North Texas from 1992 to 1996. That in turn led him to a summer job in entertainment as a bad guy in the "Batman Stunt Show" at 6 Flags Over Texas in the summer of 1996. He knew then that he had found his calling, and the following summer moved to Hollywood where he began his career as a stuntman for film and TV after getting his SAG card as a guest star on the TV show "The Journeys of Allen Strange."', 'Denton, Texas, USA', 1, '/dC2iRexXmLIZnFnz3rsq3UdTP3A.jpg'),
