        (1454165, 'Chelsea Islan', '1995-06-02', 'Chelsea Elizabeth Islan is an Indonesian actress. She made her film debut in the 2013 Indonesian drama film Refrain, she later continued her acting career in several films such as Street Society (2014), Merry Riana: Mimpi Sejuta Dolar (2014), Dibalik 98 (2015), and Guru Bangsa: Tjokroaminoto (2015). She also appears in the popular NET TV sitcom Tetangga Masa Gitu. She is fluent in Indonesian and English.

Early life

Born in Washington DC to an Indonesian father and an American mother, Chelsea moved to Jakarta to start elementary school and stayed until she finished high school', 'Washington, DC', 1, '/hJHAGMO4v4dF28gJScbUCHmHLuh.jpg'),
        (1454188, 'Matheus Ueta', NULL, '', NULL, 1, NULL),
        (1454189, 'Nicholas Torres', NULL, '', NULL, 1, NULL),
        (1454204, 'Elisabeth Ness', NULL, 'Elisabeth Ness is an award-winning actor, writer, producer, editor, and creative entrepreneur. Striving to make a positive impact on the world through entertainment onstage, onscreen, and in voice-over, the Yale alumna created the hit comedy series Redheads Anonymous -- www.redheadsanonymous.com -- and co-founded Good Porpoise Productions, LLC, which specializes in making socially-conscious fictional narratives, and mini-documentaries for non-profits.

Her work has been called "especially funny" (NY Times), "razor-sharp" (Washington Post), and "hilarious" (Times Herald-Record and the Catskill Chronicle); awards include ''Best Actress in a Sitcom'' and ''Best Sitcom Screenplay'' (Rome Web Awards), and nominations for the ''Raindance Discovery Award'' (London), ''Best Lead Actor (Female) Award (Blackbird Film Fest), and ''Best Actress Award'' (Miami Web Fest).

Elisabeth has been seen as Sara on CBS''s show Bull; onscreen at Tribeca, Cannes Select, SoHo International Film Festival, and in national commercials; and been heard as a voice for Rockstar Games, the YMCA, and Bud Light, among others. She has appeared onstage at venues such as Williamstown Theatre Festival, Lincoln Center, Ars Nova, Atlantic Theater, Inwood Shakespeare, and Signature Theatre. Her singing can be found on numerous albums, including the award-nominated Broadway Records Original Studio Cast Album of the musical Like You Like It. She will be featured in two upcoming Netflix projects, as well as the film June starring Aaron Kwok.

Behind the scenes, Elisabeth produced the award-nominated short En Route; associate-produced NYCIFF ''Best TV Pilot'' Award-winner The Grid; co-wrote and produced the short films Julie & Riley and Best Friends Forever; and produced, directed, and wrote song parodies for a cabaret at the Williamstown Theatre Festival, among other projects.

When not performing, producing, or causing redheaded mischief, Elisabeth runs a monthly ''salon'' for women entrepreneurs in the entertainment industry, edits sizzle reels and films, plays piano, and conducts a ninety-person choir.

- IMDb Mini Biography By: Anonymous', NULL, 1, '/uabyfonsNMBz94LJX9NyBVi5wBW.jpg'),
