        (1465528, 'Angela White', NULL, 'Angela T. White hails from Calgary, Alberta. She studied in France for 3 years (literature, translation and classical theatre (Molière), and acquired a BA and a B.Ed. at the University of Calgary. She is a high school Teacher of languages/music/drama,  putting her heart into inspiring the youth of Alberta.  Angela has directed & adapted many stage plays at schools, some of which are: “Romeo & Juliette”, “The Hunchback of Notredame”,  “Le Roi Lion” (Lion King), “Cendrillon” (Cinderella), “La Belle et La Bête” (Beauty & The Beast) and many others.  She studied music at the Mount Royal Conservatory, played and toured in Australia, England (Royal Albert’s Hall), and Scotland with the Calgary Youth Orchestra. Angela has been a professional singer, and a Film/Television Actress for many years.  Since 1998 she has worked on 100+ ﬁlm sets, with Principal Roles, one of which was Bernadette the Waitress in the feature film, “Knockaround Guys” next to Vin Diesel, Seth Green, Barry Pepper, Dennis Hopper and John Malkovich. Some of her other TV/Film credits include featured roles in “Shanghai Noon” (Jackie Chan), “The Other Woman” (Jason Priestly); “The Heidi Fleiss Story” and “The Sheldon Kennedy Story” (Jonathan Scarfe). Angela’s theatre experience spans over a decade, with lead roles in Musical Theatre Productions including “Celeste Romano” – the Vegas Wedding Singer in the off Broadway hit “Tony & Tina’s Wedding”. Other theatre credits include the lead of Katherine in “Untamed”  – a short of “Taming of The Shrew” for the Shakespeare Company. She has “died” and “killed” in countless Terry Shane Murder Mysteries.  Since 2005, Angela has been wowing audiences with her quick wit, dazzling charm and soft sultry voice as a Marilyn Monroe Impersonator. She has loved every minute of it and so have the audiences ! She has performed at Hundreds of shows for luminaries including the President of the Hockey Hall of Fame; Radio Host Gerry Forbes, Corporate parties at The Banff Springs Hotel, and many more.  Over the last 2 years, she is the Production Manager on the riveting TV Series “Bluff”. This series has been Nominated at The Banff Film Festival and gone on to receive a Nomination for an AMPIA award (Alberta Motion Picture Award) for Best Drama Series. She is also a Producer on the TV Series Project “Offscreen” and plays a co-starring role of  “ Coco-Chanel Monroe. ”  Angela was the Production Coordinator for 350 Days – A Wrestling Documentary featuring  Brett Hart and many other renowned wrestlers.  (2014/2015)  She has also served as the Producer & Production Manager/Coordinator of Music Videos, most recently Royalty Records – Jason Greeley Video “ Wasn’t That A Party” which got over 30, 000 hits on YouTube, and CMT’s “Come Hell or High Water” written by Sean Hogan, featuring Amber Marshall from the CBC TV Series “Heartland”. This Video has aired on Country Music Television (CMT) since September 9th 2013.', NULL, 1, '/sWI6etyiCVOToC3WLG5XELmeLvM.jpg'),
