        (1466075, 'Alex Kalymnios', NULL, 'Alex Kalymnios is an English director, producer and screenwriter.

Kalymnios was employed as a runner at Children''s BBC. During her four years at Children''s BBC she worked up to an Assistant Producer. While she was working there she also directed, produced and wrote the short film More Than a Job''s Worth.

In 2007 Kalymnios started to direct episodes of the TV series Hollyoaks. Until 2009 she directed 13 episodes. From 2008–2012 Kalymnios directed 7 episodes of the Hollyoaks spin off Hollyoaks Later. In 2011 Kalyminos directed the Being Human Spin Off Becoming Human. This series brought her a BAFTA Cymru nomination for Digital Creativity an Games and a Banff Rockie Award nomination for Best Webseries – Fiction.

Other series that Kalymnios directed were: Seacht, The Cut, EastEnders and Waterloo Road. In 2015 she directed the movie Cleveland Abduction.', 'England - UK', 1, '/bozXL8PeOAfRcGVej75wotd05XQ.jpg'),
