        (1467388, 'Candice Michele Barley', NULL, 'Candice Michele Barley was born in Columbia, South Carolina. She traveled the country with her photographer parents, appearing in commercials and ads from the time she was an infant. Her love for movie making was kindled when a family friend, James Garner, brought her onto the set of a remake of the Maverick TV series at the age of four. Candice''s acting career is focused on portraying strong and powerful female roles that are relevant throughout time. She''s producing an historical movie based on actual events that took place in 1858. A story in which the women-both black and white- demonstrated extraordinary acts of courage despite their circumstances.  - IMDb Mini Biography By: Candice Barley', 'Columbia - Missouri - USA', 1, '/hvNclozdc3I0ZspUzw0Tqdopzgn.jpg'),
