        (1467542, 'Mark Finn', NULL, 'Mark Finn is an actor, an author, a pop culture critic, and a playwright. His biography, Blood and Thunder: The Life and Art of Robert E. Howard, was nominated for a World Fantasy award in 2007 and he is a nationally recognized authority on the Texas author. His articles, essays, and introductions about Robert E. Howard and his works have appeared in publications for the Robert E. Howard Foundation, Dark Horse Comics, Boom! Comics, The Cimmerian, REH: Two-Gun Raconteur, The Howard Review, Wildside Press, and he has presented papers about Robert E. Howard to the PCA/ACA National conference, the AWC, and lectures and performs readings regularly.

As the creative director of the old time radio troupe, The Violet Crown Radio Players (2002-2007), Finn wrote, produced, directed and starred in a number of old time radio plays, including a one hour adaptation of "King Kong," which was nominated for a B.Iden Payne award in 2005. He lives in North Texas.

- IMDb Mini Biography By: Mark Finn', NULL, 1, NULL),
        (1467543, 'Charlie Sexton', '1968-08-11', 'Charlie Wayne Sexton was born 11 August 1968, in San Antonio, Texas, to Kay and Mike Sexton. He was what many considered a musically gifted child. He signed his first record deal at MCA Records at the age of 16 and recorded his first album, "Pictures For Pleasures", when he met Bob Dylan. "Pictures For Pleasures" was released in 1985, along with a music video, "Hold Me", which aired on MTV in 1985. This was the first time the world outside of Austin was introduced to a man named Charlie Sexton.

In 1987 Charlie toured with David Bowie

 on the Glass Spider Tour and the following year played backup on his brother Will''s debut album, "Will & The Kill". In 1989 Charlie made his second album titled "Charlie Sexton". Charlie has appeared on soundtracks for such movies as Le flic de Beverly Hills 2 (1987), Air America (1990) and Thelma & Louise (1991). He toured with Dylan for two years as his guitarist. He joined the band Arc Angels in the early 1990s, and while with them released an album entitled "Arc Angels" in 1992. In 1994 he went on to have small role in the movie F.T.W. (1994), playing a cowboy named Slim. After the breakup of Arc Angels he formed Charlie Sexton & Sextet in 1995 and the group released the album "Under the Wishing Tree". When Charlie left the band in 2002 he went on to produce other artists'' albums. In 2003 he joined Dylan once again, this time for a movie project, Masked and Anonymous(2003).

Charlie produced and also played guitar and other instruments on ''Edie Brickell"s "Volcano" album (2003). He has stayed in the music business since he first started, with all the ups and downs that come with a music career, and has never given up on what he loves - the music. Both Charlie & Will Sexton still have as many fans all over the world as they did the day they started.', 'San Antonio, Texas, USA', 1, '/lvLDURaLppIO7RtbZlkWEBGyQH1.jpg'),
