        (1467928, 'Megan Devine', '1994-06-09', 'Megan Devine has always had a free spirit to be herself and a witty personality that hides nothing. Megan Sean-Nicole Devine was born June 9, 1994 in Austin, Texas and was home schooled since first grade with her siblings. Megan began her love for performing when she started competitive figure skating at the young age of 7. Knowing she had a passion for the spotlight she wanted to try something new.

In the summer of 2004 Megan asked her mother if she could start acting and modeling. With her younger sister by two and a half years, Kristen Noelle Devine

, they began taking workshops and training with local coaches. Megan''s first role was playing the role of the "popular girl" in First Kiss (2005), which has two million YouTube views. Megan has steadily built her resume with film, commercial, theater, industrial and print credits. Her modeling credits include Texas Department of Agriculture, Neiman Marcus, Lake Austin Spa Resort and full window displays for C. Jane Boutique in Austin, TX. Megan''s commercial credits include Wal-Mart, Verizon and Poptent.

In 2011 Megan filmed three feature films. Two supporting roles in Richard Linklater

filmed Boyhood and in the film The Truth (2015) and a lead role for the film The Age of Reason (2014). All three films are scheduled to be release 2014.

Megan keeps busy with friends and family, modeling and teaching preschool at a local gymnastics facility. One of the things she loves the most, about the business, is making new friends on every set.

- IMDb Mini Biography', 'Austin - Texas - USA', 1, '/kvrt550lRFjIWqJLBeKaETG7UrP.jpg'),
