        (1467977, 'Bruce Salmon', '1961-10-02', 'Bruce Salmon was born in New Orleans, Louisiana, on October 2, 1961. Bruce moved with his family to Houston, TX, in September, 1969. He began performing music live at the age of 15 in Houston, and moved to Austin, TX to further his music career in 1980. He has been a professional musician since then, in addition to a world traveling adventurer. He is the father of Ellar Coltrane Kinney Salmon, lead actor in the film Boyhood (2014). Bruce has a cameo in the film. - IMDb Mini Biography By: self', 'New Orleans - Louisiana - USA', 1, NULL),
