        (1469630, 'Alessandro Lindblad', '1991-07-07', 'Alessandro Lindblad, commonly known by his stage name Alesso, is a Swedish DJ and electronic dance music producer. He has worked with numerous EDM (and other) artists, including Avicii, OneRepublic, Calvin Harris, Usher, David Guetta, and Sebastian Ingrosso. He has also performed at numerous music festivals, including Coachella, Electric Daisy Carnival, and Tomorrowland. In 2012, MTV named Alesso one of the "EDM Rookies to Watch," and Madonna, who invited him to open select dates on her MDNA Tour, called Alesso "the next big thing in dance music." As of 2014, he ranks 15th on DJ Magazine''s list of the top 100 DJs. His debut full-length album FOREVER is set to be released by May 22, 2015 by Def Jam Recordings.', 'Stockholm', 1, '/b1ul0eTKQtlHLq4rQAsKkHmBupB.jpg'),
        (1469633, 'Nick Rotteveel', '1989-01-06', 'Nick Rotteveel, better known by his stage name Nicky Romero, is a Dutch DJ and music producer. He has worked with, and received support from DJs, such as Tiësto, Fedde le Grand, Sander van Doorn, David Guetta, Calvin Harris, Armand Van Helden, Avicii and Hardwell. He currently ranks No. 8 on DJ Magazine''s annual Top 100 DJs poll. He is known for his viral hit song "Toulouse", as well as for having a number one hit single in the UK with "I Could Be the One" with Avicii.', 'The Netherlands', 1, '/b6vSY72NvCeGRUMyaGLVB8vgQE2.jpg'),
        (1469645, 'Richard Lynch', '1965-01-01', 'Richard Lynch is a Welsh television and film actor best known for playing the character of Garry Monk in S4C''s long-running Welsh-language soap "Pobol y Cwm".

Lynch is an alumnus of Ysgol Gyfun Rhydfelen in Pontypridd. He later graduated in Drama from Aberystwyth University in 1987. In 2013 Lynch was awarded a Fellowship of Aberystwyth University. 

Lynch first came to prominence in the 1986 Karl Francis'' film "Milwr Bychan" playing young soldier Will Thomas. Further film appearances include "Branwen" (1994), "Darklands" (1996), "The Proposition" (1997), and "Y Mabinogi" (2003).  Lynch has starred in numerous television productions and series, including "The Christmas Stallion" (1992), "The Lifeboat" (1994), and "Tales from Pleasure Beach" (2001).', 'Wales', 1, '/qoM7ARSG1LM86GVWm0mw0W03c22.jpg'),
