        (1472001, 'Iris Apfel', '1921-08-29', 'Iris Apfel (née le 29 août 1921) est une entrepreneuse américaine, architecte d’intérieur et icône de la mode. Jeune femme, Apfel travaille pour le quotidien Women''s Wear Daily et pour le designer d''intérieur Elinor Johnson. Elle est également assistante de l''illustrateur Robert Goodman1.

En 1948, elle épouse Carl Apfel. Deux ans plus tard, ils lancent l''entreprise de textile Old World Weavers et la dirigent jusqu''à leurs retraites en 1992. Grâce à leur entreprise, le couple commence à voyager au quatre coins du monde où elle commence à dénicher des bijoux et des vêtements artisanaux. Elle commence à porter ces vêtements dans les soirées mondaines de leurs clients3. De 1950 à 1992, Iris Apfel participe à plusieurs projets de design et de restauration, ainsi qu''un travail de décoration à la Maison Blanche pour le compte de neuf présidents : Truman, Eisenhower, Kennedy, Johnson, Nixon, Ford, Carter, Reagan et Clinton4. Début 2016, elle devient l''égérie de l''automobile Nouvelle DS3.', 'Queens, NY', 1, '/z69AgxEhPf5Z84hvzVOBkmC7PkM.jpg'),
