        (1475368, 'Tatum Miranda', '1987-01-14', 'Tatum Miranda aka Venus, is an actress, model &amp; singer. She was born on a US military base in Belgium &amp; grew up around the Air Force traveling. She went to high school and college in Alaska before moving to Los Angeles to pursue a career in music and film. She has worked on the sets of Horrible Bosses 2, Cat Run 2, True Detective, NCIS LA, MANswers, 1000 Ways To Die, &amp; she recently finished filming her first lead role in the film Most Likely To Die which will be theatrically released in October 2015. She is also set to star as the Jedi Nyla Tardun in a fan film titled Rise of the Empire. Tatum recently began working for Brett Ratner at RatPac Entertainment doing script analysis to improve her efficiency in her own script writing. She was soon inspired to produce her own projects instead waiting around to book other jobs. She is currently writing a feature called The City of Eight and beginning another called Thirst of the Ancients with plans to help produce both. Tatum is a classically trained singer &amp; an independent recording artist. She records out of her own private studio. She is working to complete her first album titled Sub Rosa. She looks forward to combining her passion of music with film.', 'Mons, Belgium', 1, '/kEuagiGVKX3UlNWTXM2dCnYygND.jpg'),
