        (1490615, 'Ron Tarr', '1936-11-14', 'Ronald Lawrence Morisco-Tarr, known as Ron Tarr and ''Big'' Ron Tarr, was a British actor and supporting artiste famed for his hirsute physical stature. Born in Willesden in Middlesex, England, Tarr got his first acting role in the 1973 Carry On film  Carry On Girls where he played a bearded audience member. This was followed by appearances in many television series such as Doctor Who, Blake’s 7, Space 1999, Are You Being Served?, The Gentle Touch, The Comic Strip Presents: 5 Go Mad in Dorset and Dramarama. He also notched up a number of film appearances including A View To A Kill, Eat the Rich (he also cameos in Motorhead’s music video soundtrack of the film) and Willow. However, it is his role as Big Ron in the BBC soap opera Eastenders that Tarr is best remembered.  He played the friendly ducking and diving market trader Big Ron from the show’s inception in 1985 to just before his untimely death from cancer at the age of 60 in October 1997. Although he was only a supporting actor and therefore his character had very few central storylines, he was often seen interacting with the main characters in the show who could always rely on his physically intimidating presence whenever trouble was brewing. After his death, he appeared in pre-recorded episodes of the soap. To explain the absence of his character, in early 1998 Big Ron was written out of the series in a storyline concerning him winning the lottery and moving to Spain.', 'Willesden, Middlesex, England, UK', 1, '/iMSzEgb5VCREfDQjtxo9cI0wYt5.jpg'),
