        (1493344, 'Wayne W. Johnson', NULL, 'Wayne W. Johnson is an actor and singer / guitarist for the band CAROLINE BLUE. Wayne initially started out on several CNY bands before forming CAROLINE BLUE. After years of focusing primarily on music, Wayne shifted that focus towards the path of acting in 2011. He is currently best known for his roles as Corneilus in “Night of Something Strange” (Hurricane Bridge Entertainment / SRS Cinema LLC / Virtual Interactive), Dracula in “Tales of Dracula” (Wolfbain Productions) and Draven in “Empire State of the Dead” (SRS Cinema LLC / Mad Angel Films).', NULL, 1, '/4xRcHulBfZTav3qsjA1ASiJd7xm.jpg'),
