        (1493724, 'Steffi Thake', '1990-11-29', 'Steffi was born in Malta. Having been involved in the performing arts since she was 3 years old she began acting professionally at the age of 19 when she joined the Malta Amateur Dramatic Club (MADC) and took part in a number of theatre productions. During the 2013 MADC One Act Play Festival, she was awarded the Best Actress award for her performance in Murder Play. Some other notable works include: Shakespeare''s Much Ado About Nothing and A Midsummer Night''s Dream, I''ll Be Back Before Midnight, The Vagina Monologues, Image of an Unknown Young Woman and A Handbag. She has recently featured in a few of short and feature films; the latest being Do Re Mi Fa directed by Chris Zarb, and 13 Hours: The Secret Soldiers of Benghazi directed by Michael Bay.', 'Malta', 1, '/9eZRWUIE055U0EafhmhOEtwLnTE.jpg'),
        (1493725, 'Kerim Troeller', '1990-10-22', 'Classically trained at LAMDA - The London Academy of Music and Dramatic Art; Swedish actor Kerim Troeller''s rise to success is an inspirational and humbling story. He made it on his own without an agent for 6 years, from being homeless, broke, working 30 odd jobs, writing/producing/starring in, even directing his own films, to being a rising star in Hollywood.  Born in Geneva, Switzerland to an American father and Turkish mother, Kerim spent most of his life in Stockholm, Sweden, where he calls home, but has also lived in Switzerland, Canada, Japan, Malta, Italy, Turkey, Boston, Los Angeles, New York, and London, speaking English, Swedish, Turkish, studying Italian and formerly fluent in Japanese.', 'Geneva, Switzerland', 1, '/Ae4ujU5P9eqUpHFejhA85kG5Lj6.jpg'),
