Amiah lives in California with her parents, and younger brother. Amiah has two siblings (an older brother who lives at campus), and is currently 12 years old. Her birthday is July 16th.

Before modeling and acting, Amiah was doing a few pageants, runway events, and eventually got her FIRST movie role – House on the Lake. Since, Amiah’s career has skyrocketed.', 'Virginia, U.S.', 1, '/endKelXlQt0yzMNForFsH1JAfbF.jpg'),
