        (1497129, 'Bobby Fischer', '1943-03-09', 'Robert James "Bobby" Fischer was an American chess prodigy, grandmaster, and the eleventh World Chess Champion. Many consider him the greatest chess player of all time.

At age 13 Fischer won a "brilliancy" that became known as The Game of the Century. Starting at age 14, Fischer played in eight United States Championships, winning each by at least a one-point margin. At age 15, Fischer became both the youngest grandmaster up to that time and the youngest candidate for the World Championship. At age 20, Fischer won the 1963–64 U.S. Championship with 11/11, the only perfect score in the history of the tournament. Fischer''s My 60 Memorable Games (1969) remains a revered work in chess literature.', 'Chicago, Illinois, USA', 1, '/84USYX5daOIym6SQL3z2TDquCQd.jpg'),
