        (1497557, 'Alexa Demie', '1994-12-11', 'Alexa Demie (born December 11, 1994) is a singer, songwriter and actress, known for her work in features including Brigsby Bear (2017), Mid90s (2018) and Waves (2019). She had recurring roles as Shairee in Ray Donovan (2013), Marina in Love (2016) before landing her starring role as Maddy Perez in the 2019 series Euphoria (2019).

