        (1497770, 'Sharmagne Leland-St. John', NULL, 'Sharmagne Leland-St. John is a 21st-century poet. Leland-St. John is best known for the poem "I Said Coffee," for which she was nominated for the Pushcart Prize in 2007. With its "deadpan puncturing of the male ego and its assumption of sexual implication where there is none," this piece has become one of her most frequently published and requested poems. She has received a total of 7 Pushcart Prize nominations and won the 2013 International Book Award honoring Excellence in Mainstream and Independent Publishing for best Poetry Anthology. (Wikipedia)', NULL, 1, NULL),
