        (1504947, 'Nicholas Hamilton', '2000-05-04', 'Nicholas has worked constantly throughout his teens. He plays Henry Bowers in horror remake "IT", based on the acclaimed Stephen King novel and also appears in "The Dark Tower", starring Matthew McConaughey and Idris Elba. Other feature credits include Captain Fantastic, from director Matt Ross, opposite Viggo Mortensen, which had outings at both the Sundance and Cannes film festivals and received a Nomination for Best Ensemble in a Feature Film at 2017''s SAG Awards; and Strangerland from director Kim Farrant, opposite Nicole Kidman, Hugo Weaving and Joseph Fiennes.

