        (1506488, 'Mela Hudson', '1987-07-24', 'Mela is best known for her role as Emma in the short indie drama Split Costs. The story is based on two young women from disparate backgrounds who share a ride to western Massachusetts where traumatic setbacks force each to make pivotal decisions at an unforeseen crossroads. The film won Best Screenplay at the 2016 Destiny City Film Festival, Best Drama and Best Overall at the 2016 Women''s Only Entertainment Film Festival, as well as an Audience Choice Award at the 2016 Bluestocking Film Series. It was also a Finalist at both Los Angeles CineFest, and Mosaic World Film Festival.

Mela''s feature film credits include Sony''s Men in Black 3, Honora''s Hits, and Cine Mosaic''s The Sisterhood of Night. Television credits include MTV''s I Just Want My Pants Back as well as an appearance on NBC''s Blue Bloods, She  also stars in the animated series, Not So Random by Essence Cartoon, and has performed countless voiceovers for all types of productions including the most recent children''s animation, Kitty Club.

Mela won the People''s Choice Award at the 2012 Coleman Awards, Best Supporting Broad at the 2015 Broad Humor Film Festival, Best Actress at the 2016 Women''s Only Entertainment Film Festival, and an Award of Merit for Leading Actress at the 2016 Best Shorts Competition. She has also been nominated for a Shorty Award as well as Best Actress in a Short Film at the 2016 Hudson Valley International Film Festival.', 'Poughkeepsie, New York, USA', 1, '/47qi4gSa2c8DDs70rleTK6nStQu.jpg'),
