        (1511439, 'Jarry', '1977-08-05', 'Jarry est issu d’une famille de viticulteurs de Rablay-sur-Layon, un village situé non loin d''Angers.

Il fait ses premières armes dans la compagnie de danse hip-hop Exprime au Centre national de danse contemporaine.

Sa passion pour la scène, il la partage également en donnant des cours d’expressions théâtrale dans des lycées ou lors d’interventions dans des maisons d''arrêt.  Par ailleurs, pendant cinq ans, il a formé des enseignants au Maroc, en Tunisie et au Mali dans le cadre de programmes d’apprentissage de la langue à travers l’expression théâtrale.

À 22 ans, il quitte sa région natale et se rend à Paris où il commence sa carrière de comédien.  Il rejoint alors la compagnie Entrées de Jeu dirigée par Bernard Grosjean.  Pendant 10 ans, le théâtre forum lui permettra d’aborder de nombreux thèmes liés à l’observation de la société et il y développera l’art de l’improvisation.

Parallèlement, il fait des apparitions dans des comédies au cinéma.  C''est lors du tournage de Bambou que Didier Bourdon lui a conseillé de s’orienter vers le one-man-show.  Après un seul en scène autobiographique, Entre fous émois, il présente son premier one-man-show, Atypique en 2013, joué dans un premier temps à l''Instinct Théâtre puis à la Comédie des Boulevards et au Trévise, outre une tournée à travers la France.

Il a été un membre récurrent de Face à la bande sur France 2. Humoriste vu dans Show le matin, il est un habitué de Vendredi tout est permis. Cet humoriste gay revendique son orientation.', 'Angers, France', 1, '/j0MeXNC4Kwhu20KfYwz2iVoT7tg.jpg'),
