        (1512535, 'Brian Gilleece', NULL, 'Brian Gilleece is an American Born Actor, On-Air Personality &amp; Host. Brian was born in Port Jefferson, NY, the son of Robert &amp; Frances Gilleece and younger brother to David, Christopher &amp; Andy. Brian spent the majority of his childhood in the small central Connecticut town of Woodbury and attended Holy Cross High School in Waterbury, CT were he was involved in athletics of a varied nature including Ice Hockey, Baseball &amp; Captain of the Varsity Down Hill Ski Racing Team &amp; Captain of the Varsity Golf Team. Brian also acted in Fall and Spring theater department play productions.', 'Port Jefferson - New York - USA', 1, '/h8ZB7DGtQSYW2uCbtoxbVllnR8G.jpg'),
