        (1517704, 'James Aston Lake', NULL, 'James Aston Lake was born and raised in Birmingham, England and moved to Las Vegas, Nevada in 2002 where he trained with Second City Improv Troupe, Theatre with Gerald Gordon and Voice Over with Alice Whitfield. This experience has been an essential part of his growth process.

In 2013 he moved to Los Angeles and began pursuing his acting career full time. Deciding to concentrate on Film Acting, He has been training with Ryan R. Williams for two years. Ryan was voted as the best "On-Camera Film Acting Coach" by Backstage Magazine in 2014 and has cast James in many projects including upcoming TV show "Sketchy"

During his time in Los Angeles he has Co-Stared with Kevin Hart on "Real Husbands of Hollywood" and Guest Starred in the pilot "Palasades Justice" and "Shadow". Also working on numerous feature films such as "Red Man", "Holding Lucid" & "Where the Devil Dwells". He Performed Stunts in principle roles on upcoming feature films "Enigma" and "Drone Wars".  In 2014 James Directed and Filmed the comedy webseries "The Aaron and Brian show", also performing all post production on the show, including Editing & VFX.  In 2018 James was part of the "Velvet Buzzsaw" cast, a horror-thiller by "Nightcrawler" writer and director Dan Gilroy, which starred Jake Gyllenhaal and Zawe Ashton.  James also has developed skills in sound editing and has an EDM podcast under the pseudonym "D4rk Valhalla" on soundcloud.  "Movies make people feel less alone, I want to be a part of that."', 'Birmingham, England', 1, '/xHMUmDsbQ7XQghQtG68yTICqLUT.jpg'),
