        (1517836, 'Isabella Amara', '1998-10-09', 'Isabella Amara, an actress and vocalist, was born in Atlanta, Georgia. She''s a veteran actress on stage and screen.

Isabella stayed busy in 2015 filming four feature films around the country. She stars in the lead role of "Claire" opposite Woody Harrelson and Laura Dern as their biological daughter in Fox Searchlight''s upcoming feature film Wilson(2016) written by Daniel Clowes and directed by Craig Johnson. In the spring of 2015, she portrayed the role of 15 year old Michelle Darnell (teen Melissa McCarthy) in Universal''s feature film The Boss (2016) directed by Ben Falcone and starring Melissa McCarthy. Isabella filmed the supporting role of Franny in the Indie feature film The Tale(2016) written and directed by Jennifer Fox in the fall of 2015, Isabella''s second film with Laura Dern. She wrapped her 2015 year as "Heidi" in the CBS film Middle School-Worst Years of My Life (2016). Other feature films of Isabella''s include Barely Lethal (2015) starring Samuel L. Jackson, Hailey Steinfeld and directed by Kyle Newman plus Joyful Noise (2012) starring Dolly Parton, Queen Latifah, Jeremy Jordan and directed by Todd Graff.

During early elementary school, Isabella''s love for acting and music was discovered. Isabella captured lead roles in community theatre and performed with national tours as a kid triple threat actor, singer, and dancer. She transitioned to film and television acting at age ten training in Atlanta, New York and Los Angeles while acting in independent films.

Isabella attended a performing arts high school focusing on vocals and acting. A classically trained vocalist, Isabella has expanded her music performing around Atlanta as a lead singer for a rock band. She continues to train with vocal stylist coach for recording artists in the pop and rock genre too. Her love for singing is matched with her passion for acting.

- IMDb Mini Biography By: C. Fairchild', 'Atlanta, Georgia, USA', 1, '/yGYPpZzeyzYf14M3xv1LYu7h6A7.jpg'),
