        (1525065, 'Elizabeth Pan', NULL, 'Elizabeth Pan was born and raised in the Los Angeles suburb of Thousand Oaks, California where she grew up learning to speak both English and Mandarin Chinese at the same time. Elizabeth’s auspicious stage career started in the 5th Grade when she played the posterior end of Nana the Dog in Westlake Elementary’s production of “Peter Pan.”  It could only go up from there.

In her junior year at UCLA, Elizabeth attended a production of Miss Saigon at Los Angeles’ premier theater company, Center Theatre Group and signed up for acting lessons the next day.  Elizabeth studied classical theater at the Royal National Theatre in London, the American Conservatory Theater in San Francisco and The Antaeus Company in Los Angeles.  A few years later, Elizabeth was back at Center Theater Group but this time as a lead actor in the critically acclaimed production of Jessica Hagedorn’s “Dogeaters” at the Kirk Douglas Theater. 

She has worked on some of the most prestigious stages in Southern California.  The LA Weekly theatre critic said of her performance in Chay Yew’s adaptation of The Cherry Orchard, “I can not remember anything in theatre as heartbreaking…Pan’s eyes are glistening pieces of obsidian and her wounded silence is unbearable.”  Elizabeth originated the lead role of Chinadoll in Damon Chua’s “Film Chinois” which won the 2007 Ovation Award for Best New Play.  Elizabeth currently works extensively in film, television, stage, commercials and voiceovers.  You have seen her in guest star and co-star roles on FOX, NBC, ABC and CBS.  Her voice is on various commercials, television shows, films and video games including “Penguins of Madagascar (Dreamworks)”, “ The Regular Show (The Cartoon Network)”, and “Mr. Robot (USA Network)”.  Elizabeth can be seen on national commercials including Progressive Insurance, HSBC and Canada Dry.  She loves hiking in the mountains around her home in Los Angeles, cooking for other people, especially if vegan food is involved and is plotting world domination through real estate.', 'Thousand Oaks, California, United States', 1, '/7jzbZ65CTBko7o1f8BLXmyToqN9.jpg'),
