        (1526756, 'Victoria Bedos', '1984-04-28', 'Victoria Bedos, née le 28 avril 1984 à Neuilly-sur-Seine, est un écrivain et une scénariste, chanteuse et comédienne française. Elle est la fille de Guy Bedos et Joëlle Bercot, et la soeur de Nicolas Bedos.

Victoria a commencé en tant que journaliste au Télécinéobs (supplément du Nouvel Observateur), aux Inrockuptibles, ainsi que pour le magazine féminin Glamour.

En 2007 à 23 ans, Victoria Bedos publie chez Plon son premier ouvrage, Le Déni, où elle analyse de façon romancée le déni qui engage son corollaire, le mensonge. Elle est également scénariste pour Confidences, une série diffusée sur la chaine Canal+ en janvier 2007.

Elle est co-auteur avec Stanislas Carré de Malberg du scénario du film La Famille Bélier. Le film est produit par Eric Jehelmann, Philippe Rousselet et Stéphane Célérié, réalisé par Éric Lartigau.

En 2014, tout en écrivant La Famille Bélier, elle crée le duo Vicky-Banjo avec Olivier Urvoy de Closmadeuc. Il compose les mélodies, elle écrit les chansons et ils chantent ensemble.

Elle incarne Linda, le rôle principal de la mini-série Gym Couine écrite et réalisée par Sébastien Haddouk, diffusé durant deux ans sur June et les réseaux sociaux et produit par Silex film.

Elle est l''égérie de la campagne de pub interactive pour la nouvelle version du magazine Glamour, réalisée par Noémie Saglio.

En janvier 2015, elle tourne le film Vicky qu''elle a co-écrit avec Denis Imbert (co-réalisateur de la série Platane) et dont elle tient le premier rôle. Le film est réalisé par Denis Imbert et produit par LGM films avec dans les rôles principaux Chantal Lauby et François Berléand qui jouent ses parents et Jonathan Cohen son frère.', 'Neuilly-sur-Seine, France', 1, '/aUAkNJGXgsz9yQawHrMxUCgKXc8.jpg'),
