        (1527565, 'Mayling Ng', NULL, 'Mayling Ng is an Actress and Martial Artist, know for her role as Svietta in "Lady Bloodfight" (2016) and she also plays an Amazon Warrior (Orana) in her latest movie "Wonder Woman" (2017). 

