        (1533850, 'Eden Estrella', '2004-03-30', 'Eden Estrella is an American actress born on March 30, 2004 and lives in the Los Angeles area with her parents and two siblings.

Her breakout role in Furious 7 (2015) as the sassy, young daughter of Agent Luke Hobbs, played by Dwayne Johnson shows that the apple doesn''t fall far from the tree as she confronts the charismatic, but imposing figure of Dominic Torretto, played by Vin Diesel. She reprises the role as Samantha Hobbs in Fast 8 (2017).

From her mother''s side, Eden''s Filipina heritage is mixed with Spanish and Portuguese. From her father''s side, Eden has Irish, German, British, French and Scottish ancestry, with Eden''s European lineage tracing back to the Salisbury''s and notably, the O''Baoigheallains; as epitomized in O''Dugals 14th century poem of the "blue-eyed, bold kings of Dartry!''

Eden began her acting career in 2013. She is represented by agent, Robin Nassif of Media Artists Group and manager, Tina Treadwell of Treadwell Entertainment Group and attorney Steve Younger of ''Myman Greenspan Fineman Fox Rosenberg Light [us]''.

Eden is a GATE honors student taking up ballet, jazz, acting and singing lessons. In her spare time, Eden loves to draw anime, read and write and has self-published short stories and poetry on Wattpad.', 'Los Angeles, U.S.A', 1, '/xxzcCrgD38jOyCRlbBA5ksfrN14.jpg'),
