        (1536128, 'David Barroso', NULL, 'David Barroso (also known as David Barroso Jr) had several nicknames growing up. Known as David Villa he grew up in Astoria, in the Borough of Queens, New York City, with most of his family members. David is the youngest of 11 children. David went to Long Island City High School, then went on to Queensbourogh College. David started acting at H.B. Studios when he was really young and started boxing to stay off the streets. Later on went to NYU Master Class and the Actors Studio. David has an autobiography that is looking for a publisher, title "Falling down but Not Staying Down". The story is about his battles from the days of growing up in Queens, NYC, drinking, drugs to being an athlete to being in jail to the positive, caring person he has become today spending time when in NYC at the nursing and rehabilitation home to make the elderly laugh and caring. David said''s they are the forgotten people. Resides in Los Angeles California.', NULL, 1, '/A3BWUd2GdFBumWvuAYkh96z0Pfz.jpg'),
