        (1537073, 'Marieke Bresseleers', '1992-01-12', 'Marieke Bresseleers (°Gent, België; 12-01-1992) studeerde Muziektheater aan het Fontys conservatorium in Tilburg, Nederland. Zij vertolkte gastrollen voor VT4 en Vijf TV.  Zij speelde de rol van Patsy, de onhandige poetshulp van Benny in ''Familie'' en was te zien in '' De Buurtpolitie''. In ''A Quiet Passion'' van Terence Davies vertolkt zij de rol van de Zweedse operadiva Jenny Lind. Naast acteren is Marieke Bresseleers actief als zangeres en is de frontvrouw van ''Circle Unbroken'', een epic metal band en heeft met ''Vincere'' een eerste cd uit.  Zij staat op de bühne met een eigen voorstelling ''Stemmen'', een muziektheaterproductie over een jonge vrouw die op zoek is naar een eigen identiteit in een wereld die in brand lijkt te staan.  ', 'Gent, Belgium', 1, '/imr0oOAdc6mKWiSYYyhxD3aPaHm.jpg'),
