        (1543059, 'Noble Chissell', '1905-02-16', 'Born Noble LaPorte Chisman to Thomas F and Cora Esther (LaPorte) Chisman of Indianapolis, he eventually adopted the screen name Kid Chissel. He left his Indiana home in the mid-1930''s, not long after his parents had divorced. He aimed to pursue a Hollywood career. Prior to that, he worked as a locomotive fireman in Indianapolis (1930 U.S. Census). His father worked the railroad yards in Indianapolis, and at the time of Noble''s birth, resided at 3018 East New York Street (1910 U.S. Census). Noble''s maternal grandparents, Isaac R &amp; Nora LaPorte, are buried in a Catholic Cemetery on the southside of Indianapolis. They are the author''s second great grandparents.', 'Indianapolis, Indiana, USA', 1, '/wNgSgRtDMlK8fi6iJEyOLooSL36.jpg'),
