        (1554383, 'Dave Johns', '1955-01-01', 'Dave Johns is an actor, stand up comedian and talented improviser who played the lead role in Ken Loach''s feature film ''I, Daniel Blake'' which won the 2016 Palme d''Or at Cannes Film Festival. He is a regular guest with the Comedy Store Players on their improv show in London''s West End.

