        (1561755, 'Svenja Jung', '1993-05-28', 'Die Schauspielerin Svenja Jung wurde am 28.5.1993 in Weroth geboren und wuchs dort im südlichen Westerwald auch auf. 2012 bestand sie erfolgreich das Abitur und verbrachte danach ein halbes Jahr in Australien. Hier hielt Svenja Jung sich mit diversen Jobs über Wasser. Zurück in Deutschland begann Jung ernsthaft an ihrer Karriere als Schauspielerin zu arbeiten. Schon vor ihrem Abitur hatte sie zusätzlichen Schauspielunterricht genommen. Von 2010 bis 2012 studierte Svenja Jung am Juniorhouse in Köln und besuchte von 2011 bis 2012 die Koblenzer Schauspielschule. In einem Werbespot für Nestlé war die Svenja Jung als „Hero Girl“ zu sehen. Darauf folgten kleinere Rollen in TV-Serien. In „Heldt“ spielte Svenja Jung die Rolle der Mandy. Dank ihrer überzeugenden Darstellung errang sie 2014 ihre erste Hauptrolle. In der Serie „Unter uns“ spielte sie Lisa Brück. Die Doppelrolle als Polizistin und Escort-Dame verlangte der Jungschauspielerin viel Einfühlungsvermögen ab. Mit ihrer Darstellung bewies Svenja Jung, dass sie schauspielerisch etwas zu bieten hat. In der darauffolgenden Literaturverfilmung von „Fucking Berlin“ spielt Svenja Jung die Hauptrolle.', 'Weroth, Germany', 1, '/bqY3HjPpq6kz15aGBk7H32EjoHr.jpg'),
