        (1566496, 'Matteo Corradini', NULL, 'La sua principale attività nel mondo del cinema è quella di interprete e tra i lavori più interessanti possiamo citare la partecipazione nel film The Pills (2011) di Luca Vecchi.  Nel 2016 ha inoltre lavorato con Luca Vecchi per la realizzazione del film 

The Pills - Sempre meglio che lavorare dove ha interpretato la parte di Matteo. Il film è uscito proprio in questi giorni nelle sale cinematografiche italiane e distribuito da Medusa da giovedì 21 gennaio. Oltre al ruolo di interprete Matteo Corradini ha lavorato come sceneggiatore nel film commedia di Luca Vecchi 

The Pills - Sempre meglio che lavorare (2016).', NULL, 1, '/eElziF1kD4d3S8HOHJJF0ODGA3O.jpg'),
