        (1568053, 'Lex Scott Davis', '1991-02-21', 'Alexis "Lex Scott" Davis is a 26-year-old actress from Baltimore, Maryland, and has been dancing and acting since she was 3 years old. Davis attended Drexel University as a Dance Physical Therapy major before she moved to New York City in 2013. She continued her studies at the New York Film Academy and in 2014, she relocated to Los Angeles, California, to pursue a career in film and television. Davis made her television debut starring as the legendary singer Toni Braxton in the Lifetime movie UNBREAK MY HEART, which was met with record-breaking numbers for Lifetime Television and an outpouring of love from Toni''s longtime fans. She has recently costarred on the television adaptation of Antoine Fuqua''s TRAINING DAY opposite the late Bill Paxton and newcomer Justin Cornwell for CBS.', 'Baltimore, Maryland, USA', 1, '/1wRPphyIwofYWq7ztHr9Q2FAz8R.jpg'),
