        (1574934, 'Agustín Jiménez', '1970-10-18', 'Humorista, actor, presentador y monologuista español. Es uno de los creadores e impulsores del género de stand up en España así como un referente imprescindible como intérprete y autor. Ha participado en múltiples cadenas de televisión como actor, presentador, showman, y ocasionalmente como guionista. Se dio a conocer en la cadena televisiva Paramount Comedy. Es uno de los fundadores de la emisora comunitaria Radio Enlace (Madrid). Actualmente centra su carrera en la interpretación teatral donde ha obtenido reconocimiento del público y de la crítica, protagonizando varias obras de éxito comercial.', 'Cáceres, Extremadura, Spain', 1, '/oEIuE35lJ7THMG99TvVA3h1xo9c.jpg'),
