        (1575412, 'Father John Misty', '1981-05-03', 'Joshua Michael "Josh" Tillman (born May 3, 1981), also known as J. Tillman or Father John Misty, is an American singer, songwriter, guitarist and drummer. Maintaining a steady output of solo recordings since 2004, Tillman was formerly a member of rock band Fleet Foxes before departing in 2012 to release his debut record as Father John Misty, titled ''Fear Fun''. His sophomore album ''I Love You, Honeybear'' was his breakout, receiving widespread acclaim and being cited by many as one of the best albums of 2015. He went on to write material for Beyoncé and Lady Gaga before releasing his third studio album, ''Pure Comedy'', in 2017.', 'Rockville, Maryland, U.S.', 1, '/iaPjlULRMGiSdkbfnR7QniHbvEm.jpg'),
