        (1577027, 'Alejandro Cuello', '1997-12-02', 'Alejandro Cuello (born in Montevideo Uruguay is a Uruguayam teen actor and pop singer. In 2006, when he was seven, he sang for the first time in public at the regional music competition in Andalucia, being awarded with a special mention of the jury. Two years later, he won the revelation award at the national music competition. When he was nine years, he sang for the first time in the television show "Menuda Noche" on the Andalusian channel "Canal Sur". He has performed in this show in front of internationally recognized Latin singers such as Raphael, David Bisbal, David Bustamante, and Juan Luis Guerra, who have praised Alejandro for his strong vocal abilities and stage presence. Early 2009, when he was ten, he signed a contract with EMI Music Spain and released in December of the same year his debut album, recorded in Madrid, under the title Alejandro Cuello. The album was produced by the Spanish composer and producer Jacobo Calderon, who has worked before with Latin singers like Raphael, David Bisbal, and Luis Fonsi.The album contains seven songs composed by Calderon, covers of four popular Latin songs, and a Spanish version of "Without you", sang in a duet with the french teen singer Caroline Costa. Alejandro acted in the TV movies "Días sin Luz" (2009) and "Raphael" (2010) broad-casted by the Spanish television channel Antena 3. In the biopic "Raphael", Alejandro portrayed the worldwide acclaimed Spanish singer Raphael in the early years of his career and sang some of the vocal tracks.', 'Montevideo - Uruguay', 1, '/qWUgYumDG7b1ZJYN5ZNV2RetiVB.jpg'),
