        (1581018, 'Parker Tyler', '1904-03-06', 'Harrison Parker Tyler, better known as Parker Tyler (6 March 1904, New Orleans – June 1974, New York City), was an American author, poet, and film critic. Tyler had a relationship with underground filmmaker Charles Boultenhouse (1926–1994) from 1945 until his death. Their papers are held by the New York Public Library.

