        (1581103, 'Stefania Spampinato', NULL, 'Stefania Spampinato was born in a small town at the base of the Etna  Volcano in Belpasso, Sicily. She started dancing at 6 years old. Her  passion for the arts at a young age was undeniable so her mother started  making her dance costumes so she could afford her daughter''s tuition.  After graduating high school with honors, she did something unheard of  in her small village: she bought a plane ticket &amp; left. What came to  follow was a wildly successful career in dance &amp; theatre that  lasted 10 years &amp; included collaborations with Joquin Cortez, Kylie  Minogue, Demi Lovato Leona Lewi, Neo, Take That, Nine, Samsung, Toyota,  Target Wells Fargo, Adidas, Miller light, The VoiceUK, &amp; X Factor US  &amp; UK In 2011 she made an even bolder move &amp; bought a one way  ticket to Los Angeles, CA. Upon landing she immersed herself in acting  classes with Gary Imhoff (formally of the Beverly Hills Playhouse),  Anthony Meindl, &amp; Michelle Danner. Within 3 months she had  representation commercially and theatrically.', NULL, 1, '/p87jFGR2gUuXDkPIc6seONCuhg1.jpg'),
