        (1581108, 'Kirstyn Konig', NULL, 'Kirstyn König was born  and raised in Calgary, Alberta, where her love of dance started at the  age of nine. She trained at The School of Alberta Ballet, The National  Ballet School of Toronto, The Young Canadians school of Performing Arts  and other highly acclaimed facilities across Canada and the USA.  After  completing high school, she spent three years travelling around the  United States, Caribbean and Europe as a featured dancer and aerial  artist onboard some of Royal Caribbean Cruise Lines’ largest ships.  Her  extensive repertoire includes everything from hip-hop and Latin dance,  to partnering and circus aerial arts.  Kirstyn is based in Vancouver and  can be seen in various mediums, such as:  music videos for Michael  Buble, Dan Mangan, on TV/Film productions such as Once Upon A Time,  Hellcats, This Means War, and in various live show productions  throughout the city.', 'Calgary, Alberta, Canada', 1, '/3VMH7EPKaPfXEkC0U7EwBc5EFDn.jpg'),
