        (1586553, 'Frank Ellis', '1942-03-31', 'Frank has been an actor for over forty years, during which time he has  done seasons with most of the major repertory companies in Britain, including Birmingham, Swansea. Salisbury, Hornchurch, Dundee, Worcester, York, Liverpool, Leatherhead, Watford. He has also appeared in ten World Premieres at the Warehouse Theatre, Croydon. In the West End, he appeared in Treasure Island and Trafford Tanzi at the Mermaid, Jeanne at Sadlers Wells, Joseph and the Amazing Technicolor Dreamcoat at the Westminster and Little Shop of Horrors at the Comedy. He toured the Middle and Far East with Derek Nimmo’s Company, in Key for Two by John Chapman, and Japan and the Philippines with Ken Hill’s Phantom of the Opera.

Frank has made numerous television appearances including Nicholas  Nickleby, The Professionals, The Famous Five, Mitch, Boon, Pressgang,  Old Flames, Square Deal, Camomile Lawn, Resnick, The Chief, Finney,  See-Saw, Michael Winner’s True Crimes, Undercover Heart, Holby City,  EastEnders, Doctors (6 episodes), and The Bill (five times). His films include Buster and Stardust.

Frank is married to ex-actress Jenny, and has two grown-up sons and a wonderful eight-year-old grandson.', 'Birmingham, England, UK', 1, '/2k60Fn4jIrrnnXaPsNQvBHMz9Vn.jpg'),
