        (1589479, 'Kamian Allen', '1978-05-03', 'Kamian Michelle “Mikki” Allen (born May 3, 1978) is an American communications professional and a former actress.  Kamian is best known for her role as Rachel Turner in the feature film, Regarding Henrydirected by Mike Nichols, written by JJ Abramsand co-starring Harrison Ford and Annette Bening.  In 1991, Kamian Michelle “Mikki” Allen was nominated for Best Young Actress Starring in a Motion Picture.  Kamian attended The Dalton School and Columbia University’s School of General Studies.  Kamian is a communications professional residing in NYC.  On September 23, 2014, Kamian was named one of City Hall''s 40 Under 40 Rising Stars for her communications and advocacy work.', 'Boise - Idaho - USA', 2, '/dFmDMTJ5S6irKD2Me8BEjmpcyZ3.jpg'),
        (1589489, 'James Markham Hall Jr.', '1979-05-02', 'James Markham Hall Jr. is an american actor, camera operator, producer, director, writer, editor, stuntman and Cinematographer. He uses the name Jamie Hall for acting roles.', 'Pittsburgh, Pennsylvania, USA', 1, '/usj0nMnmYOJ0615hnNwU3AX4H5H.jpg'),
        (1589523, 'Tommy Truex', NULL, '', NULL, 1, NULL),
        (1589524, 'Joshua R. Aragon', '1984-02-14', 'In 1990, Joshua R. Aragon started working at Get Dwn Entertainment handling duties such as graphic design, running the studio, and booking artists. Between the ages of 6 and 20, Aragon was also a Sound FX mobile disc jockey. In 2008, Aragon started working in the film industry doing background work. Since 2008, Aragon can be seen on television series such as "Breaking Bad", "In Plain Sight", "Easy Money", as well as principal roles in movies such as "We''re The Millers", "2Guns", "Frontera", "Force Of Exectition", and more. Working alongside the likes of Denzel Washington, Mark Wahlberg, Jennifer Anistion, Eva Longoria, Michael Pena, Ed Harris, and various other actors and actresses has allowed Aragon to learn from and work with some of the best in the industry. In 2011, Aragon started the ILLFest Concert Series, in which the likes of Rittz, Crooked I, Chino XL, Diabolic, Apathy, Brotha Lynch Hung, Twista, and other artists were brought to the stages of Albuquerque. Utilizing his ability in promotions and marketing, Aragon has been involved with numerous successful concerts and events as well as helping spread the sounds of artists Reno and TrebolClef. In January of 2013, Aragon started doing prop work, which has expanded his knowledge and abilities to carry over to behind the camera. With movies such as "ForceOfExecution", "Scorch Trials", "Sicario", "BigSky" and TV shows such as "Dig", "Manhattan Project" & NBC''s newest show "ThePlayer". Aragon steadily shows his support to his city, state, and other individuals pursuing their goals.', 'Albuquerque, New Mexico, USA', 1, '/A0ALklluTMk9Vy2eq1pl6vG7w2Q.jpg'),
