        (1618700, 'H. Rap Brown', '1943-10-04', 'Jamil Abdullah Al-Amin, born Hubert Gerold Brown, also known as H. Rap Brown, was the fifth chairman of the Student Nonviolent Coordinating Committee in the 1960s, and during a short-lived alliance between SNCC and the Black Panther Party, he served as their minister of justice. He is perhaps most famous for his proclamations during that period that "violence is as American as cherry pie" and that "If America don''t come around, we''re gonna burn it down." 

H Rap Brown published his autobiography, Die Nigger Die!, in 1969.

