        (1623229, 'Erica Fae', NULL, 'Erica Fae graduated from New York University/Tisch School. Erica creates and produces original work, often from historical research. Her recent play "Take What Is Yours" (in which she stars, and co-wrote) received a Critics'' Pick in The New York Times and Backstage (2012). She appears in Lisa Robinson''s ground breaking short "Hollow", premiering at Tribeca Film Festival (2013). She has won awards for Best Actress and Best Short for her short films, and has performed at New York Theatre Workshop, The Kennedy Center, Walker Arts Center, American Repertory Theatre, The New Victory, A.C.T., and Robert Wilson''s Watermill Center, and Dance Theater Workshop. Erica teaches physical acting at Yale School of Drama and The New School''s MFA programs.', NULL, 1, '/AbxYnAPk5bKmuVAjr4RkvgHfHjo.jpg'),
