        (1625078, 'Ashante P.T. Stokes', NULL, 'Atlanta-born Ashante "PT" Stokes was selected for the DeKalb County Honors Chorus as a third grader. He began taking violin lessons in middle school and sang in numerous local talent competitions in high school and college. Shortly after graduating from college, PT did vocals for a rapper friend until he competed in the 2010 GMA''s IMMERSE.

Performing under the artist name PT the Gospel Spitter, PT pens his own lyrics and co-founded an entertainment company in 2013. The company''s first business division is a rhythm and gospel label. PT''s debut project, "Raise Up" is slated to be released in the fourth quarter of 2014.

Toward the end of 2013, a friend and mentor, urged PT to read for a small part in an indie film. The casting director asked him to read for a larger role, which PT landed. By 2014, he had his first feature film appearance in the action thriller, Taken 3. In addition to acting, commanding a six octave range, PT also does voiceover, with a guilty pleasure of doing so for animation.', 'Atlanta - Georgia - USA', 1, '/syn9gdGs1cfTsjcuGQ744IqEn0t.jpg'),
