        (1629919, 'Matt Kugelman', '1981-06-26', 'Matt Kugelman studied filmmaking at the University of Southern California and Columbia College in Chicago.  After graduation he worked as a researcher for Michael Moore''s Fahrenheit 9/11.  He was then quickly promoted after editing a series of comedic short videos for Moore''s speaking tour that received standing ovations across the country!

Kugelman started working as the editor and photographer of the CBS News on Logo Show. In addition to producing a new show every day, he travelled throughout North America and produced numerous half-hour specials.

In 2010, Kugelman started working at the CBS Evening News editing breaking news with tight deadlines. In 2012 He was recruited by the CBS: This Morning Show as an editor on feature stories.  ​

More recently, he wrote and directed his first full length feature film, Hurricane Bianca, which sold out theaters in New York, Los Angeles, San Francisco, Chicago, Toronto, and Amsterdam. The film found distribution through Wolfe Releasing and sold to iTunes, Vimeo, Amazon and Netflix! Kugelman is now developing a sequel to the film called Hurricane Bianca: From Russia With Hate.​', 'Chicago, Illinois, USA', 1, '/xKmM1SvtlKKhtHFxAlHSDWd08Fq.jpg'),
