        (1645311, 'Amber Frank', '1998-12-02', 'Amber is currently the lead character voice on the new hit show, Spirit Riding Free, on Netflix, as Lucky. She can also be seen in the recent film Destined To Ride starring along side of Denise Richards. Just this year Amber has been seen starring on the Lifetime TV hit movie, Party mom, starring along side of Krista Allen. Soon to be seen in the hit film, Ice Cream In The Cupboard based on the hit novel, alongside of Jaime King and Tobin Bell. Amber got her start at the age of 7 in the hit film , She Could Be you, displaying a powerful dramatic performance playing the real life role of missing child Jennifer Marteliz. Soon after she relocated with her family from Tampa Florida to Los Angeles and began working on several projects, including national commercials for ATT, Mattel, Intel, just to name few. She starred on the ABC tv show, Man Up, along side of Teri Polo,and also began singing and performing throughout the state. At the age of 13 after 6 months of a nation wide casting search Amber was cast as the leading role of Taylor Hathaway on the Nickelodeon channel .The show broke premiere records.Haunted Hathaways filmed nearly 50 episodes including two one hour specials and is still showing on the network. After filming for Nickelodeon Amber was cast as the leading character as Gabby Harlow to carry the powerful dramatic film, Vanished Left behind, along side of Dylan Sprayberry, Mason Dye, Tom Everett Scott, and Jackson Hurst. Amber can also be seen along side of Eva LA Rue in the dramatic film, A Killer Walks Amongst us, playing the edgy teenage daughter. With a multi talented ability proven in the voice over area, multi camera comedy, single camera comedy,drama, thriller,commercial, print,She is a proven value to work with. Amber also performs in shows around Los Angeles singing at events with her love for Jazz music, as Amy Winehouse has always been her musical love.', 'Tampa, Florida, United States', 1, NULL),
