        (1650256, 'James Hepworth', '1991-01-31', 'James was born in York, UK to parents Mark and Liz. He attended Clifton Preparatory School until the age of 8 before moving to St Olave''s School. It was at school here that he first developed a love for acting and drama through the influences of some of his teachers. At 13 he began attending St Peter''s School, York and it was here that his sporting prowess as a cricketer came to the fore playing alongside now England cricketer Jonny Bairstow.

Leaving school at 18 with a hand full of A-levels, James then spent time working in York in order to save for his time in Vancouver, B.C, Canada. Whilst he spent several months in, what he believes to be, the nicest cities he has ever had the opportunity to visit, his acting took a hiatus as uncertainty and settled on him in terms of career path choices.

Upon return from North America, James began studying Politics and Sociology at Newcastle University. It was here that acting really took over and the decision was made that it was the only career that he could seriously consider taking on. Being a large and active part of theatre and comedy societies where he was successful winning awards and ultimately sitting on the executive committee.

Having graduated in 2013 he then embarked upon his chosen path, but deciding not to attend drama school due to the financial implication of such a venture. In going about it ''the old fashioned way'' and learning on the job, a clear progression can be seen in his screen work as he continually looks more and more comfortable on screen. ''Eveline'' was reasonably well received, but James himself has commented on his try-hard acting. More recently in ''Father Figure'' he has been able to maintain character much more strongly and with his newest work in ''Acheron'', ''Switch'', ''The Jeweller'' and ''Chloe'' he has been going from strength to strength.  - IMDb Mini Biography By: Lauren Green', 'York, Yorkshire, England', 1, '/8T5HuTRsF87sePsQAYfUiIdp3ye.jpg'),
