        (1651678, 'Nigel Pivaro', '1959-12-11', 'Nigel Pivaro is a RADA-trained English actor and journalist. He is best known for playing Terry Duckworth, the son of Jack and Vera Duckworth in Coronation Street from 1983 to 1987. He returned to the role for recurring guest appearances throughout the ''90s and ''00s, his last appearance being in 2012. Other TV credits include Hetty Wainthrop Investigates, Expert Witness. In 2002 he appeared in the film 24 Hour Party People. His stage credits include  Wuthering Heights, What the Butler Saw, A Taste of Honey, The Tempest, Greek, An Evening with Gary Lineker,  Funny Peculiar, A View from the Bridge, Up and Under,  Bouncers and several pantomimes.  As a journalist Pivaro has been published regularly in the Manchester Evening News, Tameside Reporter, Daily Star, Daily Mirror and Sunday Mirror and Catholic Herald newspapers, along with Die Zeit Online and Jane''s Defence Review. He has also written and presented documentary films for the BBC Inside Out series.', 'Manchester, England', 1, '/5UnQxuYvZgjTWkMS5qv66hxYffR.jpg'),
