        (1653876, 'Roisin Conaty', '1979-03-26', 'British stand up comedian and actress. In 2010, Conaty won the Best Newcomer Award at the Edinburgh Festival for her show Hero, Warrior, Fireman, Liar, becoming one of only five women to receive an Edinburgh Comedy award in 30 years. On television, Conaty has starred in the Greg Davies sitcom Man Down and has written and starred in her own sitcom GameFace. She has also appeared in Ricky Gervais'' Netflix series After Life. She is managed by Avalon.', 'Camden, London, England', 1, '/xWNKOCqrkOTQlGrXReq4liFGKXW.jpg'),
        (1653887, 'Eleonora Salvadori', NULL, '', NULL, 1, NULL),
        (1654001, 'Amber Midthunder', '1997-04-26', 'Amber Midthunder is an American actress. She is known for her main role in the FX series Legion, and appearances in Longmire and Banshee. Amber is Native American and an enrolled member of the Fort Peck Sioux Tribe. Wikipedia', 'Montana, USA', 1, '/ecBOMkwMsmSXxjwlyMg0941lHKj.jpg'),
