        (1663672, 'Britain Dalton', NULL, 'Britain Dalton began his acting career by happen-chance, when a film student spotted him doing card tricks for a crowd on the street, and asked him to audition for the lead role in Chapman University film: ''Jude''s Tribute.'' By the time filming was completed, Britain had signed with entertainment manager Nikki Mincks & The Osbrink Agency. Within a few months, Britain''s natural acting style and unique ''look'' had landed him roles on TV''s ''Criminal Minds,'' nation commercials and a music video for "Switchfoot''s hit song ''When We Come Alive." Britain has completed 3 films: starring in the AFI''s Film ''Grill Dog," and James Franco''s: ''Actors Anonymous;'' and most recently, co-staring with Eliza Taylor in the Cary Fukunaga produced: ''Thumper.'' He also appears as a young Nathan Drake, in the video game: Uncharted 4 ''A Thief''s End'' Britain is co-starring with Billy Bob Thornton & William Hurt in David E. Kelley''s Legal drama ''Goliath'' on Amazon.

- IMDb Mini Biography By: Britain Dalton official website', NULL, 1, '/cALh8UJ8XP11I8wg4FsWqJQ2bXv.jpg'),
