        (1665465, 'Heidi Pascoe', NULL, 'Born in Wilkes-Barre, Pennsylvania, she started performing in high diving show at the age of 18. She became a professional high diver and was the first woman to win the Acapulco Cliff Diving Championship, held in Mexico, at age 24. After moving to California, she started doing stunts for film &amp; TV in 2002. Since then, she''s worked on over 100 projects. In 2011, she won her first Taurus World Stunt Award for High Work for her performance in Predators. In 2010, she won a SAG award for her work doubling Anna Paquin on "True Blood". She has also been nominated for 3 other SAG awards for best stunt ensemble.', NULL, 1, '/2a4WJnNCJa1hBpTkDDSEIBhBe1C.jpg'),
