        (1667753, 'Jennie Eisenhower', '1978-08-15', 'Jennie Eisenhower is the daughter of Julie Nixon and David Eisenhower. Her grandfather was Richard Nixon, the 37th President of the United States, and her great-grandfather was Dwight D. Eisenhower,  the 34th President of the United States. She grew up in a suburb of  Philadelphia. She is a summa cum laude graduate of Northwestern  University in Evanston, Illinois, where she majored theatre and  communication studies and received a certificate in musical theatre.

She  returned to the east coast to pursue a career in stage and film. Jennie  has had a versatile professional stage career thus far, working  Off-Broadway and, in the last few years, in Philadelphia where she is a  two time Barrymore Award winner. She has been in the original casts of 4  new plays including the Off-Broadway production of "Suburb" and the  Barrymore Award-winning "Baby Case" at the Arden Theatre.', 'San Clemente, California, USA', 1, '/8YNJacCoqSv0yoZbZ8tnX0faVA3.jpg'),
