        (1667974, 'Daniel Stolfi', NULL, 'Daniel Stolfi is a Canadian stage and screen actor, comedian, writer and producer, best known for his stage comedy one-man show "Cancer Can''t Dance Like This". He''s a graduate of the Theatre Program at the University of Guelph, The Second City Conservatory Program in Toronto, Ontario, Canada, and he has studied Comedy with the Upright Citizens Brigade in New York City, USA.', 'Toronto, Ontario,  Canada', 1, '/mt7GDxOnjgk4ntNMvcz0BZYGTJr.jpg'),
