        (1671209, 'Neil Wells', NULL, 'Neil was born and raised in West Des Moines, Iowa. He''s the youngest of three children. He was raised in what he refers to as, "the most normal environment imaginable." His passion for sports and competition were the center point of his life growing up. He competed in competitive sports all year around through high school and continues to compete in stock car racing today. His other passion growing up was the Theatre. Although his schedule was filled with sports he still made time to act in one or two plays a year. After high school he went on to study theatre at Drake University. Neil began to work professionally while still in college landing various roles in film, industrial film, commercials as well as many modeling jobs. Just out of college he toured with an international Theatre company and performed in various Theatre productions around the country after that. After the birth of his daughter in 1992 he decided to put his acting career on hold to provide a more stable and secure home for his daughter to grow up in. In 2008 he began working again in smaller independent productions behind the camera as well as in front and even won awards for his directing with Dark Art Films. Today Neil is once again dedicated full time to his career pursuits and has formed his own independent production company adding Executive producer to his credits and excited about taking his career in front of and behind the camera to the highest levels possible.', NULL, 1, '/oFgdBaok6VM21KVj3UjdaB1aZ6x.jpg'),
