        (1682730, 'Michael Guy Chislett', '1982-04-06', 'Michael Guy Chislett is an Australian born musician and producer. He was previously the lead guitarist of American rock band The Academy Is... and is currently a member of contemporary worship music band Hillsong United, a worship band from Hillsong Church.[1]', 'Australia', 1, '/39ix12VzlaYdBqmcR5CV27QAhqk.jpg'),
        (1682732, 'Matt Crocker', '1987-03-09', 'Matt Crocker is a Sydney based worship leader and songwriter who has grown up in Hillsong church. His younger years were spent playing the drums and learning how to write music in a band setting, where his love of songwriting was first sparked.

After being encouraged by Joel Houston and Marty Sampson to start writing for youth ministry, Matt began to take songwriting more seriously, and spent much of his teenage years learning how to write songs on his own. It was only years later, when he collaborated with other songwriters, that he saw the fruit of the time he had invested into songwriting in those early years.

10 years on since his first published song, and Matt has had the privilege of traveling the world with United and writing songs with influence that spans the globe. Now, at 28 years of age, Matt is happily married to his wife Breanna, and continues to write songs for Hillsong Church and UNITED, with the firm conviction that worship is able to unite the greater church and inspire the lost.', 'Australia', 1, '/seUM8rTeRilDsd9ytOmoYoi5ncA.jpg'),
        (1682734, 'Adam Crosariol', NULL, 'Adam grew up a five minute drive from our Hills Campus and got saved and started coming to church when he was 14. He started music playing at church in youth, kids and extension services. Adam plays bass with Hillsong United. He enjoys cooking, eating, spending time with friends, reading, you know the usual stuff..', NULL, 1, '/t8Rnv6wDpCde8Jrz9UO6mAPEgC0.jpg'),
        (1682735, 'Jonathon Douglass', '1981-12-30', 'Jonathon Douglass or ‘JD’ (as he is known by his childhood nickname) is one of Hillsong Church’s foremost worship leaders and Creative Pastors, and has been a part of the UNITED team since its beginning.

JD grew up in Hillsong Church, attending the Hills Campus with his family from the age of 4, and has been involved in its Kids’ and Youth Ministries since that time. He credits the love and encouragement he experienced growing up at Hillsong, as playing a vital role in the development of his passions – the greatest of which is a firm belief in the power of a healthy local church in seeing God’s Kingdom established across the earth.', 'Australia', 1, '/zgWBMeYm20ToWGIfKVgv2evVOPm.jpg'),
        (1682736, 'Jad Gillies', NULL, 'Based in Sydney, Australia, Jad Gillies has been a part of the UNITED team for ten years now. He is a worship leader and Creative Pastor at Hillsong Church and oversees both the technical and worship leadership teams across the church’s Australian Campuses.

Jad’s passion for the house of God was first ignited when he served in the music and youth ministries of his home church in New Zealand. There, he began leading worship at the age of 17 before moving to Sydney when he was 21 to pursue the study of Worship Ministry at Hillsong International Leadership College.', NULL, 1, '/i1WSMbCcsEy8JAhVbImKEOreUn0.jpg'),
        (1682737, 'Bobbie Houston', '1957-01-16', 'Bobbie Houston is a Pentecostal pastor in the Australian Christian Churches. Houston and her husband, Brian, founded and are the Senior Pastors of the Hillsong Church in Sydney, Australia. Wikipedia', 'New Zealand', 1, '/9ua0RvKxNEgu1zsN12c55a4VPy7.jpg'),
        (1682738, 'Brian Houston', '1954-02-17', 'Brian Houston is a pastor in the Australian Christian Churches. He is currently the senior pastor at Hillsong Church which has locations in Sydney, Brisbane and Melbourne in Australia, London, Cape ... Wikipedia', 'Auckland, New Zealand', 1, '/6tpgqsBbnCs7hl9b0sSLqs5vHIf.jpg'),
        (1682739, 'Joel Houston', '1979-09-19', 'Joel Timothy Houston is a musician, songwriter, pastor, and leader in the Sydney-based band Hillsong United, the youth worship band of Hillsong Church. He has been co-pastor at Hillsong NYC since 2010. Wikipedia', 'Brisbane, Australia', 1, '/ibDGo050ICXMN3iH3UGTjJ9CXsY.jpg'),
        (1682740, 'Simon Kobler', NULL, 'Simon Kobler grew up and still lives in Sydney, Australia. He has been a member of Hillsong Church since he was 7 years old.  Simon began serving as a drummer in Hillsong’s Kids ministry when he was 11 and then continued serving in both the youth ministry and the main church.

 

Simon has been a member of UNITED for 8 years. When not touring and recording with the band, you can find Simon working in the studio on new material, serving at church, or remotely operating a social enterprise in Mumbai, India, aimed at helping the needy in that city.', 'Sydney, Australia', 1, '/zbp3uuaVUUXpq0vaqPYYQCnhmHJ.jpg'),
        (1682741, 'Taya Smith', '1989-05-10', 'Born and raised on the far north coast of New South Wales, Australia, Taya Smith is a key leader in the Hillsong creative team. She is a passionate worship leader who has captured the hearts of believers across the globe with her vocals in ‘Oceans’ and ‘Touch The Sky’ on UNITED’s most recent albums, Empires and Zion.

Taya’s passion for the house of God was first nurtured in Lismore as a part of the worship team and a youth leader. When secular singing work led to Taya moving to Sydney in 2010, she became a part of Hillsong Church’s City Campus as a volunteer in the youth and young adults ministries and the church creative team. Soon after, her love for both worship and youth came together perfectly as she became involved in the church’s youth worship expression Young &amp; Free’s debut album and subsequent tours.', 'New South Wales, Australia', 1, '/wjinKSaHDLqA6qql4Jm6pK2niQe.jpg'),
