        (1700367, 'Camille Lou', '1992-05-22', 'Camille Lou est née le 22 mai 1992 à Maubeuge. Son père est chanteur et guitariste d''un groupe de musique appelé Paradoxe, ses sœurs et elle sont donc initiées au chant et à la musique très tôt, chacune apprenant à jouer d''un instrument, le violon pour Camille. À l''âge de douze ans, elle remporte un concours local de chant, les Voix de Noël, à Hautmont. Elle suit sa scolarité au lycée Notre-Dame de Grâce à Maubeuge. Après avoir obtenu son baccalauréat ES mention bien, elle s''inscrit en droit à l''université de Valenciennes.

En janvier 2010, elle commence sa carrière solo sous le pseudo de Jimmie, avec l''aide de son professeur de guitare de l’époque. Elle commence à chanter et sort son premier album La Grande Aventure, de style pop-rock. Elle fait beaucoup de premières parties sous son pseudonyme de Jimmie, notamment celle de Cœur de Pirate en mars 20103.

Amie avec les chanteurs Nuno Resende et Merwan Rim, elle est encouragée par ce dernier pour approcher Dove Attia, pour lequel Resende et Rim travaillent alors sur Mozart, l''opéra rock. Après lui avoir chanté une chanson du film Once, Falling Slowly4, Dove Attia, intéressé, l''invite à passer des castings pour sa prochaine comédie musicale. Quelques mois plus tard, en 2011, elle reçoit le rôle Olympe, servante de Marie-Antoinette, dans la comédie musicale 1789, les amants de la Bastille.

Camille Lou avec Louis Delort dans 1789, les amants de la Bastille.

En décembre 2014, elle enregistre une chanson pour l’album We Love Disney avec Garou, une reprise de la chanson La Belle et la Bête du film éponyme.

Elle a également réalisé des shootings pour la marque Tara Jarmon.

Depuis la fin de 1789, les amants de la Bastille, elle se consacre à ses projets solos mais également à sa « bande » composée de cinq chanteurs qui se produisent dans l''émission Les Chansons d''abord aux côtés de Natasha St-Pier, diffusée tous les dimanches à 17 h sur France 3.

En 2014, Dove Attia lui propose le rôle de Guenièvre dans sa nouvelle comédie musicale, La Légende du roi Arthur. La première représentation aura lieu le 17 septembre 2015 au Palais des congrès de Paris avant une tournée en France en 2016.

En 2016, elle fera partie de la distribution du film Marché noir d''Emmanuel Fricero, dans lequel elle jouera le rôle d''Hélène Barignet, une jeune infirmière mêlée à de sombres affaires.

