        (1704672, 'David Shae', '1981-09-03', 'David Shae is an Actor from Rhode Island currently based in Atlanta, GA. David''s first taste of acting was in High School, within his sketch group The Blueberry Johnsons. David and his best friends wrote and performed SNL style sketches, touring the local club scene in Providence, RI. From there, David moved to Los Angeles, embarking on the path to a professional career. He was accepted to the University of Southern California, where he lived off-campus in the Delta Chi fraternity house. He completed his college curriculum during the day, followed by acting classes at night. His mentors included the likes of Janet Alhanti, Margie Haber, and Ivana Chubbuck. Their training led to many smaller roles in independent productions. But it wasn''t until his move to The South when David''s career really started gaining traction. His first major network production was an episode of House Of Cards, playing Buha - press secretary to Joel Kinnaman - in an episode directed by Robin Wright. This led to more television gigs, such as The Gifted, Lodge 49, The Originals, and many others. From there, David began entering the world of feature films, with a supporting role in Gemini Man, directed by the Oscar-winning director Ang Lee. Currently, he continues to act in both mediums. While not working, David is involved with local charitable pursuits, such as using ''improv as therapy'' to children with behavioral complications. He also immerses himself in anything animal related, as his rescued dog Tess has been by his side for 13 years now, enriching his life immeasurably.', 'Cranston, Rhode Island, USA', 1, '/mGL1R1xLaiKq9lrHdlnjvqarN1V.jpg'),
