        (1707343, 'Eiji Inoue', NULL, 'Accomplished actor and martial artist, Eiji Inoue impacted audiences with his performance in In the Cage (2013) as the character San Tao. He has also appeared in many well-known films such as The Last Samurai, Click, and Pearl Harbor. For the episode "Chimera" from NCIS, Eiji Inoue impressed production so much that they switched a role from one concept to another just so that Eiji could play the character, Satoshi Takada. During Eiji Inoue''s acting career of 23 years, he has appeared in more than 60 plays. He is best known for his role as Takeshi Kawabata in Take Me Out a play by Richard Greenberg. This Tony Award winning production made a revival in Los Angeles and continued to be extended 3 times winning both critics'' and audiences hearts alike. Not only is Eiji Inoue a driven and talented actor, he is also extremely experienced in Chinese martial arts, specifically Wushu Kungfu. With over 30 years of martial arts training and competitions, Eiji is adept in 18 different styles and weaponry uses. Some of which are Broad Sword, Double Broad Sword, Straight Sword, Long Spear, 3 Section Staff, Japanese Samurai Sword, etc. Because Eiji continues to perfect his craft by participating in theater when not working on films and TV, he has had the privilege of being cast alongside prolific actors such as Tom Cruise, Leonardo DiCaprio, Ben Affleck, Josh Hartnett, Adam Sandler, Meg Ryan, Arnold Schwarzenegger, and many more. Awards: ADA Award for Best Ensemble Cast for The Box. Nominations: His independent film Pearlblossom Hwy (2012) for AFI''s Film Festival Top 10. Official Selections for Vienna International Film Festival, AFI Fest, Starz Denver Film Festival, International Film Festival Rotterdam, Bradford International Film Festival, San Francisco International Film Festival. Eiji Inoue''s next project, Conversation, is expected to shoot in November 2014. With 2 projects already slated to come out in 2015, Eiji Inoue is one busy actor ready for more prominent roles and creatively challenging projects.', NULL, 1, '/uWdH3PpldrErRpSv2O7pNGXGJXo.jpg'),
