        (1717916, 'Ross O''Hennessy', '1974-01-01', 'Ross O''Hennessy was born in Pontllanfraith, South Wales but always knew he wanted to be actor. So at the tender age of 16 he packed his bags and moved to London. He spent a few years treading the boards with the National Youth Theatre before winning the Sir John Mills Scholorship to attend Private Drama School. After finishing a 3 years diploma course at The Mountview Academy of Theatre Arts, Ross launched straight into a highly successful play with Lauren Bacall which in turn took him to the Royal Shakespeare Company. From Theatre to Film and television was a natural progression and he has worked successfully on screen and his career continues to grow from strength to strength.', 'Pontllanfraith, Wales', 1, '/qXSlIWAjtCsxdDRYbK9TOsaLKfL.jpg'),
