        (1719075, 'Christina Grimmie', '1994-03-12', 'Christina Grimmie (12 March 1994 - 10 June 2016) was a cover artist from YouTube, under the user name "zeldaxlove64". Her fans all go into a group of people called "Team Grimmie", which is a group of fans that give their support. At her fairly young age, she''s already gotten the spotlight by being the guest performer on Disney Channel''s So Random! (2011). She has already released her debut album "Find Me", now available on iTunes, with songs written by herself. Today, she still continues to upload covers on YouTube. On June 10, 2016, Grimmie was shot three times by 27-year-old Kevin James Loibl of St. Petersburg, Florida, while she signed autographs following her performance with Before You Exit at The Plaza Live in Orlando. Loibl then fatally shot himself after being tackled by Grimmie''s brother Marcus. Grimmie was taken to the Orlando Regional Medical Center in critical condition; she died early the following day.', 'Marlton, New Jersey, USA', 1, '/nocvTjP4ISvspEsUNFUElCtnDoO.jpg'),
