        (1728992, 'Morgan Dameron', NULL, 'Morgan Dameron has always blazed her own path. While in high school, she was awarded the Women in Film and Television in Kansas City’s “Trailblazer Award” for Up and Coming Women in Film in 2007. She received a full ride scholarship to the University of Southern California’s School of Cinematic Arts, where she graduated summa cum laude. Her award-winning short films have been selected for film festivals worldwide. After graduating, she worked at Bad Robot Productions on such productions as STAR TREK: INTO DARKNESS, and STAR WARS: THE FORCE AWAKENS, where Poe Dameron shares her last name. Most recently she wrote, directed and produced her first feature film, DIFFERENT FLOWERS, which premiered at the 32nd Santa Barbara International Film Festival and will be in select theaters nationwide September 29th, 2017. She lives in Los Angeles.', NULL, 1, NULL),
