        (1739117, 'Kane Mahon', NULL, 'Kane Mahon is a Canadian Academy-nominated actor and one of the most promising stars in the country. His diverse body of work continues to grow with some of most respected names in the entertainment industry. His two major projects at the moment include the Angelina Jolie-produced feature animation The Breadwinner, directed by Nora Twomey, which opens to industry acclaim at TIFF this year as well as Amazon''s new Original Series Patriot, which sees Kane step into the recurring role of Mikham Candahar alongside stars such as Terry O''Quinn, Kurtwood Smith, Gil Bellows and many others.

An extremely versatile actor, he is known for completely immersing himself in each character he plays. Recognition for his talent includes nominations for Best Actor at the Vancouver Web Festival, Best Leading Male at the Rio Web Festival, and Best Performance at the Canadian Screen Awards.

After he earned his high school diploma in literature, Mahon decided to study Diplomacy and return to Afghanistan. However after finishing university with a Masters in International Relations, already in Canada, he reached a crossroad in his life and instead of following his political aspirations he decided to pursue his long-awaited dream of carving out a career in the art of storytelling.

Mahon is fluent in English, Russian and Dari. In his spare time, he writes, directs, and produces, as well translates children''s books. He is also an amateur astrophotographer.', NULL, 1, '/z98t1BR4hco3xUztzaCisxs5Zip.jpg'),
