        (1741856, 'Matthew D''Arcy', NULL, 'Matthew D''Arcy is an American actor. After graduating from Drexel University, Mathew traveled to South Korea for the Department of State''s Critical Language Scholarship and Fulbright Fellowship.

Mathew spent two years in South Korea, making his entry into the Korean entertainment industry in his second year. His film debut came when he was cast as General MacArthur''s scribe officer in Battle for Incheon: Operation Chromite (2016). Working with Director John H. Lee alongside Liam Neeson solidified Mathew''s interest in acting, and he soon after made appearances on South Korean TV Networks including TVN - Saturday Night Live Korea (2011), KBS ''Good Morning'' - Haphazard Neighborhood Travel, web and TV commercials, as well as in the Korean drama and KPOP sectors.

Matthew returned to the States in 2016 and booked a lead role in Kai Liang''s Philadelphia-based student short ''The Bandaged Heart,'' followed by a featured role in Neil Burger''s The Upside (2017).

During the latter half of 2017, Mathew was cast in a supporting role in the upcoming Korean tap-dancing film Swing Kids (2018), directed by Hyeong-Cheol Kang.', NULL, 1, '/sy3aNnXaxqFQgm99zBu6Do6Es1u.jpg'),
