        (1753331, 'Kera Lynn', NULL, 'Kera Lynn is an actress, model, on-camera host, and voiceover artist in Los Angeles. Kera was born in Oceanside, California (she''s an Aries!), but as a young girl she moved to Lincoln, Nebraska, where she grew up. After graduating from high school, her adventurous spirit led her to sample life in all corners of the U.S., from Mississippi, Utah, and Nevada, to Florida and Texas. It was while in Austin that Kera first began modeling, and Miami was where the acting bug first bit. 

After landing a role in Paramount’s upcoming Baywatch movie (starring Dwayne “The Rock” Johnson and Zac Efron), and shooting ten commercial spots (directed by renowned Venezuelan visual artist Jorge Pease) as spokesperson for Florida real estate giant Real 39, Kera decided to move back to her native California permanently, relocating to L.A. in the summer of 2016. 

Motivated, fearless, determined, and 100% unique, Kera considers it a blessing to be able to do what she loves for a living.', 'Oceanside, California, USA', 1, '/tRzYtM6JumKxkACxzuGCtjCQlSK.jpg'),
